//eapyl.github.io/xamarin-dev-days-in-warsaw/":{"tf":1.0}},"df":1}}}}},"e":{"docs":{},"df":0,"b":{"docs":{"https://eapyl.github.io/persistence-js-insert-empty-values-in-web-sql/":{"tf":1.0},"https://eapyl.github.io/replace-physical-path-of-web-sites-in-iis7/":{"tf":1.0}},"df":2,"s":{"docs":{},"df":0,"q":{"docs":{},"df":0,"l":{"docs":{"https://eapyl.github.io/use-websql-and-indexeddb-in-typescript/":{"tf":1.0}},"df":1}}}},"e":{"docs":{},"df":0,"k":{"docs":{"https://eapyl.github.io/bootstrap-datepicker-week-mode-view/":{"tf":1.0}},"df":1}}},"i":{"docs":{},"df":0,"n":{"docs":{},"df":0,"d":{"docs":{},"df":0,"o":{"docs":{},"df":0,"w":{"docs":{"https://eapyl.github.io/radio-on-windows-iot-via-telegram/":{"tf":1.0}},"df":1}}},"r":{"docs":{},"df":0,"t":{"docs":{"https://eapyl.github.io/winrt-checksum-for-large-files/":{"tf":1.0}},"df":1}}},"t":{"docs":{},"df":0,"h":{"docs":{},"df":0,"o":{"docs":{},"df":0,"u":{"docs":{},"df":0,"t":{"docs":{"https://eapyl.github.io/response-without-root-element/":{"tf":1.0}},"df":1}}}}}}},"x":{"docs":{},"df":0,"a":{"docs":{},"df":0,"m":{"docs":{},"df":0,"a":{"docs":{},"df":0,"r":{"docs":{},"df":0,"i":{"docs":{},"df":0,"n":{"docs":{"https://eapyl.github.io/xamarin-dev-days-in-warsaw/":{"tf":1.0}},"df":1}}}}}}},"z":{"docs":{},"df":0,"a":{"docs":{},"df":0,"d":{"docs":{},"df":0,"g":{"docs":{},"df":0,"r":{"docs":{},"df":0,"a":{"docs":{},"df":0,"p":{"docs":{},"df":0,"h":{"docs":{"https://eapyl.github.io/use-zadgraph/":{"tf":1.0}},"df":1}}}}}}},"i":{"docs":{},"df":0,"p":{"docs":{"https://eapyl.github.io/fiddler-zip-extension/":{"tf":1.0}},"df":1}}}}}},"documentStore":{"save":true,"docs":{"https://eapyl.github.io/":{"body":"","id":"https://eapyl.github.io/","title":""},"https://eapyl.github.io/0x80004005-failed-to-execute-url/":{"body":"The error was connected with GET requests. ApplicationPool was set in Classic mode.\nThere is HttpModule, which throws this type of exceptions:\n\nSystem.Web.HttpException (0x80004005): Failed to Execute URL.\nat System.Web.Hosting.ISAPIWorkerRequestInProcForIIS6.BeginExecuteUrl(String url, String method, String childHeaders, Boolean sendHeaders, Boolean addUserIndo, IntPtr token, String name, String authType, Byte[] entity, AsyncCallback cb, Object state)\nat System.Web.HttpResponse.BeginExecuteUrlForEntireResponse(String pathOverride, NameValueCollection requestHeaders, AsyncCallback cb, Object state)\nat System.Web.DefaultHttpHandler.BeginProcessRequest(HttpContext context, AsyncCallback callback, Object state)\nat System.Web.HttpApplication.CallHandlerExecutionStep.System.Web.HttpApplication.IExecutionStep.Execute()\nat System.Web.HttpApplication.ExecuteStep(IExecutionStep step, Boolean&amp; completedSynchronously)\n\ncontained the next source code in event context.BeginRequest:\napp.Context.RewritePath(app.Context.Request.Path);\n\nThe solve of the problem is:\napp.Context.RewritePath(app.Context.Request.FilePath, app.Context.Request.PathInfo, string.Empty);\n","id":"https://eapyl.github.io/0x80004005-failed-to-execute-url/","title":"0x80004005 Failed to Execute URL"},"https://eapyl.github.io/about/":{"body":"Yauhen Pyl (Elm/.Net/Rust developer)\n\nFacebook\nLinkedIn\nGitHub\nMailMe\n\n","id":"https://eapyl.github.io/about/","title":"About"},"https://eapyl.github.io/add-dotnet-command-to-alias-of-bash/":{"body":"Dotnet commands\nI am using sample application created by dotnet run.\nTo run dotnet core application on Ubuntu with compilation:\ndotnet run -p {pathToFolderWithProjectJson} -- {arguments}\n\nTo run compiled application:\ndotnet {pathToCompiledDll} {arguments}\n\nwhere pathToCompiledDll is a path to dll (it is in /bin/Debug/netcoreapp1.1/ be default).\nBash commands\nTo add dotnet alias (shortcut) to bash set of commands:\nnano ~/.bash_aliases\n\nAnd you need to add the next line to this file (bash_aliases):\nalias helloWorld=\"dotnet run -p ~/projects/helloWorld -- ~/Peter\"\n\nwhere \n\n~/projects/helloWorld is path to the project;\n~/Peter is an argument passed to the application;\n\nNow you are able to run helloWorld in bash terminal after restarting it. You should see Hello World.\nLinks:\n\nHow do I create shortcut commands in the Ubuntu terminal?\ndotnet run\nHow to create a permanent alias?\n\n","id":"https://eapyl.github.io/add-dotnet-command-to-alias-of-bash/","title":"Add dotnet command to alias of bash"},"https://eapyl.github.io/api-facebook/":{"body":"I know there are a lot of information about working with Facebook API, but... I just think more information is better then less.\n\nI need to post different types of context to Facebook pages (user create his own page, give us the name of page). OK, let's go!\nI m using ASP.NET MVC, you know...\nLink to the project.\nAll events has been shown on the main page.\n\nCreate our application in facebook.\n\n\nYou see there is secret key and application key. We need them to working with facebook through our application.\n\nAuthorization (OAuth 2.0).\n\n\n\nAsk user to permission.\nUser will be redirected to facebook access page.\nUser give us needed permission.\nUser has been redirected back to our web site with special code.\n\nThere is the step 4 (we get the code from redirecting response).\npublic void GetAccessToken()\n{\n    if (HttpContext.Current.Request.Params.AllKeys.Contains(\"code\"))\n    {\n        code = HttpContext.Current.Request.Params[\"code\"];\n        //get the short-lived user access_toke\n        string request = string.Format(_tokenEndpoint, _applicationId, _redirectTo, _applicationSecret, code);\n        var webClient = new WebClient();\n        string response = webClient.DownloadString(request);\n        string[] pairResponse = response.Split('&amp;');\n        accessToken = pairResponse[0].Split('=')[1];\n        //get the long-lived user access_toke\n        request = string.Format(_exchangeAccessToken, _applicationId, _applicationSecret, accessToken);\n        webClient = new WebClient();\n        response = webClient.DownloadString(request);\n        if (!accessToken.Equals(response.Split('=')[1]))\n        {\n            throw new AccessViolationException();\n        }\n        GetUserInformation();\n    }\n    else if (HttpContext.Current.Request.Params.AllKeys.Contains(\"error\"))\n    {\n        error = HttpContext.Current.Request.Params[\"error\"];\n        throw new AccessViolationException(error);\n    }\n    throw new HttpException();\n}\n\nThat is my facebook controller\npublic ActionResult Index()\n{\n    if (!Client.IsAuthorizated)\n    {\n        return Redirect(Client.UriToAuth);\n    }\n    return View(new FacebookModel {Name = \"\"});\n}\n\npublic ActionResult Authorizate()\n{\n    Client.GetAccessToken();\n    return RedirectToAction(\"Index\");\n}\n\nAfter getting code we need to get the id of the page:\nprivate void GetUserInformation()\n{\n    string request = \"https://graph.facebook.com/me?access_token=\" + accessToken;\n    var webClient = new WebClient();\n    string response = webClient.DownloadString(request);\n    user = JObject.Parse(response);\n    GetPagesInformation();\n}\n\nprivate void GetPagesInformation()\n{\n    string request = \"https://graph.facebook.com/\" + user.SelectToken(\"id\") + \"/accounts?access_token=\" +\n                        accessToken;\n    var webClient = new WebClient();\n    string response = webClient.DownloadString(request);\n    userPages = JObject.Parse(response);\n    page = userPages.SelectToken(\"data\").First(x =&gt; x.SelectToken(\"name\").ToString().Equals(_pageName));\n}\n\n\nOK, let's start to posting something. Here is my configuration:\n\nprivate static readonly Dictionary&lt;string, string&gt; Config = new Dictionary&lt;string, string&gt;\n{\n    {\"AuthorizationEndpoint\", \"https://graph.facebook.com/oauth/authorize?client_id={0}&amp;redirect_uri={1}&amp;scope=manage_pages,create_event,publish_stream\"},\n    {\"TokenEndpoint\", \"https://graph.facebook.com/oauth/access_token?client_id={0}&amp;redirect_uri={1}&amp;client_secret={2}&amp;code={3}\"},\n    {\"ApplicationId\", \"387222228001291\"},\n    {\"ApplicationSecret\", \"3a177e2231e2966733771775b42\"},\n    {\"RedirectTo\", \"http://localhost:4769/Facebook/Authorizate\"},\n    {\"PageName\", \"TesterMyRest Community\"}\n};\n\nPosting video.\npublic string CreateVideo(MemoryStream imageMemoryStream, string title, string fileName)\n{\n    string boundary = \"---------------------------\" + DateTime.Now.Ticks.ToString(\"x\");\n    var uploadRequest =\n        (HttpWebRequest)\n        WebRequest.Create(\"https://graph.facebook.com/\" + page.SelectToken(\"id\") + \"/videos?access_token=\" +\n                            page.SelectToken(\"access_token\"));\n    uploadRequest.ServicePoint.Expect100Continue = false;\n    uploadRequest.Method = \"POST\";\n    uploadRequest.UserAgent = \"Mozilla/4.0 (compatible; Windows NT)\";\n    uploadRequest.ContentType = \"multipart/form-data; boundary=\" + boundary;\n    uploadRequest.KeepAlive = false;\n\n    var sb = new StringBuilder();\n\n    const string formdataTemplate = \"--{0}\\r\\nContent-Disposition: form-data; name=\\\"{1}\\\"\\r\\n\\r\\n{2}\\r\\n\";\n    sb.AppendFormat(formdataTemplate, boundary, \"title\", HttpContext.Current.Server.HtmlEncode(title));\n\n    const string headerTemplate = \"--{0}\\r\\nContent-Disposition: form-data; name=\\\"{1}\\\"; filename=\\\"{2}\\\"\\r\\nContent-Type: {3}\\r\\n\\r\\n\";\n    sb.AppendFormat(headerTemplate, boundary, \"source\", fileName, @\"application/octet-stream\");\n\n    string formString = sb.ToString();\n    byte[] formBytes = Encoding.UTF8.GetBytes(formString);\n    byte[] trailingBytes = Encoding.UTF8.GetBytes(\"\\r\\n--\" + boundary + \"--\\r\\n\");\n\n    long imageLength = imageMemoryStream.Length;\n    long contentLength = formBytes.Length + imageLength + trailingBytes.Length;\n    uploadRequest.ContentLength = contentLength;\n\n    uploadRequest.AllowWriteStreamBuffering = false;\n    Stream strmOut = uploadRequest.GetRequestStream();\n\n    strmOut.Write(formBytes, 0, formBytes.Length);\n\n    var buffer = new Byte[checked((uint) Math.Min(4096, (int) imageLength))];\n    int bytesRead;\n    imageMemoryStream.Seek(0, SeekOrigin.Begin);\n    while ((bytesRead = imageMemoryStream.Read(buffer, 0, buffer.Length)) != 0)\n    {\n        strmOut.Write(buffer, 0, bytesRead);\n    }\n\n    strmOut.Write(trailingBytes, 0, trailingBytes.Length);\n\n    strmOut.Close();\n\n    var wresp = uploadRequest.GetResponse() as HttpWebResponse;\n    Encoding enc = Encoding.UTF8;\n    if (wresp != null)\n    {\n        var stream = wresp.GetResponseStream();\n        if (stream != null)\n        {\n            var loResponseStream = new StreamReader(stream, enc);\n            return \"https://graph.facebook.com/\" + loResponseStream.ReadToEnd();\n        }\n    }\n    return string.Empty;\n}\n\n\nChange the information about the page.\n\nWebHelper class:\npublic static class WebWorker\n{\n    private static void AddPostParameter(Dictionary&lt;string, string&gt; values, StringBuilder postBody)\n    {\n        foreach (string key in values.Keys)\n        {\n            if (postBody.Length &gt; 0)\n            {\n                postBody.Append(\"&amp;\");\n            }\n            postBody.Append(string.Format(\"{0}={1}\", key, values[key]));\n        }\n    }\n\n    public static JObject DownloadJson(string requestUrl)\n    {\n        var webClient = new WebClient();\n        string response = webClient.DownloadString(requestUrl);\n        return JObject.Parse(response);\n    }\n\n    public static string UploadString(string requstUrl, Dictionary&lt;string, string&gt; values)\n    {\n        var webClient = new WebClient();\n        var postBody = new StringBuilder();\n        AddPostParameter(values, postBody);\n        return webClient.UploadString(requstUrl, postBody.ToString());\n    }\n}\nprivate string CreateStatus(Dictionary&lt;string, string&gt; values)\n{\n    string request = \"https://graph.facebook.com/\" + page.SelectToken(\"id\") + \"/feed?access_token=\" +\n                        page.SelectToken(\"access_token\");\n    return WebWorker.UploadString(request, values);\n}\n","id":"https://eapyl.github.io/api-facebook/","title":"API Facebook"},"https://eapyl.github.io/asp-net-mvc-and-html-hidden/":{"body":"There is interesting bug connected with Html.Hidden.\nThere are two model:\npublic class  Model1{\npublic int ID{get;set;}\npublic Model2 Model2Model{get;set;}\n}\npublic class Model2{\npublic int ID{get;set;}\n}\n\nPage:\n&lt;html&gt;\n...\n&lt;body&gt;\n@Html.Partial(\"partial\"\n&lt;body&gt;\n&lt;/html&gt;\n","id":"https://eapyl.github.io/asp-net-mvc-and-html-hidden/","title":"ASP.NET MVC and Html.Hidden"},"https://eapyl.github.io/asp-net-mvc-bundle-minification/":{"body":"ASP.NET MVC Bundle Minification\nIf you try to add Bundle from Web.Optimization library to your existing project and your Web.config file\n\nso runAllManagedModulesForAllRequests=\"false\".\nYou start to get 404- Not found response to your bundle requests.\n\nJust enable BundleModule and all will be OK ! ;)\n","id":"https://eapyl.github.io/asp-net-mvc-bundle-minification/","title":"ASP.NET MVC Bundle Minification"},"https://eapyl.github.io/auto-deployment-for-ssrs-reports/":{"body":"If you work with SSRS it is not so easy to create CI build for SSRS project. It looks like the best approach is to use shared datasources, shared datasets and embedded datasets in reports which use shared datasets. Shared datasets should use stored procedures to receive data so you will be able to cover your SQL logic by unit tests.\n\nSo you will have the next types of files in your project:\n\n*.rdl - reports\n*.rsd - shared datasets\n*.rds - shared datasources\n\nTo deploy them to clean SSRS server we can use RS tool. And that is a bat file to call it:\nREM SSRS server, you can provide also user and password to RS tool if you can't use Windows credentials (default behaviour)\nset varServerPath=http://desktop-h33a7aa/reportserver\nREM name of folder at SSRS server for reports\nset varReportFolder=My_Reports\nREM name of folder at SSRS server for datasets\nSet varDatasetFolder=Datasets\nREM name of folder at SSRS server for data sources\nset varDataSourceFolder=Data Sources\nREM path to a folder with reports, datasets and datasources\nset varReportFilePath=.\\Project\\Reports\\My_Reports\n\n\"C:\\Program Files\\Microsoft SQL Server Reporting Services\\Shared Tools\\rs.exe\" -i Commonscript.rss -s %varServerPath% -v ReportFolder=\"%varReportFolder%\" -v DataSetFolder=\"%varDatasetFolder%\" -v DataSourceFolder=\"%varDataSourceFolder%\" -v filePath=\"%varReportFilePath%\" -e Mgmt2010\n\nAll logic is described in Commonscript.rss. It creates folders in SSRS server for reports, datasets and datasources (using CreateFolders method), later it reads all *.rds files in varReportFilePath and create datasources for each file if it doesn't exist. After it reads all *.rsd files in varReportFilePath, create datasets and connects a dataset with a datasource. In the end it read all *.rdl files in varReportFilePath, create reports and connects a report with a dataset.\nDim definition As [Byte]() = Nothing\nDim bytedefinition as [Byte]() = nothing\nDim warnings As Warning() = Nothing\n\n'Main Entry point of utility\nPublic Sub Main()\n    Console.WriteLine()\n    Console.WriteLine(\"Initiating Deployment\")\n    rs.Credentials = System.Net.CredentialCache.DefaultCredentials\n    Try\n        'Create the shared data source\n        CreateFolders(DataSourceFolder,\"/\",\"Data Sources\",\"Visible\")\n        'Create the folder that will contain the shared data sets\n        CreateFolders(DataSetFolder, \"/\", \"Data Set Folder\", \"Visible\")\n        'Create the folder that will contain the deployed reports\n        CreateFolders(ReportFolder, \"/\", \"Report Folder\",\"Visible\")\n    Catch goof As Exception\n        Console.WriteLine(goof.Message)\n    End Try\n    ReadFiles(filepath, \"*.rds\")\n    ReadFiles(filepath, \"*.rsd\")\n    ReadFiles(filepath, \"*.rdl\")\nEnd Sub\n \n'Utility for creation of folders\nPublic Sub CreateFolders(ByVal folderName as string, ByVal parentPath as string, ByVal description as String, ByVal visible as string)\n    Console.WriteLine()\n    Console.WriteLine(\"Checking for Target Folders\")\n    'CatalogItem properties\n    Dim descriptionProp as new [Property]\n    descriptionProp.Name = \"Description\"\n    descriptionProp.Value= description\n    Dim visibleProp as new [Property]\n    visibleProp.Name = \"Visible\"\n    visibleProp.value= visible\n    Dim props(1) as [Property]\n    props(0) = descriptionProp\n    props(1) = visibleProp\n    Try\n        rs.CreateFolder(folderName,parentPath,props)\n        Console.WriteLine(\"Folder {0} successfully created\", foldername)\n    Catch goof as SoapException\n        If goof.Message.Indexof(\"AlreadyExists\")&gt;0 Then\n            Console.WriteLine(\"Folder {0} already exists\",foldername)\n        End If\n    End Try\nEnd Sub\n \n'Utility for reading files from the Report Sevices Project\nPublic sub ReadFiles(filepath as string, fileextension as string)\n    Console.WriteLine()\n    Console.WriteLine(\"Reading Files from Report Services Project\")\n    Dim rptdirinfo As System.IO.DirectoryInfo\n    rptdirinfo = New System.IO.DirectoryInfo(filepath)\n    Dim filedoc As FileInfo()\n    filedoc = rptdirinfo.GetFiles(fileextension)\n    Try\n        For rptcount As Integer = 0 To filedoc.Length-1\n            If Not filedoc(rptcount).Name.ToString.Trim.ToUpper.Contains(\"BACKUP\") Then\n                SELECT Case fileextension\n                Case \"*.rds\"\n                    CreateDataSource(filedoc(rptcount).tostring.trim)\n                Case \"*.rsd\"\n                    CreateDataSet(filedoc(rptcount).tostring.trim)\n                Case \"*.rdl\"\n                    PublishReport(filedoc(rptcount).tostring.trim)\n                End Select\n            End If\n        Next\n    Catch goof as Exception\n        Console.WriteLine(\"In ReadFiles \" + goof.message)\n    End Try\nEnd Sub\n \n'Utility for Creating Shared Data Sets contained in the project\nPublic Sub CreateDataSet(ByVal filename as string)\n    Dim valstart as integer\n    Dim valend as integer\n    Dim DSDefinitionStr as string\n    Dim DataSourceName as string\n    Dim QueryString as string\n    Try\n        Dim stream As FileStream = File.OpenRead(filePath + \"\\\" + filename )\n        definition = New [Byte](stream.Length-1) {}\n        stream.Read(definition, 0, CInt(stream.Length))\n        stream.Close()\n        For i As Integer = 0 To definition.Length - 1\n            DSDefinitionStr = DSDefinitionStr + Convert.ToString(Convert.ToChar(Convert.ToInt16(definition(i).ToString)))\n        Next\n        valstart=DSDefinitionStr.ToString.Indexof(\"&lt;DataSourceReference&gt;\")\n        If valstart &gt; 0 Then\n            valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;DataSourceReference&gt;\") + 21\n            valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/DataSourceReference&gt;\")\n            DataSourceName=DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n            Console.WriteLine(DataSourceName)\n        End If\n    Catch e As IOException\n        Console.WriteLine(e.Message)\n    End Try\n    filename=filename.tostring.replace(\".rsd\",\"\")\n    Console.WriteLine(\"Attempting to Deploy DataSet {0}\", filename)\n    Try\n        Dim item as CatalogItem\n        item=rs.CreateCatalogItem(\"DataSet\",filename, \"/\" + DataSetFolder, false, definition, nothing, warnings)\n        If Not (warnings Is Nothing) Then\n            Dim warning As Warning\n            For Each warning In warnings\n                if warning.message.tostring.tolower.contains(\"refers to the shared data source\") then\n                    Console.WriteLine(\"Connecting DataSet {0} to Data Source {1}\",filename, DataSourceName)\n                    Dim referenceData() as ItemReferenceData = rs.GetItemReferences(\"/\" + DataSetFolder + \"/\" + filename,\"DataSet\")\n                    Dim references(0) as ItemReference\n                    Dim reference as New ItemReference()\n                    Dim datasourceURL = \"/\" + DataSourceFolder + \"/\" + DataSourceName\n                    reference.name=referenceData(0).Name\n                    Console.WriteLine(\"Reference name = \" + reference.name)\n                    reference.Reference=datasourceURL\n                    references(0)=reference\n                    rs.SetItemReferences(\"/\" + DataSetFolder + \"/\" + filename, references)\n                else\n                    Console.WriteLine(warning.Message)\n                end if\n            Next warning\n        Else\n            Console.WriteLine(\"DataSet: {0} published successfully with no warnings\", filename)\n        End If\n    Catch goof as SoapException\n        If goof.Message.Indexof(\"AlreadyExists\")&gt;0 Then\n            Console.WriteLine(\"The DataSet {0} already exists\",fileName.ToString)\n        Else\n            If goof.Message.IndexOf(\"published\")=-1 Then\n                Console.Writeline(goof.Message)\n            End If\n        End If\n    End Try\nEnd Sub\n \n'Utility for creating Data Sources on the Server\nPublic Sub CreateDataSource(filename as string)\n    'Define the data source definition.\n    Dim dsDefinition As New DataSourceDefinition()\n    Dim DataSourceName as string\n    Dim valstart As Integer\n    Dim valend As Integer\n    Dim ConnectionString As String\n    Dim Extension As String\n    Dim IntegratedSec As String\n    Dim DataSourceID As String\n    Dim PromptStr As String\n    PromptStr=\"\"\n    Dim DSDefinitionStr As String\n    DSDefinitionStr = \"\"\n    DataSourceName=filename.tostring.trim.substring(0,filename.tostring.trim.length-4)\n    Console.WriteLine(\"Attempting to Deploy Data Source {0}\", DataSourceName)\n    Try\n        Dim stream As FileStream = File.OpenRead(filepath + \"\\\" + filename)\n        bytedefinition = New [Byte](stream.Length-1) {}\n        stream.Read(bytedefinition, 0, CInt(stream.Length))\n        stream.Close()\n        For i As Integer = 0 To bytedefinition.Length - 1\n            DSDefinitionStr = DSDefinitionStr + Convert.ToString(Convert.ToChar(Convert.ToInt16(bytedefinition(i).ToString)))\n        Next\n    Catch goof As IOException\n        Console.WriteLine(goof.Message)\n    End Try\n    If DSDefinitionStr.ToString.Contains(\"&lt;ConnectString&gt;\") And DSDefinitionStr.ToString.Contains(\"&lt;/ConnectString&gt;\") Then\n        valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;ConnectString&gt;\") + 15\n        valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/ConnectString&gt;\")\n        ConnectionString = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n    End If\n    If DSDefinitionStr.ToString.Contains(\"&lt;Extension&gt;\") And DSDefinitionStr.ToString.Contains(\"&lt;/Extension&gt;\") Then\n        valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;Extension&gt;\") + 11\n        valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/Extension&gt;\")\n        Extension = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n    End If\n    If DSDefinitionStr.ToString.Contains(\"&lt;IntegratedSecurity&gt;\") And DSDefinitionStr.ToString.Contains(\"&lt;/IntegratedSecurity&gt;\") Then\n        valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;IntegratedSecurity&gt;\") + 20\n        valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/IntegratedSecurity&gt;\")\n        IntegratedSec = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n    End If\n    If DSDefinitionStr.ToString.Contains(\"&lt;DataSourceID&gt;\") And DSDefinitionStr.ToString.Contains(\"&lt;/DataSourceID&gt;\") Then\n        valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;DataSourceID&gt;\") + 14\n        valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/DataSourceID&gt;\")\n        DataSourceID = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n    End If\n    If DSDefinitionStr.ToString.Contains(\"&lt;Prompt&gt;\") And DSDefinitionStr.ToString.Contains(\"&lt;/Prompt&gt;\") Then\n        valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;Prompt&gt;\") + 8\n        valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/Prompt&gt;\")\n        PromptStr = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n    End If\n    dsdefinition.CredentialRetrieval = CredentialRetrievalEnum.Integrated\n    dsdefinition.ConnectString = ConnectionString\n    dsdefinition.Enabled = True\n    dsdefinition.EnabledSpecified = True\n    dsdefinition.Extension = extension\n    dsdefinition.ImpersonateUser = False\n    dsdefinition.ImpersonateUserSpecified = True\n    'Use the default prompt string.\n    If PromptStr.ToString.Length=0 Then\n        dsdefinition.Prompt = Nothing\n    Else\n        dsdefinition.Prompt = PromptStr\n    End if\n    dsdefinition.WindowsCredentials = False\n    Try\n        rs.CreateDataSource(DataSourceName, \"/\" + DataSourceFolder, False, dsdefinition, Nothing)\n        Console.WriteLine(\"Data source {0} created successfully\", DataSourceName.ToString)\n    Catch goof as SoapException\n        If goof.Message.Indexof(\"AlreadyExists\")&gt;0 Then\n            Console.WriteLine(\"The Data Source name {0} already exists\",DataSourceName.ToString)\n        End If\n    End Try\nEnd Sub\n \n'Utility to Publish the Reports\nPublic Sub PublishReport(ByVal reportName As String)\n    Console.WriteLine(\"Publishing \" + reportName)\n    Dim DSDefinitionStr As String\n    DSDefinitionStr = \"\"\n    Try\n        Dim stream As FileStream = File.OpenRead(filePath + \"\\\" + reportName )\n        definition = New [Byte](stream.Length-1) {}\n        stream.Read(definition, 0, CInt(stream.Length))\n        stream.Close()\n        For i As Integer = 0 To definition.Length - 1\n            DSDefinitionStr = DSDefinitionStr + Convert.ToString(Convert.ToChar(Convert.ToInt16(definition(i).ToString)))\n        Next\n    Catch e As IOException\n        Console.WriteLine(e.Message)\n    End Try\n    reportname=reportname.tostring.replace(\".rdl\",\"\")\n    Console.WriteLine(\"Attempting to Deploy Report Name {0}\", reportname.tostring)\n    Try\n        Dim item as CatalogItem\n        item=rs.CreateCatalogItem(\"Report\",reportname, \"/\" + ReportFolder, false, definition,nothing, warnings)\n        'warnings = rs.CreateCatalogItem(reportName, \"/\" + ReportFolder, False, definition, Nothing)\n        If Not (warnings Is Nothing) Then\n            If item.Name &lt;&gt; \"\" then \n                Console.WriteLine(\"Report: {0} published successfully with warnings\", reportName)\n                UpdateDataSources_report(reportName)\n                UpdateDataSet_report(reportName, DSDefinitionStr)\n            else\n                Dim warning As Warning\n                For Each warning In warnings\n                    Console.WriteLine(warning.Message)\n                Next warning\n            End If\n        Else\n            Console.WriteLine(\"Report: {0} published successfully with no warnings\", reportName)\n            UpdateDataSources_report(reportName)\n            UpdateDataSet_report(reportName, DSDefinitionStr)\n        End If\n    Catch goof as SoapException\n        If goof.Message.Indexof(\"AlreadyExists\")&gt;0 Then\n            Console.WriteLine(\"The Report Name {0} already exists\",reportName.ToString)\n        Else\n            If goof.Message.IndexOf(\"published\")=-1 Then\n            Console.WriteLine(goof.Message)\n            End If\n        End If\n    End Try\nEnd Sub\n\n'Utility to Update The Data Sources on the Server\nPublic Sub UpdateDataSources_report(ReportName as string)\n    rs.Credentials = System.Net.CredentialCache.DefaultCredentials\n    Dim item as CatalogItem\n    Dim items as CatalogItem()\n    Try\n        Dim dataSources() as DataSource = rs.GetItemDataSources( \"/\" +  ReportFolder + \"/\" + ReportName)\n        For Each ds as DataSource in dataSources\n            Dim sharedDs(0) as DataSource\n            sharedDs(0)=GetDataSource(DataSourceFolder, ds.Name)\n            rs.SetItemDataSources(\"/\" +  ReportFolder + \"/\" + ReportName, sharedDs)\n            Console.WriteLine(\"Set \" &amp; ds.Name &amp; \" datasource for \" &amp; \"/\" +  ReportFolder + \"/\" + ReportName &amp; \" report\")\n        Next\n        Console.WriteLine(\"All the shared data source reference set for report {0} \", \"/\" + ReportFolder + \"/\" + ReportName)\n    Catch goof As SoapException\n    Console.WriteLine(goof.Detail.InnerXml.ToString())\n    End Try\nEnd Sub\n\n'Utility to link The Dataset with the Report\nPublic Sub UpdateDataSet_report(ReportName as string, DSDefinitionStr as string)\n    Dim valstart As Integer\n    Dim valend As Integer\n    Dim sharedDataSetReference As string\n    rs.Credentials = System.Net.CredentialCache.DefaultCredentials\n    Try\n        Dim dataSets As ItemReferenceData() = rs.GetItemReferences(\"/\" +  ReportFolder + \"/\" + ReportName, \"DataSet\")\n        If dataSets IsNot Nothing AndAlso dataSets.Length &gt; 0 AndAlso Not String.IsNullOrEmpty(dataSets(0).Name) Then\n            For i as integer = 0 to dataSets.Length -1\n                If DSDefinitionStr.ToString.Contains(\"&lt;DataSet Name=\"\"\"&amp; dataSets(i).Name &amp;\"\"\"&gt;\") Then\n                    valstart = DSDefinitionStr.ToString.IndexOf(\"&lt;SharedDataSetReference&gt;\", DSDefinitionStr.ToString.IndexOf(\"&lt;DataSet Name=\"\"\"&amp; dataSets(i).Name &amp;\"\"\"&gt;\")) + 24\n                    valend = DSDefinitionStr.ToString.IndexOf(\"&lt;/SharedDataSetReference&gt;\", DSDefinitionStr.ToString.IndexOf(\"&lt;DataSet Name=\"\"\"&amp; dataSets(i).Name &amp;\"\"\"&gt;\"))\n                    sharedDataSetReference = DSDefinitionStr.ToString.Substring(valstart, valend - valstart)\n                End If\n                Dim sharedDataSetName as String = dataSets(i).Name\n                Dim references(0) as ItemReference\n                Dim sharedDataSet = New ItemReference() \n                sharedDataSet.Name = sharedDataSetName\n                Console.WriteLine(\"Attempting to Link Dataset {0}\", sharedDataSetName)\n                sharedDataSet.Reference = \"/\" + DataSetFolder + \"/\" + sharedDataSetReference \n                references(0)=sharedDataSet\n                rs.SetItemReferences(\"/\" + ReportFolder + \"/\" + ReportName, references)\n                Console.WriteLine(\"Report \" + ReportName + \" Linked to data set \" + \"/\" + DataSetFolder + \"/\" + Convert.ToString(sharedDataSet.Name))\n            Next\n        End If\n    Catch goof As SoapException\n        Console.WriteLine(goof.Detail.InnerXml.ToString())\n    End Try\nEnd Sub\n \n'Function to Reference Data Sources\nPrivate Function GetDataSource(sharedDataSourcePath as string, dataSourceName as String) as DataSource\n    Dim reference As New DataSourceReference()\n    Dim ds As New DataSource\n    reference.Reference = \"/\" &amp; sharedDataSourcePath &amp; \"/\" &amp; dataSourceName\n    ds.Item = CType(reference, DataSourceDefinitionOrReference)\n    ds.Name = dataSourceName\n    Console.WriteLine(\"Attempting to Publish Data Source {0}\", ds.Name)\n    GetDataSource=ds\nEnd Function\n\nThis script is based on this article.\nThanks!\n","id":"https://eapyl.github.io/auto-deployment-for-ssrs-reports/","title":"Auto deployment for SSRS reports"},"https://eapyl.github.io/avoid-ambiguous-invocation-for-extension-methods/":{"body":"I m using ASP.NET MVC. And work with my view, where I have the View \n\nIt gives me the exception\nThe call is ambiguous between the following methods or properties: 'GMP.MvcWebSite.StringExtensions.TrimOrEmpty(string)' and 'System.StringHelper.TrimOrEmpty(string)'\n\nSo i just rebuild my view as\n\n","id":"https://eapyl.github.io/avoid-ambiguous-invocation-for-extension-methods/","title":"Avoid Ambiguous invocation for extension methods"},"https://eapyl.github.io/backup-influxdb-in-docker/":{"body":"If you want to backup your InfluxDB in Docker you can probably can start with this wonderful article.\nLater I will just describe how I am doing backup to local folder instead of S3 storage.\nIt is my docker-compose:\n    db:\n        image: \"influxdb:1.2\"\n        restart: always\n        ports: \n            - \"8086:8086\"\n        volumes:\n            - /etc/influxdb:/var/lib/ #folder with db data\n            - ./influxdb.conf:/etc/influxdb/influxdb.conf:ro #configuration for InfluxDB\n    influxdb-backup:\n        image: influxdb-backup:1.2\n        container_name: influxdb-backup\n        restart: always\n        volumes:\n            - /backup:/backup #folder with backups\n        links:\n            - db\n        environment:\n            INFLUX_HOST: db\n            DATABASES: entity_db\n\nSo there are two containers: influxdb is the standard InfluxDB and influxdb-backup:1.2 (see dockerfile for this image below).\nFROM influxdb:1.2-alpine\n\n# Backup the following databases, separator \":\"\nENV DATABASES=entity_db\nENV INFLUX_HOST=influxdb\n\n# Some tiny helpers \nRUN apk update &amp;&amp; apk add ca-certificates &amp;&amp; update-ca-certificates &amp;&amp; apk add openssl\nRUN apk add --no-cache bash py2-pip py-setuptools ca-certificates\nRUN pip install python-magic\n\n# Backup script\nCOPY backup.sh /bin/backup.sh\nRUN chmod +x /bin/backup.sh\n\n# Setup crontab\nCOPY cron.conf /var/spool/cron/crontabs/root\n\n# Run Cron in foreground\nCMD crond -l 0 -f\n\nSo we are running cron job to run our backup.sh. The configuration (cron.conf):\n# do daily/weekly/monthly maintenance\n# min\thour\tday\tmonth\tweekday\tcommand\n0 0 * * * /bin/backup.sh\n# run every day at 00:00:00\n\nThere is backup.sh with the next content:\n#!/bin/bash\nset -e\n\n: ${INFLUX_HOST:?\"INFLUX_HOST env variable is required\"}\n\ndir=/backup\nmin_dirs=16\n#we are saving only last 14 backups (2 weeks)\n\nif [ $(find \"$dir\" -maxdepth 1 -type d | wc -l) -ge $min_dirs ]\n  then find \"$dir\" -maxdepth 1 | sort | head -n 2 | sort -r | head -n 1 | xargs rm -rf\nfi\n\n#all backups are in /backup folder\n#every backup is in a folder with name which is date when a backup has been created\nDATE=`date +%Y-%m-%d-%H-%M-%S`\n\necho 'Backup Influx metadata'\ninfluxd backup -host $INFLUX_HOST:8088 /backup/$DATE\n\n# Replace colons with spaces to create list.\nfor db in ${DATABASES//:/ }; do\n  echo \"Creating backup for $db\"\n  influxd backup -database $db -host $INFLUX_HOST:8088 /backup/$DATE\ndone\n\nPlease find an image here.\nThank you!\n","id":"https://eapyl.github.io/backup-influxdb-in-docker/","title":"Backup InfluxDB in Docker"},"https://eapyl.github.io/bootstrap-datepicker-week-mode-view/":{"body":"I have updated bootstrap datepicker to new view mode: week.\nThe source code is here\n","id":"https://eapyl.github.io/bootstrap-datepicker-week-mode-view/","title":"Bootstrap datepicker Week mode view"},"https://eapyl.github.io/bootstrap-recaptcha-css-problem/":{"body":"If you use bootstrap and recaptcha, you may face a problem like wrong padding|margin:\nYou should add next css style to yours:\nbody{ line-height:1}\n\nAnd all will be OK ! Enjoy!\n","id":"https://eapyl.github.io/bootstrap-recaptcha-css-problem/","title":"Bootstrap + Recaptcha. Css problem"},"https://eapyl.github.io/cake-net-useful-scripts-for-angularjs-dotnet-core-docker-application/":{"body":"There is a great cross-platform build automation tool - Cake.Net.\nI started using it and created some useful scripts to Release and Publish new version of application.\n\nI am using AngularJS as frontend framework, asp net core (dotnet core) as backend framework, git as source system and docker to deploy and run application on remote server.\nSo it is a small cake script to release a new version of application:\n#addin \"Cake.Docker\"\n#addin \"Cake.FileHelpers\"\n\n// Release: ./build.sh -t Release \"-packageVersion=x.x.x.x\"\n// Publish: ./build.sh -t Publish \"-packageVersion=x.x.x.x\" \"-env=one\"\n// Delete release: ./build.sh -t Delete \"-packageVersion=x.x.x.x\"\nvar target = Argument&lt;string&gt;(\"target\");\nvar version = Argument&lt;string&gt;(\"packageVersion\");\n\npublic class Settings\n{\n    public string SshAddress;\n    public string SshPort;\n    public string HomePath;\n}\n\nSettings sets;\n\nTask(\"SelectEnvironment\")\n    .Does(()=&gt;{\n        var env = Argument&lt;string&gt;(\"env\");\n        var environments = new Dictionary&lt;string, Settings&gt; {\n            [\"one\"] = new Settings {\n                SshAddress = \"root@66.66.66.66\",\n                SshPort = \"22\",\n                HomePath = \"/root/Templates\"\n            },\n            [\"two\"] = new Settings{\n                SshAddress = \"root@99.99.99.99\",\n                SshPort = \"26\",\n                HomePath = \"/home/Templates\"\n            }\n        };\n        sets = environments[env];\n});\n\nTask(\"Publish\")\n    .IsDependentOn(\"SelectEnvironment\")\n    .IsDependentOn(\"CheckAllCommitted\")\n    .IsDependentOn(\"CheckoutTag\")\n    .IsDependentOn(\"BuildAngular\")\n    .IsDependentOn(\"BuildDocker\")\n    .IsDependentOn(\"CheckoutBranch\")\n    .IsDependentOn(\"PushToGitLab\")\n    .IsDependentOn(\"PublishService\")\n    .Does(()=&gt;\n    {\n        Information(\"Finished!\");\n    });\n\nTask(\"Release\")\n    .IsDependentOn(\"SetVersion\")\n    .IsDependentOn(\"ReleaseNotes\")\n    .IsDependentOn(\"Commit\")\n    .IsDependentOn(\"Build\")\n    .IsDependentOn(\"PushTagToGit\")\n    .Does(()=&gt;\n    {\n        Information(\"Finished!\");\n    });\n\n//build angular\nTask(\"Build Angular\")\n    .Does(() =&gt;\n    {\n        StartProcess(\"ng\", \"build\");\n    });\n\n// delete release (tag)\nTask(\"Delete\")\n    .Does(()=&gt;\n    {\n        StartProcess(\"git\", $\"tag --delete v{version}\");\n        StartProcess(\"git\", $\"push --delete origin v{version}\");\n    });\n\n// add release notes to historys\nTask(\"ReleaseNotes\")\n    .Does(()=&gt; {\n        IEnumerable&lt;string&gt; redirectedOutput;\n        StartProcess(\"git\", \n            new ProcessSettings {\n                Arguments = $\"describe --abbrev=0 --tags\",\n                RedirectStandardOutput = true\n            },\n            out redirectedOutput\n        );\n        var previousVersion = redirectedOutput.First();\n        Information(previousVersion);\n        IEnumerable&lt;string&gt; redirectedOutput2;\n        StartProcess(\"git\", \n            new ProcessSettings {\n                Arguments = $\"log --pretty=\\\"%s\\\" HEAD...{previousVersion}\",\n                RedirectStandardOutput = true\n            },\n            out redirectedOutput2\n        );\n        FileAppendLines(\"./src/HISTORY.txt\", new string[]{$\"------release v{version}-----\"});\n        FileAppendLines(\"./src/HISTORY.txt\", redirectedOutput2.ToArray());\n    });\n\n// push docker image to gitlab\nTask(\"PushToGitLab\")\n    .Does(()=&gt;{\n        StartProcess(\"docker\", $\"push registry.gitlab.com/counterra/service:{version}\");\n    });\n\n// build project locally \nTask(\"Build\")\n    .Does(() =&gt;\n{\n    DotNetCoreRestore(\"./src/counterra.csproj\");\n    CleanDirectory(\"./artifacts\");\n    var settings = new DotNetCorePublishSettings\n    {\n        Framework = \"netcoreapp1.1\",\n        Configuration = \"Release\",\n        OutputDirectory = \"./artifacts/\"\n    };\n    DotNetCorePublish(\"./src/counterra.csproj\", settings);\n});\n\n// set new version in project file\nTask(\"SetVersion\")\n    .Does(()=&gt;\n    {\n        var file = File(\"./src/counterra.csproj\");\n        XmlPoke(file, \"/Project/PropertyGroup/Version\", version);\n    });\n\n// build docker\nTask(\"BuildDocker\")\n    .Does(() =&gt;\n{\n    var settings = new DockerBuildSettings {\n        Tag = new []{ $\"registry.gitlab.com/counterra/service:{version}\" }\n    };\n    DockerBuild(settings, \".\");\n});\n\n// go to remote server and replace docker there\nTask(\"PublishService\")\n    .Does(() =&gt;\n{\n    StartProcess(\"scp\", $\"-P {sets.SshPort} {sets.SshAddress}:{sets.HomePath}/server/docker-compose.yml ./artifacts/\");\n    ReplaceRegexInFiles(\"./artifacts/docker-compose.yml\", @\"registry.gitlab.com/counterra/service:\\d+\\.\\d+\\.\\d+\\.\\d+\", $\"registry.gitlab.com/counterra/service:{version}\");\n\n    StartProcess(\"ssh\", $\"-p {sets.SshPort} {sets.SshAddress} cd {sets.HomePath}/server/; docker-compose stop service\");\n    StartProcess(\"ssh\", $\"-p {sets.SshPort} {sets.SshAddress} cd {sets.HomePath}/server/; docker-compose rm -f service\");\n    StartProcess(\"scp\", $\"-P {sets.SshPort} ./artifacts/docker-compose.yml {sets.SshAddress}:{sets.HomePath}/server/\");\n    StartProcess(\"ssh\", $\"-p {sets.SshPort} {sets.SshAddress} cd {sets.HomePath}/server/; docker-compose create service\");\n    StartProcess(\"ssh\", $\"-p {sets.SshPort} {sets.SshAddress} cd {sets.HomePath}/server/; docker-compose start service\");\n});\n\n// push new tag\nTask(\"PushTagToGit\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $\"tag v{version}\");\n    StartProcess(\"git\", \"push --tags\");\n});\n\n// checkout tag\nTask(\"CheckoutTag\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $\"checkout tags/v{version}\");\n});\n\n// checkout master\nTask(\"CheckoutBranch\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $\"checkout master\");\n});\n\n// commit all to branch and push it\nTask(\"Commit\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $\"add .\");\n    StartProcess(\"git\", $\"commit -m \\\"Release v{version}\\\" \");\n    StartProcess(\"git\", $\"push\");\n});\n\n// check that we haven't uncommitted files\nTask(\"CheckAllCommitted\")\n    .Does(() =&gt;\n{\n    IEnumerable&lt;string&gt; redirectedOutput;\n    StartProcess(\"git\", \n        new ProcessSettings {\n            Arguments = \"status\",\n            RedirectStandardOutput = true\n        },\n        out redirectedOutput\n    );\n    if (!redirectedOutput.LastOrDefault().Contains(\"nothing to commit\"))\n    {\n        throw new Exception(\"Exists uncommitted changes\");\n    }\n});\n\nRunTarget(target);\n\n\nIt is a script to build released version and publish a docker container to a server:\n// Release: ./build.sh -t Release \"-packageVersion=x.x.x.x\"\n// Publish: ./build.sh -t Publish \"-packageVersion=x.x.x.x\" \"-env=counterra\"\n// Delete release: ./build.sh -t Delete \"-packageVersion=x.x.x.x\"\nvar target = Argument&lt;string&gt;(\"target\");\nvar version = Argument&lt;string&gt;(\"packageVersion\");\n\npublic class Settings\n{\n    public string SshAddress;\n    public string SshPort;\n    public string HomePath;\n}\n\nSettings sets;\n\nTask(\"SelectEnvironment\")\n    .Does(()=&gt;{\n        var env = Argument&lt;string&gt;(\"env\");\n        var environments = new Dictionary&lt;string, Settings&gt; {\n            [\"counterra\"] = new Settings {\n                SshAddress = \"root@83.220.171.23\",\n                SshPort = \"22\",\n                HomePath = \"/root/Templates\"\n            },\n            [\"tj\"] = new Settings{\n                SshAddress = \"vorsa@195.14.96.218\",\n                SshPort = \"26\",\n                HomePath = \"/home/vorsa\"\n            }\n        };\n        sets = environments[env];\n});\n\nTask(\"Publish\")\n    .IsDependentOn(\"SelectEnvironment\")\n    .IsDependentOn(\"CheckAllCommitted\")\n    .IsDependentOn(\"CheckoutTag\")\n    // build angular\n    .IsDependentOn(\"Build Angular\")\n    .IsDependentOn(\"BuildDocker\")\n    .IsDependentOn(\"CheckoutBranch\")\n    .IsDependentOn(\"PushToGitLab\")\n    .IsDependentOn(\"PublishService\")\n    .Does(()=&gt;\n    {\n        Information(\"Finished!\");\n    });\n\nTask(\"Release\")\n    .IsDependentOn(\"SetVersion\")\n    .IsDependentOn(\"ReleaseNotes\")\n    .IsDependentOn(\"Commit\")\n    .IsDependentOn(\"Build\")\n    .IsDependentOn(\"PushTagToGit\")\n    .Does(()=&gt;\n    {\n        Information(\"Finished!\");\n    });\n\nTask(\"Publish\")\n    // check that current 'master' branch hasn't uncommitted changes\n    .IsDependentOn(\"CheckAllCommitted\")\n    // checkout release tag\n    .IsDependentOn(\"CheckoutTag\")\n    // build angular\n    .IsDependentOn(\"Build Angular\")\n    // build release \n    .IsDependentOn(\"Build\")\n    // return 'master' to HEAD as we have published release in artifacts folder\n    .IsDependentOn(\"CheckoutBranch\")\n    // create docker image using published release\n    .IsDependentOn(\"BuildDocker\")\n    // copy image to remote server\n    .IsDependentOn(\"ExportDocker\")\n    // import new image, replace running container\n    .IsDependentOn(\"PublishService\")\n    .Does(()=&gt;\n    {\n        Information(\"Finished!\");\n    });\n\nTask(\"Build Angular\")\n    .Does(() =&gt;\n{\n    StartProcess(\"ng\", \"build\");\n});\n\nTask(\"Build\")\n    .Does(() =&gt;\n{\n    DotNetCoreRestore($ \"./src/{Settings.ProjectName}\");\n    CleanDirectory(\"./artifacts\");\n    var settings = new DotNetCorePublishSettings\n    {\n        Framework = \"netcoreapp1.1\",\n        Configuration = \"Release\",\n        OutputDirectory = \"./artifacts/\"\n    };\n    DotNetCorePublish($ \"./src/{Settings.ProjectName}\", settings);\n    // clean up artifacts folder\n    DeleteDirectory(\"./artifacts/e2e\", recursive:true);\n    DeleteDirectory(\"./artifacts/src\", recursive:true);\n    DeleteFiles(\"./artifacts/ts*.json\");\n});\n\nTask(\"BuildDocker\")\n    .Does(() =&gt;\n{\n    var settings = new DockerBuildSettings {\n        Tag = new []{ $ \"{Settings.ContainerName}:{version}\" }\n    };\n    DockerBuild(settings, \".\");\n});\n\nTask(\"ExportDocker\")\n    .Does(() =&gt;\n{\n    var settings = new DockerSaveSettings {\n        Output = $ \"./artifacts/{Settings.ContainerName}.{version}.tar\"\n    };\n    // save docker image to tar archive\n    DockerSave(settings, new[] { $ \"{Settings.ContainerName}:{version}\"});\n});\n\nTask(\"PublishService\")\n    .Does(() =&gt;\n{\n    // cope docker image to remote server\n    StartProcess(\"scp\", $ \"-P {Settings.SshPort} ./artifacts/{Settings.ContainerName}.{version}.tar {Settings.SshAddress}:{Settings.HomePath}/\");\n    // load copied image to docker on remote server\n    StartProcess(\"ssh\", $ \"-p {Settings.SshPort} {Settings.SshAddress} docker load &lt; {Settings.HomePath}/{Settings.ContainerName}.{version}.tar\");\n\n    // copy docker-compose configuration from remote server to artifacts folder\n    StartProcess(\"scp\", $ \"-P {Settings.SshPort} {Settings.SshAddress}:{Settings.HomePath}/docker-compose.yml ./artifacts/\");\n    // replace the version of docker image in docker-compose configuration\n    ReplaceRegexInFiles(\"./artifacts/docker-compose.yml\", $ \"{Settings.ContainerName}:\\\\d+\\\\.\\\\d+\\\\.\\\\d+\\\\.\\\\d+\", $ \"{Settings.ContainerName}:{version}\");\n\n    // stop old docker container on server\n    StartProcess(\"ssh\", $ \"-p {Settings.SshPort} {Settings.SshAddress} cd {Settings.HomePath}/; docker-compose stop {Settings.ContainerName}\");\n    // delete old container\n    StartProcess(\"ssh\", $ \"-p {Settings.SshPort} {Settings.SshAddress} cd {Settings.HomePath}/; docker-compose rm -f {Settings.ContainerName}\");\n    // copy new docker-compose configuration to remote server\n    StartProcess(\"scp\", $ \"-P {Settings.SshPort} ./artifacts/docker-compose.yml {Settings.SshAddress}:{Settings.HomePath}/\");\n    // recreate docker container, it will create a new version\n    StartProcess(\"ssh\", $ \"-p {Settings.SshPort} {Settings.SshAddress} cd {Settings.HomePath}/; docker-compose create {Settings.ContainerName}\");\n    // start new docker container\n    StartProcess(\"ssh\", $ \"-p {Settings.SshPort} {Settings.SshAddress} cd {Settings.HomePath}/; docker-compose start {Settings.ContainerName}\");\n});\n\nTask(\"CheckoutTag\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $ \"checkout tags/v{version}\");\n});\n\nTask(\"CheckoutBranch\")\n    .Does(() =&gt;\n{\n    StartProcess(\"git\", $ \"checkout master\");\n});\n\nTask(\"CheckAllCommitted\")\n    .Does(() =&gt;\n{\n    IEnumerable&lt;string&gt; redirectedOutput;\n    var exitCodeWithArgument = StartProcess(\"git\", new ProcessSettings{\n    Arguments = \"status\",\n    RedirectStandardOutput = true\n    },\n    out redirectedOutput\n    );\n    if (!redirectedOutput.LastOrDefault().Contains(\"nothing to commit\"))\n    {\n        throw new Exception(\"Exists uncommitted changes\");\n    }\n});\n\nRunTarget(target);\n\nI am running service using docker compose like:\nversion: '2'\nservices:\n    ContainerName:\n        image: ContainerName:x.x.x.x\n\nThanks.\n","id":"https://eapyl.github.io/cake-net-useful-scripts-for-angularjs-dotnet-core-docker-application/","title":"Cake.Net. Useful scripts for AngularJS, dotnet core, docker application"},"https://eapyl.github.io/create-line-chart-use-net-2-0/":{"body":"See please ChatBuilder. There are 4 files of simple source code.\n","id":"https://eapyl.github.io/create-line-chart-use-net-2-0/","title":"Create line chart use .net 2.0"},"https://eapyl.github.io/cron-schedule-using-fsharp/":{"body":"I decided to start learning fsharp and hope I will be able to use F# in my future small projects.\n\nCurrently I have a small service worked in Docker container. It is written using C# on dotnet core.\nThis service is for grabbing data from external services via HTTP and putting aggregated data to InfluxDB database. Internally the service is using cron to plan and run this process as we want to grab data periodically.\nI started with rewriting cron scheduling.\nSo there is implementation in F# below:\nLet's start with two helper objects: String.split and TooMuchArgumentsException exception.\ntype System.String with \n    static member split c (value: string) =\n        value.Split c\n\nexception TooMuchArgumentsException of int\n\nString.split is just wrapper for String.Split method. Exception is needed to show when cron expression contains too much parts.\nMy internal cron supports the next template: 'minute hour dayOfMonth month dayOfWeek'. And the next type of cron expressions: \n\n'*' - wildcard;\n'*/5' - every 5th, e.g. every five minutes;\n'10-20/5' - range value, e.g. every from 10 till 20, e.g. every minute from 10 till 20. '/5' is optional and it works the same as previous one, so '10-20/5' for minutes means run at 10, 15 and 20;\n'5' - one value only, e.g. only at 5th minute\n'5,10,15,45' - list value, e.g. run at 5th, 10th, 15th and 45th minutes\n\nopen System\nopen System.Text.RegularExpressions\n\nmodule Schedule =\n    // regexp for */5\n    [&lt;Literal&gt;]\n    let DividePattern = @\"(\\*/\\d+)\"\n    // regexp for range\n    [&lt;Literal&gt;]\n    let RangePattern = @\"(\\d+\\-\\d+(/\\d+)?)\"\n    // regexp for wild char\n    [&lt;Literal&gt;]\n    let WildPattern = @\"(\\*)\"\n    // regexp for one value\n    [&lt;Literal&gt;]\n    let OneValuePattern = @\"(\\d)\"\n    // regexp for list value\n    [&lt;Literal&gt;]\n    let ListPattern = @\"((\\d+,)+\\d+)\"\n\n    // internal record to parsed cron expression, so it contains minutes,\n    // hours, days of month, months and day of week when we should run our jobs\n    type ISchedueSet = \n        { \n            Minutes: int list;\n            Hours: int list;\n            DayOfMonth: int list;\n            Months: int list;\n            DayOfWeek: int list\n        }\n    \n    // method to generate ISchedueSet record from cron expression\n    let generate expression =\n        // internal method to parse */5 \n        let dividedArray (m:string) start max =\n            let divisor = m |&gt;  String.split [|'/'|] |&gt; Array.skip 1 |&gt; Array.head |&gt; Int32.Parse\n            [start .. max] |&gt; List.filter (fun x -&gt; x % divisor = 0)\n        // internal method to parse range\n        let rangeArray (m:string) =\n            let split = m |&gt; String.split [|'-'; '/'|] |&gt; Array.map Int32.Parse\n            match Array.length split with\n                | 2 -&gt; [split.[0] .. split.[1]]\n                | 3 -&gt; [split.[0] .. split.[1]] |&gt; List.filter (fun x -&gt; x % split.[2] = 0)\n                | _ -&gt; []\n        // internal method to parse wild char\n        let wildArray (m:string) start max =\n            [start .. max]\n        // internal method to parse single value\n        let oneValue (m:string) =\n            [m |&gt; Int32.Parse]\n        // internal method to parse list value\n        let listArray (m:string) =\n            m |&gt; String.split [|','|] |&gt; Array.map Int32.Parse |&gt; Array.toList\n        \n        // we need to set minimum and maximum value for every part of date time\n        let getStartAndMax i =\n            match i with\n            // for minutes\n            | 0 -&gt; (0, 59)\n            // for hours\n            | 1 -&gt; (0, 23)\n            // for days of month\n            | 2 -&gt; (1, 31)\n            // for months\n            | 3 -&gt; (1, 12)\n            // for day of week\n            | 4 -&gt; (0, 6)\n            // throw an exception if don't know for what part of date time we need values\n            | _ -&gt; raise (TooMuchArgumentsException i)\n        \n        // active pattern to match regexp\n        let (|MatchRegex|_|) pattern input =\n            let m = Regex.Match(input, pattern)\n            if m.Success then Some (m.ToString()) else None\n        \n        // parsing cron expression and create a array of lists which contains all possibles values\n        // for every part of daytime\n        let parts =\n            expression \n            |&gt; String.split [|' '|]\n            |&gt; Array.mapi (fun i x -&gt;\n                let (start, max) = getStartAndMax i \n                match x with\n                    | MatchRegex DividePattern x -&gt; dividedArray x start max\n                    | MatchRegex RangePattern x -&gt; rangeArray x\n                    | MatchRegex WildPattern x -&gt; wildArray x start max\n                    | MatchRegex ListPattern x -&gt; listArray x\n                    | MatchRegex OneValuePattern x -&gt; oneValue x\n                    | _ -&gt; []\n            )\n        // convert list of array to ISchedueSet\n        { \n            Minutes = parts.[0];\n            Hours = parts.[1];\n            DayOfMonth = parts.[2];\n            Months = parts.[3];\n            DayOfWeek = parts.[4]\n        }\n    // method to check date time via generated ISchedueSet\n    let isTime schedueSet (dateTime : DateTime) =\n        List.exists ((=) dateTime.Minute) schedueSet.Minutes &amp;&amp; \n        List.exists ((=) dateTime.Hour) schedueSet.Hours &amp;&amp;\n        List.exists ((=) dateTime.Day) schedueSet.DayOfMonth &amp;&amp;\n        List.exists ((=) dateTime.Month) schedueSet.Months &amp;&amp;\n        List.exists ((=) (int dateTime.DayOfWeek)) schedueSet.DayOfWeek\n\nSo Schedule module contains two methods and one type: \n\nISchedueSet is a container for parsed cron expression;\ngenerate is to generate ISchedueSet record from cron expression. This record contains all possible values of minutes, hours, months, days of month, days of week for particular cron expression;\nisTime is to check if we need to run a job in passed date time \n\nSmall sets of unit tests written using mstest:\nnamespace FsharpTest\n\nopen System\nopen Microsoft.VisualStudio.TestTools.UnitTesting\nopen Cron\nopen Schedule\n\n// minute hour dayOfMonth month dayOfWeek\n[&lt;TestClass&gt;]\ntype ScheduleTests () =\n\n    [&lt;TestMethod&gt;]\n    member this.All () =\n        let schedule = Schedule.generate \"* * * * *\"\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfMonth [1..31]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfWeek [0..6]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Hours [0..23]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Minutes [0..59]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Months [1..12]);\n\n    [&lt;TestMethod&gt;]\n    member this.Range () =\n        let schedule = Schedule.generate \"0-5 0-10/2 10-20/3 3-5 2-6/2\"\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfMonth [12; 15; 18]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfWeek [2; 4; 6]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Hours [0; 2; 4; 6; 8; 10]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Minutes [0; 1; 2; 3; 4; 5]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Months [3; 4; 5]);\n\n    [&lt;TestMethod&gt;]\n    member this.OneTime () =\n        let schedule = Schedule.generate \"0 0 1 1 0\"\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfMonth [1]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfWeek [0]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Hours [0]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Minutes [0]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Months [1]);\n\n    [&lt;TestMethod&gt;]\n    member this.Every () =\n        let schedule = Schedule.generate \"*/15 */3 */2 */5 *\"\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfMonth [for i in [1 .. 31] do\n                                                                if i%2 = 0 then\n                                                                    yield i]\n        );\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfWeek [0 .. 6]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Hours [0; 3; 6; 9; 12; 15; 18; 21]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Minutes [0; 15; 30; 45]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Months [5; 10]);\n\n    [&lt;TestMethod&gt;]\n    member this.OnlySome () =\n        let schedule = Schedule.generate \"1,2,3 5,6,7 28,29 1,2 5,6\"\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfMonth [28;29]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.DayOfWeek [5;6]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Hours [5;6;7]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Minutes [1;2;3]);\n        Assert.IsTrue(List.forall2 ( = ) schedule.Months [1;2]);\n\n    [&lt;TestMethod&gt;]\n    member this.IsTime () =\n        let dateTime = DateTime(2000, 1, 1, 0, 0, 0)\n        let schedule = { Minutes = [0]; Hours = [0]; DayOfWeek = [0 .. 6]; DayOfMonth = [1]; Months = [1]}\n        Assert.IsTrue(Schedule.isTime schedule dateTime)\n\nQuite simple implementation of cron schedule part of mentioned service.\nThanks.\n","id":"https://eapyl.github.io/cron-schedule-using-fsharp/","title":"Cron schedule using F#"},"https://eapyl.github.io/cron-service-using-fsharp-on-net-core/":{"body":"As continuation for my previous post I want to create a nancy service to run my cron jobs.\nThe source is here.\nA service to run jobs:\nmodule Service =\n    let start (logger:ILogger) (items:Item[]) =\n        let version = Microsoft.Extensions.PlatformAbstractions.PlatformServices.Default.Application.ApplicationVersion\n        logger.LogInformation(\"Staring service {version}\", version)\n        let itemCount = Array.length items\n        logger.LogInformation(\"Item count is {Length}\", itemCount)\n        let proceedItem item =\n            async {\n                logger.LogTrace(\"ExecuteForItem {ip}\", item.id)\n            }\n        let jobs = items |&gt; Array.map (fun item -&gt;\n            {\n                action = proceedItem item;\n                cron = item.cron\n            })\n        let daemon = run jobs\n        logger.LogInformation(\"Started service\")\n        daemon\n\nIt contains only method start to create cron daemon.\nAll other classes is related to Nancy platform and it is easy to write using nancy documentation.\n","id":"https://eapyl.github.io/cron-service-using-fsharp-on-net-core/","title":"Cron service using F# on .NET Core"},"https://eapyl.github.io/daemon-cron-using-fsharp/":{"body":"As continuation for my previous post I want to create a daemon which runs jobs using created cron code.\nmodule Daemon =\n    [&lt;Literal&gt;]\n    let INTERVAL = 30000\n\n    let internalRun interval (now: unit-&gt;DateTime) (jobs: seq&lt;Job&gt;) =\n        // to dispose System.Threading.Timer properly\n        let createDisposable f =\n            {\n                new IDisposable with\n                    member x.Dispose() = f()\n            }\n        \n        // event fot Timer\n        let timerElapsed obj =\n            let checkJob = () |&gt; now |&gt; Schedule.isTime\n            jobs \n            |&gt; Seq.map (fun x -&gt;\n                let schedule = Schedule.generate x.cron\n                (schedule, x.action)\n            ) \n            |&gt; Seq.filter (fun (x, y) -&gt; checkJob x)\n            |&gt; Seq.map (fun (x, y) -&gt; y) \n            |&gt; Async.Parallel \n            |&gt; Async.RunSynchronously\n            |&gt; ignore\n        \n        // timer\n        let localTimer = new Timer(timerElapsed, null, Timeout.Infinite, interval)\n        // start timer\n        localTimer.Change(0, interval) |&gt; ignore\n        // return timer as IDisposable \n        createDisposable (fun() -&gt; localTimer.Dispose())\n\n    // get DateTime\n    let now = fun () -&gt; DateTime.UtcNow\n    // public method to call\n    let run jobs = internalRun INTERVAL now jobs\n\nHow to use the daemon above:\ntype Job = { action: Async&lt;unit&gt;; cron: string }\n\nlet act id =\n    async {\n        printfn \"Execution %A\" id\n    }\nlet jobs = [|1; 2|] |&gt; Array.map (fun id -&gt;\n    {\n        action = act id;\n        cron = \"* * * * *\"\n    })\nlet daemon = run jobs\n\nUnfortunately I don't see the good way to wtite unit test for this code as there is hardcoded dependency to System.Threading.Timer.\nFeel free to comment if you see the solution. Thanks in advance.\n","id":"https://eapyl.github.io/daemon-cron-using-fsharp/","title":"Daemon cron using F#"},"https://eapyl.github.io/discord-belarus-chat-by/":{"body":"Discord Belarus chat By\n       Discrod - ,     !\n\n,       ,         .     ,    ,     ,     ,    chat.by. ,       .\n ,     ,         ,       - Discord. ,      !      !\n         , , ,            !  !\n ,\nDiscord Chat By\n","id":"https://eapyl.github.io/discord-belarus-chat-by/","title":"Discord Belarus chat By"},"https://eapyl.github.io/ef-core-database-sql/":{"body":"It is possible to generate EF Core model from existing database without some of tables. There is very simple and small SQL query which generated a content of C# file.\nUSE &lt;&lt;MyDatabase&gt;&gt;\n\nDECLARE @classNames VARCHAR(MAX);\nSET @classNames = 'TableName1,TableName2,TableName3';\n\nDECLARE @schemaName NVARCHAR(MAX), @className NVARCHAR(MAX), @tableName NVARCHAR(MAX);;\nSET @schemaName = 'dbo'\nDECLARE @Result VARCHAR(MAX);\n\nPRINT '// generated by script'\nPRINT 'using Microsoft.EntityFrameworkCore;'\nPRINT 'using System;'\nPRINT 'using System.Collections.Generic;'\nPRINT 'using System.ComponentModel.DataAnnotations;'\nPRINT 'using System.ComponentModel.DataAnnotations.Schema;'\nPRINT 'using System.Configuration;'\n\nPRINT 'namespace Model.'+ DB_NAME() \nPRINT '{'\nPRINT '    public class '+ DB_NAME() +'Context : DbContext {'\n\n-- adding list of all tables where identity columns\n\nSET @Result = ''\nSELECT @Result = CASE WHEN @Result = '' THEN '\"'+tbl.name+'\"' ELSE @Result + ', \"' + tbl.name + '\"' END\nFROM sys.columns cols\nJOIN sys.tables tbl ON cols.object_id = tbl.object_id\nWHERE tbl.name in (select DISTINCT [Value] from STRING_SPLIT(@classNames, ',')) AND cols.is_identity = 1\n\nPRINT '        public List&lt;string&gt; TablesWithIdentity = new List&lt;string&gt;() {' + @Result + '};'\n\nPRINT '        public '+ DB_NAME() +'Context() { }'\nPRINT '        public '+ DB_NAME() +'Context(DbContextOptions&lt;'+ DB_NAME() +'Context&gt; options): base(options) { }'\nPRINT '        protected override void OnConfiguring(DbContextOptionsBuilder optionsBuilder)'\nPRINT '        {'\nPRINT '            if (!optionsBuilder.IsConfigured)'\nPRINT '                optionsBuilder.UseSqlServer(ConfigurationManager.ConnectionStrings[\"'+ DB_NAME() +'\"].ConnectionString);'\nPRINT '        }'\n\n-- adding DbSets for each table\nDECLARE CLASS_NAME CURSOR LOCAL FOR\nSELECT DISTINCT [VALUE]\nFROM STRING_SPLIT(@classNames, ',')\nOPEN CLASS_NAME\nFETCH NEXT FROM CLASS_NAME INTO @className\nWHILE @@FETCH_STATUS = 0\nBEGIN\n    PRINT '        public DbSet&lt;'+@className+'&gt; '+@className+'s { get; set; }'\n    \n    FETCH NEXT FROM CLASS_NAME INTO @className\nEND\nCLOSE CLASS_NAME\nDEALLOCATE CLASS_NAME\n\n-- adding primary key for each table\n\nPRINT '        protected override void OnModelCreating(ModelBuilder modelBuilder) {'\nDECLARE CLASS_NAME CURSOR LOCAL FOR\nSELECT DISTINCT [VALUE]\nFROM STRING_SPLIT(@classNames, ',')\nOPEN CLASS_NAME\nFETCH NEXT FROM CLASS_NAME INTO @className\nWHILE @@FETCH_STATUS = 0\nBEGIN\n    SET @tableName = UPPER(@className)\n    SET @Result = NULL\n    SELECT @Result = CASE WHEN @Result IS NULL THEN 'x.' + cols.name ELSE @Result + ', x.' + cols.name END\n    FROM sys.columns cols\n    LEFT JOIN (\n        SELECT i.is_primary_key, ic.object_id, ic.column_id\n        FROM sys.index_columns ic\n        LEFT JOIN sys.indexes i on ic.object_id = i.object_id and ic.index_id = i.index_id\n        WHERE i.is_primary_key = 1) AS PRIMARYKEY ON PRIMARYKEY.column_id = cols.column_id AND PRIMARYKEY.object_id = cols.object_id\n    JOIN sys.tables tbl ON cols.object_id = tbl.object_id\n    WHERE tbl.name = @tableName AND PRIMARYKEY.is_primary_key = 1\n\n    PRINT '            modelBuilder.Entity&lt;'+@className+'&gt;().HasKey(x =&gt; new {'+@Result+'});'\n    IF @Result = 'x.ID' OR @Result = 'x.Id' OR @Result = 'x.id'\n        PRINT '            modelBuilder.Entity&lt;'+@className+'&gt;().Property(x =&gt; '+@Result+').ValueGeneratedNever();'\n    \n    FETCH NEXT FROM CLASS_NAME INTO @className\nEND\nCLOSE CLASS_NAME\nDEALLOCATE CLASS_NAME\nPRINT '        }'\nPRINT '    }'\nPRINT ''\n\n-- start adding POCO objects for each table\nDECLARE CLASS_NAME CURSOR LOCAL FOR\nSELECT DISTINCT [VALUE]\nFROM STRING_SPLIT(@classNames, ',')\nOPEN CLASS_NAME\nFETCH NEXT FROM CLASS_NAME INTO @className\nWHILE @@FETCH_STATUS = 0\nBEGIN\n    SET @tableName = UPPER(@className)\n    \n    DECLARE tableColumns CURSOR LOCAL FOR\n    SELECT DISTINCT cols.name, cols.system_type_id, cols.is_nullable\n    FROM sys.columns cols\n    JOIN sys.tables tbl ON cols.object_id = tbl.object_id\n    WHERE tbl.name = @tableName\n\n    PRINT '    [Table(\"'+@tableName+'\")]' \n    PRINT '    public partial class ' + @className\n    PRINT '    {'\n \n    OPEN tableColumns\n    DECLARE @name NVARCHAR(MAX), @typeId INT, @isNullable BIT, @typeName NVARCHAR(MAX)\n    FETCH NEXT FROM tableColumns INTO @name, @typeId, @isNullable\n    WHILE @@FETCH_STATUS = 0\n    BEGIN\n        SET @typeName =\n        CASE @typeId\n            WHEN 36 THEN 'Guid'\n            WHEN 52 THEN 'int'\n            WHEN 56 THEN 'int'\n            WHEN 61 THEN 'DateTime'\n            WHEN 104 THEN 'bool'\n            WHEN 108 THEN 'decimal'\n            WHEN 127 THEN 'long'\n            WHEN 167 THEN 'string'\n            WHEN 175 THEN 'string'\n            WHEN 231 THEN 'string'\n            WHEN 239 THEN 'string'\n            WHEN 241 THEN 'XElement'\n            ELSE 'TODO(' + CAST(@typeId AS NVARCHAR) + ')'\n        END;\n        IF @isNullable = 1 AND @typeId != 231 AND @typeId != 239 AND @typeId != 241 AND @typeId != 167 AND @typeId != 175\n            SET @typeName = @typeName + '?'\n        PRINT '        public ' + @typeName + ' ' + @name + ' { get; set; }'\n        FETCH NEXT FROM tableColumns INTO @name, @typeId, @isNullable\n    END\n\n    PRINT '    }'\n    PRINT ''\n \n    CLOSE tableColumns\n    DEALLOCATE tableColumns\n    FETCH NEXT FROM CLASS_NAME INTO @className\nEND\nCLOSE CLASS_NAME\nDEALLOCATE CLASS_NAME\n\nPRINT '}'\n\nUnfortunately it is not generating any foreign keys for tables. So you have to add them using partial class if needed.\nSo current sample will generate a model with 3 entities.\nThanks.\n","id":"https://eapyl.github.io/ef-core-database-sql/","title":"Generate EF Core model from database using SQL script"},"https://eapyl.github.io/exrs-tool-for-ssrs-reports/":{"body":"There is a nice tool to deploy reports and/or subscription to SSRS - RS tool. And I described a way to use this tool here. \nBut it is not so easy to support VB scripts, so there is a new tool exRS. This tool helps to deploy reports and create subscriptions for reports.\n\nCurrently there is a small console application with name exRSConsole.\n\nTo deploy sample Report1 report and it's subscription from Report1.xml:\nexRSConsole.exe -n Report1 -p SampleReport -r -s\n\nAlso this tool allows to delete all folders at SSRS server:\n\nexRSConsole.exe -d\n\nAnd backup all existing reports to local folder:\n\nexRSConsole.exe -b\n\nTo configure exRS you need to change configuration file:\n&lt;applicationSettings&gt;\n    &lt;exRS.Properties.Settings&gt;\n        &lt;!-- URI of SSRS server --&gt;\n        &lt;setting name=\"exRS_SSRSService_ReportingService2010\" serializeAs=\"String\"&gt;\n            &lt;value&gt;http://desktop-name:80/ReportServer/ReportService2010.asmx&lt;/value&gt;\n        &lt;/setting&gt;\n    &lt;/exRS.Properties.Settings&gt;\n&lt;/applicationSettings&gt;\n&lt;userSettings&gt;\n    &lt;exRS.Properties.Settings&gt;\n        &lt;!-- a user to connect to SSRS server --&gt;\n        &lt;setting name=\"SSRSUser\" serializeAs=\"String\"&gt;\n            &lt;value&gt;desktop-name\\user&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a password to connect to SSRS server --&gt;\n        &lt;setting name=\"SSRSPassword\" serializeAs=\"String\"&gt;\n            &lt;value&gt;&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a path to folder where put reports and subscriptions during backup process --&gt;\n        &lt;setting name=\"backupPath\" serializeAs=\"String\"&gt;\n            &lt;value&gt;C:\\Temp&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a name of folder with subscription configuration for reports (near exRSConsole.exe) --&gt;\n        &lt;setting name=\"subscriptionSettingsFolder\" serializeAs=\"String\"&gt;\n            &lt;value&gt;Subscriptions&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a user name to connect to DB for data sources --&gt;\n        &lt;setting name=\"dbUserForDataSource\" serializeAs=\"String\"&gt;\n            &lt;value&gt;test&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a password name to connect to DB for data sources --&gt;\n        &lt;setting name=\"dbPasswordForDataSource\" serializeAs=\"String\"&gt;\n            &lt;value&gt;test&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a path at SSRS server where put reports created by subscription --&gt;\n        &lt;setting name=\"subscriptionFileSharePath\" serializeAs=\"String\"&gt;\n            &lt;value&gt;\\\\DESKTOP-NAME\\Temp&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a name of folder with reports (*.rdl, *rds and *.rsd files) (near exRSConsole.exe) --&gt;\n        &lt;setting name=\"sourceFolderPath\" serializeAs=\"String\"&gt;\n            &lt;value&gt;.\\Reports&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a name of folder at SSRS server with data sources --&gt;\n        &lt;setting name=\"datasourcesServerFolderName\" serializeAs=\"String\"&gt;\n            &lt;value&gt;Data Sources&lt;/value&gt;\n        &lt;/setting&gt;\n        &lt;!-- a name of folder at SSRS server with datasets--&gt;\n        &lt;setting name=\"datasetsServerFolderName\" serializeAs=\"String\"&gt;\n            &lt;value&gt;Datasets&lt;/value&gt;\n        &lt;/setting&gt;\n    &lt;/exRS.Properties.Settings&gt;\n&lt;/userSettings&gt;\n\nAfter deployment you should see 3 folders in SSRS: \"Data Sources\", \"Datasets\" and \"SampleReport\".\nPlease find the source code here.\nThanks.\n","id":"https://eapyl.github.io/exrs-tool-for-ssrs-reports/","title":"exRS tool to deploy SSRS reports and subscriptions"},"https://eapyl.github.io/fiddler-zip-extension/":{"body":"Extension for Fiddler.\n\nThe source code: FiddlerZip.\nThe main code:\nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\nusing System.Text;\nusing Fiddler;\nusing System.Windows.Forms;\n \n// It is important !!! see the current version of fiddler\n[assembly: Fiddler.RequiredVersion(\"2.3.4.4\")]\n \nnamespace FiddlerZip\n{\n    /// &lt;summary&gt;\n    /// Zip extension\n    /// &lt;/summary&gt;\n    public class Zip : IFiddlerExtension \n    {\n        /// &lt;summary&gt;\n        /// page for extesnion\n        /// &lt;/summary&gt;\n        private TabPage oPage;\n        /// &lt;summary&gt;\n        /// Control that presented extension\n        /// &lt;/summary&gt;\n        private ZipControl oAppConsole;\n        #region IFiddlerExtension Members\n \n        public void OnBeforeUnload()\n        {\n            \n        }\n \n        public void OnLoad()\n        {\n            // create tab with name \"Zip\"\n            oPage = new TabPage(\"Zip\");\n            // it is possible to add icon to your tab\n            oPage.ImageIndex = (int)Fiddler.SessionIcons.FilterBrowsers;\n            oAppConsole = new ZipControl();\n            // add control to tab\n            oPage.Controls.Add(oAppConsole);\n            oAppConsole.Dock = DockStyle.Fill;\n            FiddlerApplication.UI.tabsViews.TabPages.Add(oPage);\n        }\n \n        #endregion\n    }\n}\n","id":"https://eapyl.github.io/fiddler-zip-extension/","title":"Fiddler Zip extension"},"https://eapyl.github.io/fixed-header-or-column-for-html-table-using-jquery/":{"body":"I have created one more plugin for HTML table. It fixes the head of a table on the page. Please see it. The main feature is supporting of overflow parent element.\n\nSome images of plugin:\n\nAnd another plugin https://bitbucket.org/upyl/fixedcolumn to fix column of table.\n\n","id":"https://eapyl.github.io/fixed-header-or-column-for-html-table-using-jquery/","title":"Fixed header or column for HTML table using JQuery"},"https://eapyl.github.io/fuelux-tree-additional-behavior/":{"body":"Add \"Show All\" to the FuelUX Tree like this.\n\nThere is the tree plugin. You can add the next code after initialization of the tree:\nscope.find('#MyTree').on('selected', function (event, data) {\n    if (data.target.additionalParameters.id == 0) {\n        scope.find('#MyTree').find('.tree-item').removeClass('tree-selected').find('i').removeClass('icon-ok').addClass('tree-dot');\n        scope.find('#MyTree').find('.tree-item:eq(1)').addClass('tree-selected').find('i').removeClass('tree-dot').addClass('icon-ok');\n        scope.find('#MyTree').find('.tree-folder-header&gt; i.icon-ok').remove();\n    }\n    else {\n        scope.find('#MyTree').find('.tree-item:eq(1)').removeClass('tree-selected').find('i').removeClass('icon-ok').addClass('tree-dot');\n        if (data.target.additionalParameters.type == 'anyOther') {\n            data.element.closest('.tree-folder-content').find('.tree-item:gt(0)').removeClass('tree-selected').find('i').removeClass('icon-ok').addClass('tree-dot');\n        }\n    }\n    \n});\n","id":"https://eapyl.github.io/fuelux-tree-additional-behavior/","title":"FuelUX Tree additional behavior"},"https://eapyl.github.io/get-information-about-sp-functions/":{"body":"When your primary work is adding functionality to MSSQL database (like implementing business logic in stored procedures, functions and view) it is very useful to have the list of all SP, functions and views with their description, name of authors, created dates and input/output parameters.\n\nIn this small article I will describer how to create a small console application which will get information from DB and create a list with this information in memory. Later I am creating HTML report using this information. But creating HTML report is not described in this article.\nOne note: each SP, function and view should have the next comment in their code:\n-- =============================================\n-- Author:      FirstName LastName\n-- Create date = \"yyyyMMdd\n-- Description: Short description\n-- =============================================\n\nSQL query which shows information about SP, functions and views is:\nconst string GetAllObjects = @\"\nDECLARE @StopString nvarchar(MAX) = '-- =============================================';\n\nSELECT DISTINCT\no.name,\no.type_desc as Type,\ns.name as [Schema],\nm.definition,\no.create_date as Created,\no.modify_date as Modified,\nCASE WHEN CHARINDEX(@StopString, m.definition, CHARINDEX(@StopString, m.definition, 0)+1)-CHARINDEX(@StopString, m.definition, 0)-LEN(@StopString) &gt; CHARINDEX(@StopString, m.definition, 0) + LEN(@StopString)\n    THEN\n        SUBSTRING(m.definition, CHARINDEX(@StopString, m.definition, 0) + LEN(@StopString), CHARINDEX(@StopString, m.definition, CHARINDEX(@StopString, m.definition, 0)+1)-CHARINDEX(@StopString, m.definition, 0)-LEN(@StopString))\n    ELSE \n        'No description'\nEND\nAS Description\nFROM sys.sql_modules m \n    INNER JOIN sys.objects o ON m.object_id = o.object_id\n    INNER JOIN sys.schemas s ON o.schema_id = s.schema_id\nWHERE \n    s.name = 'dbo' and\n    (o.type_desc = 'VIEW' or o.type_desc = 'SQL_STORED_PROCEDURE' or o.type_desc = 'SQL_INLINE_TABLE_VALUED_FUNCTION' or o.type_desc = 'SQL_SCALAR_FUNCTION')\n\";\n\nAs I usully use Dapper to work with DB there is a list of DTOs:\ninternal class DBObject\n{\n    public string Name { get; set; }\n    public string Schema { get; set; }\n    public string Type { get; set; }\n    public string Definition { get; set; }\n    public DateTime Created { get; set; }\n    public DateTime Modified { get; set; }\n    public string Description { get; set; }\n}\n\ninternal class HelpInfo\n{\n    public string Name { get; set; }\n    public string Owner { get; set; }\n    public string Type { get; set; }\n    public DateTime Created_datetime { get; set; }\n}\n\ninternal class Parameter\n{\n    public string Parameter_name { get; set; }\n    public string Type { get; set; }\n    public int Length { get; set; }\n    public string Prec { get; set; }\n    public int Param_oder { get; set; }\n    public string Collation { get; set; }\n}\n\ninternal class Table\n{\n    public string Column_name { get; set; }\n    public string Type { get; set; }\n    public string Computed { get; set; }\n    public int Length { get; set; }\n    public string Prec { get; set; }\n    public string Scale { get; set; }\n    public string Nullable { get; set; }\n    public string TrimTrailingBlanks { get; set; }\n    public string FixedLenNullInSource { get; set; }\n    public string Collation { get; set; }\n}\n\nAnd to get the list of SP, functions and views we can use the next method:\npublic IEnumerable&lt;(DBObject Object, HelpInfo Info, IEnumerable&lt;Parameter&gt; Parameters, IEnumerable&lt;Table&gt; OutputTables)&gt; GetAllDbObjects()\n{\n    var objs = _sqlExecutor.Query&lt;DBObject&gt;(GetAllObjects);\n    foreach (var data in objs.OrderBy(x =&gt; x.Created))\n    {\n        switch (data.Type)\n        {\n            case \"SQL_STORED_PROCEDURE\":\n            case \"SQL_SCALAR_FUNCTION\":\n                var infoAboutSPOrScalarFunction = _sqlExecutor.QueryMultiple&lt;HelpInfo, Parameter&gt;(\"sp_help\",\n                    new { @objname = $\"{data.Schema}.{data.Name}\" }, CommandType.StoredProcedure);\n                yield return (data, infoAboutSPOrScalarFunction.Item1, infoAboutSPOrScalarFunction.Item2, null);\n                break;\n            case \"SQL_INLINE_TABLE_VALUED_FUNCTION\":\n            case \"VIEW\":\n                var inforAboutViewOrInlineFunction = _sqlExecutor.QueryMultiple&lt;HelpInfo, Table, Parameter&gt;(\"sp_help\",\n                    new { @objname = $\"{data.Schema}.{data.Name}\" }, CommandType.StoredProcedure);\n                yield return (data, inforAboutViewOrInlineFunction.Item1, inforAboutViewOrInlineFunction.Item3, inforAboutViewOrInlineFunction.Item2);\n                break;\n        }\n    }\n}\n\n/// where Query and QueryMultiple methods look like\npublic IEnumerable&lt;T&gt; Query&lt;T&gt;(string query)\n{\n    using (var connection = new SqlConnection(connectionString))\n    {\n        return connection.Query&lt;T&gt;(query);\n    }\n}\n\npublic (T, IEnumerable&lt;K&gt;) QueryMultiple&lt;T, K&gt;(string query, object param, CommandType commandType)\n{\n    using (var connection = new SqlConnection(connectionString))\n    {\n        using (var multi = connection.QueryMultiple(query, param, commandType: CommandType.StoredProcedure))\n        {\n            return (\n                multi.Read&lt;T&gt;().Single(),\n                multi.IsConsumed ? null : multi.Read&lt;K&gt;()\n            );\n        }\n    }\n}\n\npublic (T, IEnumerable&lt;K&gt;, IEnumerable&lt;M&gt;) QueryMultiple&lt;T, K, M&gt;(string query, object param, CommandType commandType)\n{\n    using (var connection = new SqlConnection(connectionString))\n    {\n        using (var multi = connection.QueryMultiple(query, param, commandType: CommandType.StoredProcedure))\n        {\n            return (\n                multi.Read&lt;T&gt;().Single(),\n                multi.Read&lt;K&gt;(),\n                multi.IsConsumed ? null: multi.Read&lt;M&gt;()\n            );\n        }\n    }\n}\n\nSo mentioned GetAllDbObjects returns a list of tuples, where DBObject contains general information about SP, function or view; HelpInfo contains additional information about DBObject; IEnumerable contains information about input/output parameters for SP and functions; IEnumerable contains information about a view design (as view returns data in table format).We can use this list to create different kinds of report like HTML report or delta report which shows only modified db objects.Thanks!\n\n\n","id":"https://eapyl.github.io/get-information-about-sp-functions/","title":"Get information about all stored procedures, views and functions"},"https://eapyl.github.io/gitversion-tc/":{"body":"GitVersion is the utility to set up version of deployed assemblies using information from Git.\n\nThere is an easy way to set up it on your TC build server. Go to MetaRunner and download MR_GitVersion3.xml file. You should put this file to your build server. The path is C:\\ProgramData\\JetBrains\\TeamCity\\config\\projects{Project}\\pluginData\\metaRunners. The first part of this part you can find in Global settings of Team City. Also you have to restart your server after this.\nSo you will be able to set up GitVersion build step which just gran information about your version from Git tags and put it to your assemblies.\nTC to build only commits with tags (RC-*). VCS Root set up:\n\n\nTrigger:\n\n","id":"https://eapyl.github.io/gitversion-tc/","title":"GitVersion + TC"},"https://eapyl.github.io/giving-full-read-write-permissions-to-a-folder-by-all-users-and-apps/":{"body":"Allows delete, write and edit all files in a particular folder:\nchmod -R 777 &lt;desired folder&gt;\n","id":"https://eapyl.github.io/giving-full-read-write-permissions-to-a-folder-by-all-users-and-apps/","title":"Giving full read+write permissions to a folder by all users and apps"},"https://eapyl.github.io/help-to-your-eyes/":{"body":"When you are travelling (in car, train and etc) - let the world to swim in front of you, do not \"jump eyes\" from one object to another and \"cling to look.\"\nWhen watching TV glance over the surface of the screen periodically, as if you are looking out the window and look at the screen glass.\nClosing eyes for 3-5 seconds and easy fast twinkle are improving blood circulation.\nIt is useful to look at the flame of a burning candle - up to 15 minutes.\nIt would be good to get enough sleep!\nYou should take small breaks as often as possible when working at computer or with papers. During the pause you can do a little gymnastics for the eyes:\n\nEach exercise is performed 5-10 times in each direction, 1-2 times a day\nThanks.\n","id":"https://eapyl.github.io/help-to-your-eyes/","title":"Help to your eyes"},"https://eapyl.github.io/how-to-create-discord-bot/":{"body":"That is a manual how to create simple ping-pong discord bot using javascript (nodejs).\n\n\nInstall nodejs and npm\nCreate a folder for your discord bot\nRun npm init in the folder\nInstall Discrod.js: npm install --save discordjs\nCreate index.js in this folder:\n\n/*\n  A ping pong bot, whenever you send \"ping\", it replies \"pong\".\n*/\n\n// import the discord.js module\nconst Discord = require('discord.js');\n\n// create an instance of a Discord Client, and call it bot\nconst bot = new Discord.Client();\n\n// the token of your bot - https://discordapp.com/developers/applications/me\nconst token = 'your bot token here';\n\n// the ready event is vital, it means that your bot will only start reacting to information\n// from Discord _after_ ready is emitted.\nbot.on('ready', () =&gt; {\n  console.log('I am ready!');\n});\n\n// create an event listener for messages\nbot.on('message', message =&gt; {\n  // if the message is \"ping\",\n  if (message.content === 'ping') {\n    // send \"pong\" to the same channel.\n    message.channel.sendMessage('pong');\n  }\n});\n\n// log our bot in\nbot.login(token);\n\n\nGot to https://discordapp.com/developers/applications/me and create your bot\nPut all needed values, click \"Create Application\". On the next page scroll down until you see \"Create a bot user\", click that.\nAfter that you will be able to copy a token of your bot. Copy it and post it in created index.js\nGo to https://discordapp.com/oauth2/authorize?&amp;client_id=YOUR_CLIENT_ID_HERE&amp;scope=bot&amp;permissions=0. You should replace YOUR_CLIENT_ID_HERE with Client ID (it should be in App Details on the web page where you got your token).\nAdd your bot to the server.\nRun created bot by command node index.js\nYou should be able to see a bot in Discord at your server. Write 'ping' to the bot. The answer should be 'pong'.\n\nWell done! You created your Discord bot! Thank you.\nHere is a simple rss bot for discord:\nconst Discord = require('discord.js');\nvar Store = require(\"jfs\"); // using jfs to save already posted rss news\nvar db = new Store(\"rssfeeds\");\nconst client = new Discord.Client();\n\nvar currentNews = [];\nvar postedNews = [];\nvar interval;\n\nfunction log(message) {\n    console.log(new Date() + \": \" + message);\n}\n\n/// load all posted rss news\ndb.all(function (err, objs) {\n    if (err) log(err);\n    for (var id in objs) {\n        postedNews.push({ id: id, value: objs[id] });\n        log(\"Restored posted news \" + id);\n    }\n    loadFeeds();\n});\n\nclient.on('ready', () =&gt; {\n    log('I am ready!');\n    var generalChannel = client.channels.get(\"25466045464298784169786\");\n    if (!interval) {\n        interval = setInterval(() =&gt; {\n            if (currentNews.length &gt; 0) {\n                var newsToPost = currentNews.shift();\n                generalChannel.sendMessage(newsToPost.title + \" - \" + newsToPost.link);\n                db.save(newsToPost, function (err, id) {\n                    if (err) log(err);\n                    log(\"Saved posted news \" + id);\n                    postedNews.push({ id: id, value: newsToPost });\n                });\n\n                log(\"Post \" + newsToPost.link);\n                log(\"Left in array - \" + currentNews.length);\n            }\n        }, 60000 * 30);\n    }\n});\n\nsetInterval(() =&gt; {\n    log(\"Updating news\");\n    loadFeeds();\n}, 60000 * 60 * 24);\n\nsetInterval(() =&gt; {\n    while (postedNews.length &gt; 1000) {\n        var oldNewsToDelete = postedNews.shift();\n        log(\"deleting \" + oldNewsToDelete.id)\n        db.delete(oldNewsToDelete.id, function (err) {\n            if (err) log(err);\n        });\n    }\n}, 60000 * 60 * 24);\n\nclient.login('MjgyNDg5MjQ0MDEyNzczMzc2.C4nUkw.Na6H7ZVrXbMZbXv4Wt9p8cZaj2Q');\n\n// rss.json should contain information about rss, like:\n//{\n//    \"bbc\": {\n//        \"description\" : \"bbc news\",\n//        \"url\" : \"https://bbs.com/rss\"\n//    }\n//}\nvar rssFeeds = require(\"./rss.json\");\n\n/// load feeds from Resources\nfunction loadFeeds() {\n    for (var feedName in rssFeeds) {\n        rssfeed(rssFeeds[feedName].url);\n    }\n}\n\nfunction rssfeed(url) {\n    var FeedParser = require('feedparser');\n    var feedparser = new FeedParser();\n    var request = require('request');\n    request(url).pipe(feedparser);\n    feedparser.on('error', function (error) {\n        log(error);\n    });\n    feedparser.on('readable', function () {\n        var stream = this;\n        var meta = this.meta; // **NOTE** the \"meta\" is always available in the context of the feedparser instance\n        var item;\n\n        while (item = stream.read()) {\n            if (postedNews &amp;&amp; postedNews.some(x =&gt; x.value.title == item.title)) continue;\n            if (currentNews.some(x =&gt; x.title == item.title)) continue;\n            log('Add news to current news array ' + item.link);\n            currentNews.push({\n                title = \"item.title,\n                link: item.link,\n                date = \"item.date\n            });\n            if (currentNews.length &gt; 100) currentNews.shift();\n        }\n    });\n}\n\nLinks:\n\nCreating a discord bot &amp; getting a token\nDiscord.js\nPing-Pong example\nDiscord Developers\nDiscord\n\n","id":"https://eapyl.github.io/how-to-create-discord-bot/","title":"How to create Discord bot"},"https://eapyl.github.io/how-to-sql-code-coverage/":{"body":"If you are creating a lot of SQL code, it is a good idea to do unit testing for it and see code coverage. Luckly there is two nice tools/libs to do it: tSQLt and SQLCover.\n\nIn this article I will show how to create/set up SQLCover and run it for each CI build.\nThe basic idea is we are creating command line application which runs our tSQLt unit tests via SQLCover and generates HTML report with code coverage information.\nUnfortunately there is no SQLCover package in NuGet, but we can download it from here.\nCreate a new command line application, add references to SQLCover.dll and Microsoft.SqlServer.TransactSql.ScriptDom.dll.\nAfter that there is an example of Program.cs:\n    private const string RunAllSqlTestsCommand = \"exec tSQLt.RunAll;\";\n    private const string DefaultDatabaseName = \"MyDB\";\n\n    private const string ReportName = \"SQLCoverage.html\";\n\n    static void Main(string[] args)\n    {\n        var connectionString = ConfigurationManager.ConnectionStrings[DefaultDatabaseName].ConnectionString;\n        var coverage = new CodeCoverage(connectionString, DefaultDatabaseName);\n        var result = coverage.Cover(RunAllSqlTestsCommand);\n        var updatedResult =  result.Html();\n        File.WriteAllText(ReportName, updatedResult);\n    }\n\nAfter execution you will see SQLCoverage.html with code coverage statistics in the same folder.\nOne note from SQLCover owner: \"When we target local sql instances we delete the trace files but when targetting remote instances we are unable to delete the files as we do not (or potentially) do not have access. If this is the case keep an eye on the log directory and remove old \"SQLCover-Trace-.xel\" and \"SQLCover-Trace-.xem\" files.\"\nThanks.\n","id":"https://eapyl.github.io/how-to-sql-code-coverage/","title":"How to set up SQL code coverage"},"https://eapyl.github.io/iis-7-httpmodule-logger/":{"body":" -  IIS 7 (Classic mode)\nusing System;\nusing System.Collections.Generic;\nusing System.Linq;\nusing System.Text;\nusing System.Web;\nusing System.Threading.Tasks;\nusing System.IO;\nusing System.Threading;\nusing System.Net;\nusing ReutersKnowledge.Web.Services.Util;\nusing System.Collections.Specialized;\nusing System.Reflection;\n \nnamespace IISWsgLogger\n{\n    public class IISLoggerModule : IHttpModule\n    {\n        private static string fileName = \"D:\\\\Log.txt\";\n \n        private static ConcurrentQueue&lt;string&gt; logRecords = new ConcurrentQueue&lt;string&gt;();\n \n        private static object syncTask = new object();\n        private static Task taskLog;\n \n        public void Init(HttpApplication context)\n        {\n            if (taskLog == null)\n            {\n                lock (syncTask)\n                {\n                    if (taskLog == null)\n                    {\n                        taskLog = Task.Factory.StartNew(() =&gt; StartLog(), TaskCreationOptions.LongRunning);\n                    }\n                }\n            }\n            context.BeginRequest += new EventHandler(OnPreRequestHandlerExecute);\n            context.EndRequest += new EventHandler(OnPostReleaseRequestState);\n        }\n \n        private void StartLog()\n        {\n            var t = File.AppendText(fileName);\n            t.WriteLine(\"date time wsg-guid s-port cs-method reuters-uuid cs(Host) cs-uri-stem cs-uri-query sc-status sc-substatus cs(User-Agent) cs(Cookie) TimeTakenMS sc-bytes\");\n            int waitMil = 1000;\n            string res = null;\n            try\n            {\n                while (true)\n                {\n                    while (logRecords.TryDequeue(out res))\n                    {\n                        t.WriteLine(res);\n                    }\n                    Thread.Sleep(waitMil);\n                }\n            }\n            finally\n            {\n                t.Close();\n            }\n \n        }\n \n        public void Dispose()\n        {\n        }\n \n        public void OnPreRequestHandlerExecute(Object source, EventArgs e)\n        {\n            HttpApplication app = (HttpApplication)source;\n            var guid = Guid.NewGuid().ToString();\n            app.Context.RewritePath(app.Context.Request.FilePath, app.Context.Request.PathInfo, \"guid=\" + guid);\n        }\n \n        public void OnPostReleaseRequestState(Object source, EventArgs e)\n        {\n            HttpApplication app = (HttpApplication)source;\n            var time = DateTime.Now;\n            var timeStamp = app.Context.Timestamp;\n            var port = app.Context.Request.Url.Port;\n            var typeOfRequest = app.Context.Request.RequestType;\n            var Guid = app.Context.Request.QueryString[0];\n            var host = app.Context.Request.Url.Host;\n            var rawUrl = app.Context.Request.RawUrl;\n            var contentRequestLength = app.Context.Request.ContentLength;\n            var status = app.Context.Response.StatusCode;\n            var agent = app.Context.Request.UserAgent;\n            var cookies = string.Empty;\n            foreach (var cookie in app.Context.Request.Cookies)\n            {\n                cookies += cookies;\n            }\n \n            logRecords.Enqueue(string.Format(\"{0} {1} {3} {4} {5} {6} {7} {8} {9} {10}\", time, guid, port, typeOfRequest, host, rawUrl, status, agent, timeStamp, contentRequestLength));\n        }\n \n    }\n}\n\nweb.config :\n&lt;?xml version=\"1.0\"?&gt;\n&lt;configuration&gt;\n &lt;configSections&gt;\n  ...\n &lt;/configSections&gt;\n &lt;system.web&gt;\n  ...\n   &lt;httpModules&gt;\n   ...\n  &lt;/httpModules&gt;\n &lt;/system.web&gt;\n &lt;system.webServer&gt;\n  &lt;modules&gt;\n   &lt;add name=\"IISLoggerModule\" type=\"IISLogger.IISLoggerModule, IISLogger.IISLoggerNamespace.IISLogger\"/&gt;\n","id":"https://eapyl.github.io/iis-7-httpmodule-logger/","title":"IIS 7 HttpModule Logger"},"https://eapyl.github.io/implementing-async-queue-using-rxjs/":{"body":"There is an example of queue using rxjs:\nRx.Observable.from(['foo', 'bar', 'baz', 'bay', 'bax', 'bar', 'cat'])\n    .do(x =&gt; console.log((new Date).toLocaleTimeString() + \" \" + x))\n    // grouping by 2 \n    .bufferCount(2)\n    // concat received results\n    .concatMap((data) =&gt; {\n        return Rx.Observable.defer(() =&gt; {\n            // assuming long operation here, e.g. downloading,\n            // we can use merge here if we want to do operation per item\n            return Rx.Observable.create((observer)=&gt;{\n                setTimeout(function () {\n                    observer.next(data);\n                    observer.complete();\n                }, 2000);\n            })\n        });\n    }) \n    .subscribe(\n        result =&gt; console.log((new Date).toLocaleTimeString() + \" finished \" + result),\n        error =&gt; console.error(error),\n        () =&gt; console.log('done')\n    );\n\n// Console ouput\n// rxjs.html:9 Console was cleared\n// rxjs.html:11 9:56:36 PM foo\n// rxjs.html:11 9:56:36 PM bar\n// rxjs.html:11 9:56:36 PM baz\n// rxjs.html:11 9:56:36 PM bay\n// rxjs.html:11 9:56:36 PM bax\n// rxjs.html:11 9:56:36 PM bar\n// rxjs.html:11 9:56:36 PM cat\n// rxjs.html:28 9:56:38 PM finished foo,bar\n// rxjs.html:28 9:56:40 PM finished baz,bay\n// rxjs.html:28 9:56:42 PM finished bax,bar\n// rxjs.html:28 9:56:44 PM finished cat\n// rxjs.html:30 done\n\nUsed links:\n\nQuestion about promise chains/queues in Rx\nDefer\nRxJS\n\n","id":"https://eapyl.github.io/implementing-async-queue-using-rxjs/","title":"Implementing async.queue using rxjs"},"https://eapyl.github.io/influxdb-can-t-be-started-as-a-service/":{"body":"I was not able to run influxdb as a service after installing influxdb on my local ubuntu:\nCommand sudo service influxd status showed:\n influxdb.service - InfluxDB is an open-source, distributed, time series database\n   Loaded: loaded (/lib/systemd/system/influxdb.service; enabled; vendor preset: enabled)\n   Active: inactive (dead) (Result: exit-code) since Fri 2016-12-23 15:05:34 CET; 3min 47s ago\n     Docs: https://docs.influxdata.com/influxdb/\n  Process: 13938 ExecStart=/usr/bin/influxd -config /etc/influxdb/influxdb.conf ${INFLUXD_OPTS} (code=exited, status=1/FAILURE)\n Main PID: 13938 (code=exited, status=1/FAILURE)\n\nDec 23 15:05:34 fes-U36SG systemd[1]: influxdb.service: Main process exited, code=exited, status=1/FAILURE\nDec 23 15:05:34 fes-U36SG systemd[1]: influxdb.service: Unit entered failed state.\nDec 23 15:05:34 fes-U36SG systemd[1]: influxdb.service: Failed with result 'exit-code'.\nDec 23 15:05:34 fes-U36SG systemd[1]: influxdb.service: Service hold-off time over, scheduling restart.\nDec 23 15:05:34 fes-U36SG systemd[1]: Stopped InfluxDB is an open-source, distributed, time series database.\nDec 23 15:05:34 fes-U36SG systemd[1]: influxdb.service: Start request repeated too quickly.\nDec 23 15:05:34 fes-U36SG systemd[1]: Failed to start InfluxDB is an open-source, distributed, time series database.\n\nBut the simple command influxd worked well.\nI found that there is the next code in /lib/systemd/system/influxdb.service:\n# If you modify this, please also make sure to edit init.sh\n\n[Unit]\nDescription=InfluxDB is an open-source, distributed, time series database\nDocumentation=https://docs.influxdata.com/influxdb/\nAfter=network-online.target\n\n[Service]\nUser=influxdb\nGroup=influxdb\nLimitNOFILE=65536\nEnvironmentFile=-/etc/default/influxdb\nExecStart=/usr/bin/influxd -config /etc/influxdb/influxdb.conf ${INFLUXD_OPTS}\nKillMode=control-group\nRestart=on-failure\n\n[Install]\nWantedBy=multi-user.target\nAlias=influxd.service\n\nAll is working well after I commended the next two lines:\n[Service]\n# User=influxdb\n# Group=influxdb\n\nThanks!\n","id":"https://eapyl.github.io/influxdb-can-t-be-started-as-a-service/","title":"InfluxDB can't be started as a service"},"https://eapyl.github.io/install-docker-on-raspberry-pi/":{"body":"Need to run the next command:\ncurl -sSL https://get.docker.com | sh\n\nAfter installation need to execute sudo usermod -aG docker $USER and relogin.\n","id":"https://eapyl.github.io/install-docker-on-raspberry-pi/","title":"Install docker on raspberry PI"},"https://eapyl.github.io/jquery-twitter-bootstrap-list-tree-plugin-editable-version/":{"body":"JQuery / Twitter Bootstrap List Tree Plugin is a great plugin, but it does not allow to edit and sort tree elements. I have created an editable version of plugin: The view of tree:\n\n\nYou can find the source code there or here.\nAlso see it below.\n","id":"https://eapyl.github.io/jquery-twitter-bootstrap-list-tree-plugin-editable-version/","title":"jQuery Twitter Bootstrap List Tree Plugin Editable version"},"https://eapyl.github.io/light-version-of-monodruid/":{"body":"I have created the light version of MonoDroid Unit Testing framework.\nPlease look and use if you need.\n","id":"https://eapyl.github.io/light-version-of-monodruid/","title":"Light version of Monodruid"},"https://eapyl.github.io/linq-and-group/":{"body":"Description. There are modules that have the input and output parameters (type and number of parameters may be different). The goal is to select some first modules that have no input parameters, then the modules whose inputs are the output parameters of the previously selected modules and so on. Until the last module will not output parameters.\n\nThe database stores all displayed modules and displays of all parameters where the parameter mapping to the mapping of modules is many-to-one.\nInitially, we choose to do all the settings using a simple SQL query.\nprivate static SqlCeDataReader SelectAllParamterAndModuleName()\n{\n    return ExecuteDataReader(String.Format(QSelectAllParamterANdModuleName));\n}\n\nwhere QSelectAllParamterANdModuleName is text of the query.\nprivate static IEnumerable&lt;ParameterType&gt; SelectAllParameterToArray()\n{\n    var query =\n        from row in SelectAllParamterAndModuleName().Cast()\n        select new ParameterType\n        {\n            Id = (int)row[\"FID\"],\n            Name = (string)row[\"FNAME\"],\n            TypeName = (string)row[\"FTYPE\"],\n            ModuleId = (int)row[\"FMODULEID\"],\n                        ModuleName = (string)row[\"FMODULE\"], Number = (int)row[\"FNUMBER\"], TypeOfPar = (bool)row[\"FTYPEOFPARAMETER\"]};\n    return query.ToArray();\n}\n\ncreate from selected SqlReader array of elements of ParameterType. The result can be cached.\npublic static List&lt;ModuleType&gt; SelectModuleByInputParameter(List&lt;ParameterType&gt; inputParameter)\n{\n    if (inputParameter == null)\n    {\n        throw new ArgumentNullException();\n    }\n    var res = new List();\n    var para = SelectAllParameterToArray();\n    if (inputParameter.Count == 0)\n    {\n        var par = from parameter in para\n                    where !(from parameter2 in para\n                            where parameter2.TypeOfPar\n                            select parameter2.ModuleId).Contains(parameter.ModuleId)\n                    select parameter;\n        return par.Select(x =&amp;gt; new ModuleType {Id = x.ModuleId, Name = x.ModuleName}).ToList();\n    }\n\n    var parGr = from parameter in para\n                where parameter.TypeOfPar\n                group parameter by parameter.ModuleId\n                into modPara\n                where modPara.Count() == inputParameter.Count\n                select modPara;\n\n    foreach (var paramGr in parGr)\n    {\n        bool AddInRes = true;\n        var listParaGr = paramGr.ToList();\n        for (int i = 0; i &amp;lt; listParaGr.Count; i++)\n        {\n            if (listParaGr[i].Number != inputParameter[i].Number ||\n            listParaGr[i].TypeName != inputParameter[i].TypeName)\n                AddInRes = false;\n        }\n        if (AddInRes)\n        {\n            res.Add(new ModuleType(){Id =  listParaGr[0].ModuleId, Name = listParaGr[0].ModuleName});\n        }\n    }\n    return res;\n}\n\nThis method returns a collection of our modules, which contains defined input parameters. Thus, this method should be called justbefore the loop until the result will contain at least one value. It should be noted that calls to this method will generally be bifurcate (the first layer selected modules, and for everyone in this layer, called again, this method and so on). But this is not Linq.\n","id":"https://eapyl.github.io/linq-and-group/","title":"Linq and Group"},"https://eapyl.github.io/log2console-with-iisexpress-and-log4net/":{"body":"Log2Console with IISExpress and log4net\nI have found that log4net and log2console don't work correctly (using IISExpress) with each other after trying using default configuration from http://log2console.codeplex.com/wikipage?title=ClientConfiguration.\nBut i have found new configuration for log4net and log2console (log4net) and\n\nSeems work fine:\n\n","id":"https://eapyl.github.io/log2console-with-iisexpress-and-log4net/","title":"Log2Console with IISExpress and log4net"},"https://eapyl.github.io/mvc-indefinitely-loads-the-page-and-call-the-controller-cyclical/":{"body":"I have found that the page load indefinitely. And the reason was I add @Html.RenderAction to my default layout.\n\nSo the solution of the problem to add the next code to rendered view:\n@{\n      Layout = null;\n}\n\nAs I understand, MVC try to load the next without this code:\nLayout -&gt; MyView -&gt; Layout -&gt; MyView -&gt; ....\nWith code above:\nLayout -&gt; MyView { -&gt; null}\nSo it's happens.\n","id":"https://eapyl.github.io/mvc-indefinitely-loads-the-page-and-call-the-controller-cyclical/","title":"MVC indefinitely loads the page and call the controller cyclical"},"https://eapyl.github.io/nancy-sample-application/":{"body":"Hi there, \nJust trying to create a simple service running on server. This service should report his status by HTTP and should have a nice log mechanism. So I finished my investigation to use NetCore + Nancy + Serilog + Newtonsoft.Json + FakeItEasy + App Metrics.\n\nPlease find the source code of sample application here.\nWant to mention that I had to install the next lib:\nsudo apt-get install libunwind8\n\nto actually run my service on remote server - Ubuntu 16.04 x64. There was the next error: Failed to load libcoreclr.so libunwind.so.8 cannot open shared object file without this library.\nAlso project.json is set up to build self-contained application:\ndotnet publish -c Release -r ubuntu.16.04-x64 -o packages/ubuntu\n\nThanks.\n","id":"https://eapyl.github.io/nancy-sample-application/","title":"Nancy sample application"},"https://eapyl.github.io/notes-from-introduction-to-linux/":{"body":"course link\nLinux Filesystem\n\nConventional disk filesystems: ext2, ext3, ext4, XFS, Btrfs, JFS,NTFS, etc.\nFlash storage filesystems: ubifs, JFFS2, YAFFS, etc.\nDatabase filesystems\nSpecial purpose filesystems: procfs, sysfs, tmpfs, debugfs, etc.\n\nPartitions\n\nWindows\n\nPartition: Disk1 \nFilesystem type: NTFS/FAT32\nMounting Parameters: DriveLetter \nBase Folder of OS: C drive\n\n\nLinux\n\nPartition: /dev/sda1\nFilesystem type: EXT3/EXT4/XFS\nMounting Parameters: MountPoint\nBase Folder of OS: /\n\n\n\nThe Filesystem Hierarchy Standard\n\nThe Boot Process\n\nChoosing a Linux Distribution\n\n","id":"https://eapyl.github.io/notes-from-introduction-to-linux/","title":"Notes from 'Introduction to Linux'"},"https://eapyl.github.io/octave-tutorial/":{"body":"Information is from this wonderful course.\nBasic operations\n%% Change Octave prompt  \nPS1('&gt;&gt; ');\n%% Change working directory in windows example:\ncd 'c:/path/to/desired/directory name'\n%% Note that it uses normal slashes and does not use escape characters for the empty spaces.\n\n%% elementary operations\n5+6\n3-2\n5*8\n1/2\n2^6\n1 == 2 % false\n1 ~= 2 % true.  note, not \"!=\"\n1 &amp;&amp; 0\n1 || 0\nxor(1,0)\n\n\n%% variable assignment\na = 3; % semicolon suppresses output\nb = 'hi';\nc = 3&gt;=1;\n\n% Displaying them:\na = pi\ndisp(a)\ndisp(sprintf('2 decimals: %0.2f', a))\ndisp(sprintf('6 decimals: %0.6f', a))\nformat long\na\nformat short\na\n\n\n%%  vectors and matrices\nA = [1 2; 3 4; 5 6]\n\n\nv = [1 2 3]\nv = [1; 2; 3]\nv = 1:0.1:2   % from 1 to 2, with stepsize of 0.1. Useful for plot axes\nv = 1:6       % from 1 to 6, assumes stepsize of 1 (row vector)\n\nC = 2*ones(2,3) % same as C = [2 2 2; 2 2 2]\nw = ones(1,3)   % 1x3 vector of ones\nw = zeros(1,3)\nw = rand(1,3) % drawn from a uniform distribution \nw = randn(1,3)% drawn from a normal distribution (mean=0, var=1)\nw = -6 + sqrt(10)*(randn(1,10000));  % (mean = -6, var = 10) - note: add the semicolon\nhist(w)    % plot histogram using 10 bins (default)\nhist(w,50) % plot histogram using 50 bins\n% note: if hist() crashes, try \"graphics_toolkit('gnu_plot')\" \n\nI = eye(4)   % 4x4 identity matrix\n\n% help function\nhelp eye\nhelp rand\nhelp help\nMoving Data Around\n%% dimensions\nsz = size(A) % 1x2 matrix: [(number of rows) (number of columns)]\nsize(A,1) % number of rows\nsize(A,2) % number of cols\nlength(v) % size of longest dimension\n\n\n%% loading data\npwd   % show current directory (current path)\ncd 'C:\\Users\\ang\\Octave files'  % change directory \nls    % list files in current directory \nload q1y.dat   % alternatively, load('q1y.dat')\nload q1x.dat\nwho   % list variables in workspace\nwhos  % list variables in workspace (detailed view) \nclear q1y      % clear command without any args clears all vars\nv = q1x(1:10); % first 10 elements of q1x (counts down the columns)\nsave hello.mat v;  % save variable v into file hello.mat\nsave hello.txt v -ascii; % save as ascii\n% fopen, fread, fprintf, fscanf also work  [[not needed in class]]\n\n%% indexing\nA(3,2)  % indexing is (row,col)\nA(2,:)  % get the 2nd row. \n        % \":\" means every element along that dimension\nA(:,2)  % get the 2nd col\nA([1 3],:) % print all  the elements of rows 1 and 3\n\nA(:,2) = [10; 11; 12]     % change second column\nA = [A, [100; 101; 102]]; % append column vec\nA(:) % Select all elements as a column vector.\n\n% Putting data together \nA = [1 2; 3 4; 5 6]\nB = [11 12; 13 14; 15 16] % same dims as A\nC = [A B]  % concatenating A and B matrices side by side\nC = [A, B] % concatenating A and B matrices side by side\nC = [A; B] % Concatenating A and B top and bottom\nComputing on Data\n%% initialize variables\nA = [1 2;3 4;5 6]\nB = [11 12;13 14;15 16]\nC = [1 1;2 2]\nv = [1;2;3]\n\n%% matrix operations\nA * C  % matrix multiplication\nA .* B % element-wise multiplication\n% A .* C  or A * B gives error - wrong dimensions\nA .^ 2 % element-wise square of each element in A\n1./v   % element-wise reciprocal\nlog(v)  % functions like this operate element-wise on vecs or matrices \nexp(v)\nabs(v)\n\n-v  % -1*v\n\nv + ones(length(v), 1)  \n% v + 1  % same\n\nA'  % matrix transpose\n\n%% misc useful functions\n\n% max  (or min)\na = [1 15 2 0.5]\nval = max(a)\n[val,ind] = max(a) % val -  maximum element of the vector a and index - index value where maximum occur\nval = max(A) % if A is matrix, returns max from each column\n\n% compare values in a matrix &amp; find\na &lt; 3 % checks which values in a are less than 3\nfind(a &lt; 3) % gives location of elements less than 3\nA = magic(3) % generates a magic matrix - not much used in ML algorithms\n[r,c] = find(A&gt;=7)  % row, column indices for values matching comparison\n\n% sum, prod\nsum(a)\nprod(a)\nfloor(a) % or ceil(a)\nmax(rand(3),rand(3))\nmax(A,[],1) -  maximum along columns(defaults to columns - max(A,[]))\nmax(A,[],2) - maximum along rows\nA = magic(9)\nsum(A,1)\nsum(A,2)\nsum(sum( A .* eye(9) ))\nsum(sum( A .* flipud(eye(9)) ))\n\n\n% Matrix inverse (pseudo-inverse)\npinv(A)        % inv(A'*A)*A'\nPlotting Data\n%% plotting\nt = [0:0.01:0.98];\ny1 = sin(2*pi*4*t); \nplot(t,y1);\ny2 = cos(2*pi*4*t);\nhold on;  % \"hold off\" to turn off\nplot(t,y2,'r');\nxlabel('time');\nylabel('value');\nlegend('sin','cos');\ntitle('my plot');\nprint -dpng 'myPlot.png'\nclose;           % or,  \"close all\" to close all figs\nfigure(1); plot(t, y1);\nfigure(2); plot(t, y2);\nfigure(2), clf;  % can specify the figure number\nsubplot(1,2,1);  % Divide plot into 1x2 grid, access 1st element\nplot(t,y1);\nsubplot(1,2,2);  % Divide plot into 1x2 grid, access 2nd element\nplot(t,y2);\naxis([0.5 1 -1 1]);  % change axis scale\n\n%% display a matrix (or image) \nfigure;\nimagesc(magic(15)), colorbar, colormap gray;\n% comma-chaining function calls.  \na=1,b=2,c=3\na=1;b=2;c=3;\nControl statements: for, while, if statements\nv = zeros(10,1);\nfor i=1:10, \n    v(i) = 2^i;\nend;\n% Can also use \"break\" and \"continue\" inside for and while loops to control execution.\n\ni = 1;\nwhile i &lt;= 5,\n  v(i) = 100; \n  i = i+1;\nend\n\ni = 1;\nwhile true, \n  v(i) = 999; \n  i = i+1;\n  if i == 6,\n    break;\n  end;\nend\n\nif v(1)==1,\n  disp('The value is one!');\nelseif v(1)==2,\n  disp('The value is two!');\nelse\n  disp('The value is not one or two!');\nend\nFunctions\nTo create a function, type the function code in a text editor (e.g. gedit or notepad), and save the file as \"functionName.m\"\nfunction y = squareThisNumber(x)\n\ny = x^2;\nfunction [y1, y2] = squareandCubeThisNo(x)\ny1 = x^2\ny2 = x^3\n\nMore info:\nhttps://www.coursera.org/learn/machine-learning\n","id":"https://eapyl.github.io/octave-tutorial/","title":"Octave Tutorial"},"https://eapyl.github.io/pages/":{"body":"","id":"https://eapyl.github.io/pages/","title":""},"https://eapyl.github.io/permanently-save-environment-variables/":{"body":"Environment variables are only stored temporally if you are setting them using terminal:\n\nexport TEST=/home/test/\n\nTo save this variable for all users, need to add this command to /etc/profile. If you want to have this environment variable only for current user, it is needed to add this command to ~/.profile.\nThanks.\n","id":"https://eapyl.github.io/permanently-save-environment-variables/","title":"Permanently save environment variables"},"https://eapyl.github.io/persistence-js-insert-empty-values-in-web-sql/":{"body":"I am starting to work with persistence.js library and open the problem to me: it saves empty data to web sql\n\n\nAfter investigating the problem i have found this question  and just want to clear and reproduce it in my notes. Thanks guys from this question :)\nThe problem connected with this js file: persistence.jquery. If it used, we should rewrite code such as:\n\nThanks.\n","id":"https://eapyl.github.io/persistence-js-insert-empty-values-in-web-sql/","title":"Persistence.js insert empty values in web sql"},"https://eapyl.github.io/personal-mobile-radio-application-using-ionic/":{"body":"Hi, there!\nFinally I am tired because of all advertisements which we have in any simple radio mobile application. I just want to listen radio and that is all! Quite simple, hah?\n\nSo I decided to create a simple radio mobile application by myself. I thought about Xamarin as I have some experience in creating application using it. But I decided to use new framework for me and it is Ionic. I am very impressed how cool it is and how easy to create application using it. It took about 2 hours to install all dependencies (ionic, android studio, java), deploy and run a first version of my application on my android device. Quite fast!\nI am using Ubuntu 16.04.\nPlease find the steps below:\n\nI have installed ionic framework using this link and create blank application: ionic start radioOn blank.\nAnd that is all, to start our application need to run ionic serve.\nAs I want to listen an online radio, I need to create a provider to listen online stream: Html5Audio:\n\nimport { Injectable, Output, EventEmitter } from '@angular/core';\n\n@Injectable()\nexport class Html5Audio {\n    @Output()\n    ended = new EventEmitter();\n\n    private pad2(number) { (number &lt; 10 ? '0' : '') + number; }\n\n    audioPlayer: any;\n    time: string;\n    @Output()\n    isPlaying = false;\n    readyStateInterval = null;\n    url: string;\n\n    public play(url: string) {\n        if (this.audioPlayer) {\n            this.stop();\n        }\n        this.url = url;\n        this.audioPlayer = new Audio(this.url);\n        this.isPlaying = true;\n        this.audioPlayer.play();\n\n        this.audioPlayer.addEventListener(\"timeupdate\", () =&gt; {\n            if (this.audioPlayer) {\n                var s = this.audioPlayer.currentTime % 60;\n                var m = (this.audioPlayer.currentTime / 60) % 60;\n                var h = ((this.audioPlayer.currentTime / 60) / 60) % 60;\n                if (this.isPlaying &amp;&amp; this.audioPlayer.currentTime &gt; 0) {\n                    this.time = this.pad2(h) + ':' + this.pad2(m) + ':' + this.pad2(s);\n                }\n            }\n        }, false);\n        this.audioPlayer.addEventListener(\"error\", (ex) =&gt; {\n            console.error(ex);\n        }, false);\n        this.audioPlayer.addEventListener(\"canplay\", () =&gt; {\n            console.log('CAN PLAY');\n        }, false);\n        this.audioPlayer.addEventListener(\"waiting\", () =&gt; {\n            this.isPlaying = false;\n        }, false);\n        this.audioPlayer.addEventListener(\"playing\", () =&gt; {\n            this.isPlaying = true;\n        }, false);\n        this.audioPlayer.addEventListener(\"ended\", () =&gt; {\n            this.stop();\n            this.ended.emit();\n        }, false);\n    }\n\n    pause() {\n        this.isPlaying = false;\n        this.audioPlayer.pause();\n    }\n\n    stop() {\n        this.isPlaying = false;\n        this.audioPlayer.pause();\n        this.audioPlayer = null;\n    }\n}\n\n\nIt has been imported to /src/app/app.module.\nThere is only one page with a list of stations (I have only 3 which I listen). Click on a station - starting this station, and there is one button to stop music(link). That is all. Simple!\nAfter that we need to prepare icon and splash image for application. I am using game-icons to create an icon and unspalsh to find full size images.\nNeed to put created icon.png and splash.png to /resources/icon.png and /resources/splash.png and run the next command ionic cordova resources (you have to have an account in Ionic portal and it is free).\nTo deploy our application need to run ionic cordova build android --prod --release and it will create *.apk file. We need to sign it using 'Sign Android APK' section from here.\nThat is all. We have signed apk which we can copy on our device and install.\n\nPlease find my project here. Signed apk file here.\nHow it looks like:\n\nCheers,\n","id":"https://eapyl.github.io/personal-mobile-radio-application-using-ionic/","title":"Personal mobile radio application using Ionic"},"https://eapyl.github.io/powershell-how-to/":{"body":"\nHow to delete all bin, obj folders?\n\nGet-ChildItem .\\ -include bin,obj -Recurse | foreach ($_) { remove-item $_.fullname -Force -Recurse }\n\n\nHow to set folder's permission?\n\n #set owner and principals for %SystemRoot%\\TEMP\n #http://channel9.msdn.com/Forums/Coffeehouse/Powershell-subinacl-ownership-of-directories\n Write-Host -ForegroundColor green \"Set owner and principals for %SystemRoot%\\TEMP\"\n $pathToSystemRoot = get-content env:systemroot\n $currentUser = [System.Security.Principal.WindowsIdentity]::GetCurrent().Name\n $Principal = new-object security.principal.ntaccount $currentUser\n $path = Join-Path $pathToSystemRoot \\temp\n \n $code = @\"\nusing System;\nusing System.Runtime.InteropServices;\n\nnamespace WSG.Utils\n{\npublic class PermissionsSetter\n{\n\n  [DllImport(\"advapi32.dll\", ExactSpelling = true, SetLastError = true)]\n  internal static extern bool AdjustTokenPrivileges(IntPtr htok, bool disall,\n  ref TokPriv1Luid newst, int len, IntPtr prev, IntPtr relen);\n\n\n  [DllImport(\"kernel32.dll\", ExactSpelling = true)]\n  internal static extern IntPtr GetCurrentProcess();\n\n\n  [DllImport(\"advapi32.dll\", ExactSpelling = true, SetLastError = true)]\n  internal static extern bool OpenProcessToken(IntPtr h, int acc, ref IntPtr\n  phtok);\n\n\n  [DllImport(\"advapi32.dll\", SetLastError = true)]\n  internal static extern bool LookupPrivilegeValue(string host, string name,\n  ref long pluid);\n\n\n  [StructLayout(LayoutKind.Sequential, Pack = 1)]\n  internal struct TokPriv1Luid\n  {\n   public int Count;\n   public long Luid;\n   public int Attr;\n  }\n\n\n  internal const int SE_PRIVILEGE_DISABLED = 0x00000000;\n  internal const int SE_PRIVILEGE_ENABLED = 0x00000002;\n  internal const int TOKEN_QUERY = 0x00000008;\n  internal const int TOKEN_ADJUST_PRIVILEGES = 0x00000020;\n\n\n  public const string SE_ASSIGNPRIMARYTOKEN_NAME = \"SeAssignPrimaryTokenPrivilege\";\n  public const string SE_AUDIT_NAME = \"SeAuditPrivilege\";\n  public const string SE_BACKUP_NAME = \"SeBackupPrivilege\";\n  public const string SE_CHANGE_NOTIFY_NAME = \"SeChangeNotifyPrivilege\";\n  public const string SE_CREATE_GLOBAL_NAME = \"SeCreateGlobalPrivilege\";\n  public const string SE_CREATE_PAGEFILE_NAME = \"SeCreatePagefilePrivilege\";\n  public const string SE_CREATE_PERMANENT_NAME = \"SeCreatePermanentPrivilege\";\n  public const string SE_CREATE_SYMBOLIC_LINK_NAME = \"SeCreateSymbolicLinkPrivilege\";\n  public const string SE_CREATE_TOKEN_NAME = \"SeCreateTokenPrivilege\";\n  public const string SE_DEBUG_NAME = \"SeDebugPrivilege\";\n  public const string SE_ENABLE_DELEGATION_NAME = \"SeEnableDelegationPrivilege\";\n  public const string SE_IMPERSONATE_NAME = \"SeImpersonatePrivilege\";\n  public const string SE_INC_BASE_PRIORITY_NAME = \"SeIncreaseBasePriorityPrivilege\";\n  public const string SE_INCREASE_QUOTA_NAME = \"SeIncreaseQuotaPrivilege\";\n  public const string SE_INC_WORKING_SET_NAME = \"SeIncreaseWorkingSetPrivilege\";\n  public const string SE_LOAD_DRIVER_NAME = \"SeLoadDriverPrivilege\";\n  public const string SE_LOCK_MEMORY_NAME = \"SeLockMemoryPrivilege\";\n  public const string SE_MACHINE_ACCOUNT_NAME = \"SeMachineAccountPrivilege\";\n  public const string SE_MANAGE_VOLUME_NAME = \"SeManageVolumePrivilege\";\n  public const string SE_PROF_SINGLE_PROCESS_NAME = \"SeProfileSingleProcessPrivilege\";\n  public const string SE_RELABEL_NAME = \"SeRelabelPrivilege\";\n  public const string SE_REMOTE_SHUTDOWN_NAME = \"SeRemoteShutdownPrivilege\";\n  public const string SE_RESTORE_NAME = \"SeRestorePrivilege\";\n  public const string SE_SECURITY_NAME = \"SeSecurityPrivilege\";\n  public const string SE_SHUTDOWN_NAME = \"SeShutdownPrivilege\";\n  public const string SE_SYNC_AGENT_NAME = \"SeSyncAgentPrivilege\";\n  public const string SE_SYSTEM_ENVIRONMENT_NAME = \"SeSystemEnvironmentPrivilege\";\n  public const string SE_SYSTEM_PROFILE_NAME = \"SeSystemProfilePrivilege\";\n  public const string SE_SYSTEMTIME_NAME = \"SeSystemtimePrivilege\";\n  public const string SE_TAKE_OWNERSHIP_NAME = \"SeTakeOwnershipPrivilege\";\n  public const string SE_TCB_NAME = \"SeTcbPrivilege\";\n  public const string SE_TIME_ZONE_NAME = \"SeTimeZonePrivilege\";\n  public const string SE_TRUSTED_CREDMAN_ACCESS_NAME = \"SeTrustedCredManAccessPrivilege\";\n  public const string SE_UNDOCK_NAME = \"SeUndockPrivilege\";\n  public const string SE_UNSOLICITED_INPUT_NAME = \"SeUnsolicitedInputPrivilege\";       \n\n\n  public static bool AddPrivilege(string privilege)\n  {\n   try\n   {\n    bool retVal;\n    TokPriv1Luid tp;\n    IntPtr hproc = GetCurrentProcess();\n    IntPtr htok = IntPtr.Zero;\n    retVal = OpenProcessToken(hproc, TOKEN_ADJUST_PRIVILEGES | TOKEN_QUERY, ref htok);\n    tp.Count = 1;\n    tp.Luid = 0;\n    tp.Attr = SE_PRIVILEGE_ENABLED;\n    retVal = LookupPrivilegeValue(null, privilege, ref tp.Luid);\n    retVal = AdjustTokenPrivileges(htok, false, ref tp, 0, IntPtr.Zero, IntPtr.Zero);\n    return retVal;\n   }\n   catch (Exception ex)\n   {\n    throw ex;\n   }\n\n\n  }\n  public static bool RemovePrivilege(string privilege)\n  {\n   try\n   {\n    bool retVal;\n    TokPriv1Luid tp;\n    IntPtr hproc = GetCurrentProcess();\n    IntPtr htok = IntPtr.Zero;\n    retVal = OpenProcessToken(hproc, TOKEN_ADJUST_PRIVILEGES | TOKEN_QUERY, ref htok);\n    tp.Count = 1;\n    tp.Luid = 0;\n    tp.Attr = SE_PRIVILEGE_DISABLED;\n    retVal = LookupPrivilegeValue(null, privilege, ref tp.Luid);\n    retVal = AdjustTokenPrivileges(htok, false, ref tp, 0, IntPtr.Zero, IntPtr.Zero);\n    return retVal;\n   }\n   catch (Exception ex)\n   {\n    throw ex;\n   }\n\n\n  }\n}\n}\n\"@\n \n add-type $code\n \n $acl = Get-Acl $Path\n $acl.psbase.SetOwner($principal)\n $Ar = New-Object  system.security.accesscontrol.filesystemaccessrule(\"IIS_IUSRS\",\"FullControl\", \"Allow\")\n\n ## Check if Access already exists.\n #see http://cyrusbuilt.net/wordpress/?p=158\n if ($acl.Access | Where { $_.IdentityReference -eq $Principal}) {\n  $accessModification = New-Object System.Security.AccessControl.AccessControlModification\n  $accessModification.value__ = 2\n  $modification = $false\n  $acl.ModifyAccessRule($accessModification, $Ar, [ref]$modification) | Out-Null\n } else {\n  $acl.AddAccessRule($Ar)\n }\n\n [void][WSG.Utils.PermissionsSetter]::AddPrivilege([WSG.Utils.PermissionsSetter]::SE_RESTORE_NAME)\n set-acl -Path $Path -AclObject $acl\n [void][WSG.Utils.PermissionsSetter]::RemovePrivilege([WSG.Utils.PermissionsSetter]::SE_RESTORE_NAME)\n\n\nHow to register Asp.Net &amp; WCF in IIS?\n\n $pathToFramework = \"$env:windir\\Microsoft.NET\\Framework\"\n if (test-path \"$env:windir\\Microsoft.NET\\Framework64\")\n {\n  $pathToFramework = \"$env:windir\\Microsoft.NET\\Framework64\"\n }\n \n #start aspnet_regiis and ServiceModelReg\n $aspNet2 = Test-Path \"$pathToFramework\\v2.0.50727\\aspnet_regiis.exe\" -pathType leaf\n if (($aspNet2 -eq $true) -and ($aspNet2Reg -eq $false))\n {\n  Write-Host -ForegroundColor green \"`r`nInstall aspnet_regiis.exe v2.0.50727\"\n  &amp; \"$pathToFramework\\v2.0.50727\\aspnet_regiis.exe\" -i -enable\n }\n\n $ServModReg3 = Test-Path \"$pathToFramework\\v3.0\\Windows Communication Foundation\\ServiceModelReg.exe\" -pathType leaf\n if ($ServModReg3 -eq $true)\n {\n  Write-Host -ForegroundColor green \"`r`nInstall ServiceModelReg.exe v3.0\"\n  &amp; \"$pathToFramework\\v3.0\\Windows Communication Foundation\\ServiceModelReg.exe\" -iru\n }\n  \n $ServModReg4 = Test-Path \"$pathToFramework\\v4.0.30319\\ServiceModelReg.exe\" -pathType leaf\n if ($ServModReg4 -eq $true)\n {\n  Write-Host -ForegroundColor green \"`r`nInstall ServiceModelReg.exe v4.0.30319\"\n  &amp; \"$pathToFramework\\v4.0.30319\\ServiceModelReg.exe\" -ia -q -nologo\n }\n\n $AspNetRegIis4 = Test-Path \"$pathToFramework\\v4.0.30319\\aspnet_regiis.exe\" -pathType leaf\n if (($AspNetRegIis4 -eq $true) -and ($aspNet4Reg -eq $false))\n {\n  Write-Host -ForegroundColor green \"`r`nInstall aspnet_regiis.exe v4.0.30319\"\n  &amp; \"$pathToFramework\\v4.0.30319\\aspnet_regiis.exe\" -ir -enable\n }\n\n\nHow to enable windows features?\n\n #check the windows features\n $features = @((\"IIS-ASPNET\", \"unknown\"), (\"IIS-HttpCompressionDynamic\", \"unknown\"), (\"IIS-ManagementScriptingTools\", \"unknown\"), (\"IIS-IIS6ManagementCompatibility\", \"unknown\"), (\"IIS-Metabase\", \"unknown\"), (\"IIS-WMICompatibility\", \"unknown\"), (\"IIS-LegacyScripts\", \"unknown\"), (\"IIS-LegacySnapIn\", \"unknown\"))\n \n $dismPath = \"$env:windir\\System32\\Dism.exe\"\n if(test-path \"$env:windir\\Sysnative\\Dism.exe\")\n {\n  $dismPath = \"$env:windir\\Sysnative\\Dism.exe\"\n }\n \n Write-Host -ForegroundColor green \"`r`nGet windows features\"\n $res = &amp; \"$dismPath\" /online /Get-Features\n #take feature's states\n $writeNextStr = $false\n for ($i = 0; $i -lt $res.Count; $i++)\n {\n  $str = $res[$i]\n  foreach ($feature in $features)\n  {\n   if ($str.Contains($feature[0]))\n   {\n    $feature[1] = $res[$i+1]\n    break\n   }\n  }\n }\n \n #show results\n Write-Host -ForegroundColor green \"`r`nPlease see the states of features`r`n\"\n foreach($feature in $features)\n {\n  Write-Host -ForegroundColor yellow \"$feature\"\n }\n Write-Host -ForegroundColor green \"`r`n\"\n \n #enable features\n $needToRestart = $false\n Write-Host -ForegroundColor green \"Started to enable all features`r`n\"\n foreach($feature in $features)\n {\n  if ($feature[1] -ne \"State : Enabled\")\n  {\n   $needToRestart  = $true\n   $temp = $feature[0]\n   Write-Host -ForegroundColor green \"Try to enable $temp\"\n   &amp; \"$dismPath\" /online /Enable-Feature /FeatureName:$temp /NoRestart\n  }\n }\n\n\nHow to avoid exception \"The OS handles position is not what FileStream expected\"?\n\n#this code is for exception such as The OS handles position is not what FileStream expected\n#see http://www.leeholmes.com/blog/2008/07/30/workaround-the-os-handles-position-is-not-what-filestream-expected/\n$bindingFlags = [Reflection.BindingFlags] Instance,NonPublic,GetField\n$objectRef = $host.GetType().GetField(externalHostRef, $bindingFlags).GetValue($host)\n$bindingFlags = [Reflection.BindingFlags] Instance,NonPublic,GetProperty\n$consoleHost = $objectRef.GetType().GetProperty(Value, $bindingFlags).GetValue($objectRef, @())\n[void] $consoleHost.GetType().GetProperty(IsStandardOutputRedirected, $bindingFlags).GetValue($consoleHost, @())\n$bindingFlags = [Reflection.BindingFlags] Instance,NonPublic,GetField\n$field = $consoleHost.GetType().GetField(standardOutputWriter, $bindingFlags)\n$field.SetValue($consoleHost, [Console]::Out)\n$field2 = $consoleHost.GetType().GetField(standardErrorWriter, $bindingFlags)\n$field2.SetValue($consoleHost, [Console]::Out)\n\n\nHow to load module?\n\nImport-Module WebAdministration\n\n\nHow to load another script file?\n\n#load external functions\n. (Join-Path $curFolder \\Functions\\DevSetupFunctions.ps1)\n","id":"https://eapyl.github.io/powershell-how-to/","title":"PowerShell How to"},"https://eapyl.github.io/radio-on-windows-iot-via-telegram/":{"body":"Radio on Windows IOT via Telegram Bot\nThis article describes and share a source code of application to play radio using Windows IOT. It is possible to control application using Telegram Bot.\n\nResources:\n\nRasperry PI 3 with installed Windows IOT;\nPortable JBL Charge 3;\n\nDeveloped radio application is background application. It consists from 2 parts:\n\nTelegram Bot to control radio. Supported commands:\n\n\n/start is to start play;\n/stop is to stop application;\n/pause is to pause playing;\n/stations is to show list of radio stations;\n/up is to increase volume;\n/down is to decrease volume;\n\n\nRadio player is to play radio. It based on Windows-IoT-Core-Ignite.\n\nExample of the bot in Telegram:\n\nThe source code is on GitHub.\nThanks.\n","id":"https://eapyl.github.io/radio-on-windows-iot-via-telegram/","title":"Radio on Windows IOT via Telegram Bot"},"https://eapyl.github.io/radio/":{"body":"Do you like listen radio? Have you installed dotnet core locally? So there is a nice dotnet tool \"plr\" to listen radio!\n\nTo install:\ndotnet tool install --global plr\n\nListen\n\nusing powershell:\n\nstart radio\n\n\nusing cmd\n\nradio\n\nCommon way to start listening the first radio from the list:\n-l\n-p 1\n\nTo see supported commands:\n-h\n--help\n\nExample:\n\nThe source code is on GitHub.\nAll descriptions of stations are hosted at GitHub.\nList task is todo.\nThanks.\n","id":"https://eapyl.github.io/radio/","title":"Dotnet global tool, radio player"},"https://eapyl.github.io/remote-mssql-to-local-server/":{"body":"I faced with one issue how to automatically download and restore databases from remote server to my local MSSQL server. It sounds like very generic task so I tried to find a solution in Internet without success. So there is a small console application which does the next things:\n\nBackup selected databases on remote server;\nCopy backups to local folder;\nRestore copied databases to local MSSQL;\nChange the owner of databases to current user;\n\n\nA small snippet with implementation is below.\n/*\nYou need to add next NuGet packages:\n\"Microsoft.Extensions.Configuration\": \"2.0.0\",\n\"Microsoft.Extensions.Configuration.FileExtensions\": \"2.0.0\",\n\"Microsoft.Extensions.Configuration.Json\": \"2.0.0\",\n\"System.Data.Common\": \"4.3.0\",\n\"System.Data.SqlClient\": \"4.4.2\",\n\"System.Runtime\": \"4.3.0\"\n*/\nclass Program\n{\n    private static IConfigurationRoot Configuration = new ConfigurationBuilder()\n            .SetBasePath(Directory.GetCurrentDirectory())\n            .AddJsonFile(\"appsettings.json\").Build();\n\n    private static string[] dbs { get; } = Configuration.GetSection(\"dbs\")\n        .GetChildren().Select(x=&gt;x.Value).ToArray();\n\n    private static string remoteServer { get; } = Configuration[\"connectionStrings:remoteServer\"];\n    private static string localServer { get; } = Configuration[\"connectionStrings:localServer\"];\n    private static string currentUser { get; } = Configuration[\"currentUser\"];\n    private static string remoteServerPathWithBackups { get; } = Configuration[\"remoteServerPathWithBackups\"];\n    private static string serverPathWithBackups { get; } = Configuration[\"serverPathWithBackups\"];\n    private static string userNameToLogInToServer { get; } = Configuration[\"userNameToLogInToServer\"];\n    private static string passwordToLogInToServer { get; } = Configuration[\"passwordToLogInToServer\"];\n    private static string localPathToCopyBackups { get; } = Configuration[\"localPathToCopyBackups\"];\n    private static string backupFileName = Configuration[\"backupFileName\"];\n\n    private const string changeOwnerOfDb = @\"\nUSE {0}\nEXEC sp_changedbowner '{1}'\";\n\n    private const string changeToSingleUser = @\"\nALTER DATABASE[{0}] SET Single_User WITH Rollback Immediate\";\n\n    private const string changeToMultiUser = @\"\nALTER DATABASE [{0}] SET Multi_User\";\n\n    private const string AddNetPath = \"NET USE {0} {1} /USER:{2}\";\n    private const string DeleteNetPath = \"NET USE {0} /DELETE\";\n    private const string CopyReport = \"robocopy {0} {1} {2}\";\n\n    private const string restoreDb = @\"\nRESTORE DATABASE {0} FROM DISK = '{1}' WITH REPLACE, RECOVERY;\";\n    private const string backupDb = @\"\nBACKUP DATABASE {0} TO DISK='{1}' WITH INIT, COPY_ONLY, FORMAT, COMPRESSION;\";\n\n    static void Main(string[] args)\n    {\n        foreach (var db in dbs)\n        {\n            Console.WriteLine($\"Backup {db}\");\n            BackupTargetDatabase(remoteServer, db);\n\n            Console.WriteLine($\"Copy created backup to local - {db}\");\n            CopyBackupToLocal(db);\n\n            Console.WriteLine($\"Change to single user mode - {db}\");\n            ChangeToSingleUser(localServer, db);\n\n            Console.WriteLine($\"Restore db locally - {db}\");\n            RestoreTargetDatabase(localServer, db);\n\n            Console.WriteLine($\"Change the owner - {db}\");\n            ChangeOwnerOfDb(localServer, db);\n\n            Console.WriteLine($\"Reset to multi user mode - {db}\");\n            ChangeToMultiUser(localServer, db);\n        }\n    }\n\n    private static void ChangeToMultiUser(string localServer, string db) =&gt;\n        ExecuteSqlCommand(localServer, string.Format(changeToMultiUser, db));\n\n    private static void ChangeToSingleUser(string localServer, string db) =&gt;\n        ExecuteSqlCommand(localServer, string.Format(changeToSingleUser, db));\n\n    private static void ChangeOwnerOfDb(string localServer, string db) =&gt;\n        ExecuteSqlCommand(localServer, string.Format(changeOwnerOfDb, db, currentUser));\n\n    private static void CopyBackupToLocal(string database)\n    {\n        ExecuteCommand(string.Format(AddNetPath, remoteServerPathWithBackups, passwordToLogInToServer, userNameToLogInToServer));\n        ExecuteCommand(string.Format(CopyReport, remoteServerPathWithBackups, localPathToCopyBackups, string.Format(backupFileName, database)));\n        ExecuteCommand(string.Format(DeleteNetPath, remoteServerPathWithBackups));\n    }\n\n    private static void ExecuteCommand(string command)\n    {\n        var processInfo = new ProcessStartInfo(\"cmd.exe\", \"/c \" + command);\n        processInfo.CreateNoWindow = true;\n        processInfo.UseShellExecute = false;\n        processInfo.RedirectStandardError = true;\n        processInfo.RedirectStandardOutput = true;\n\n        Console.WriteLine(command);\n\n        var process = Process.Start(processInfo);\n\n        process.OutputDataReceived += (object sender, DataReceivedEventArgs e) =&gt;\n            Console.WriteLine($\"{e.Data}\");\n        process.BeginOutputReadLine();\n\n        process.ErrorDataReceived += (object sender, DataReceivedEventArgs e) =&gt;\n            Console.WriteLine($\"{e.Data}\");\n        process.BeginErrorReadLine();\n\n        process.WaitForExit();\n        if (process.ExitCode &gt; 0)\n            Console.WriteLine($\"Error {nameof(process.ExitCode)}: {process.ExitCode}\");\n        process.Close();\n    }\n\n    private static void RestoreTargetDatabase(string connectionString, string database) =&gt;\n        ExecuteSqlCommand(connectionString, string.Format(restoreDb, database, Path.Combine(localPathToCopyBackups, string.Format(backupFileName, database))));\n\n    private static void BackupTargetDatabase(string connectionString, string database) =&gt;\n        ExecuteSqlCommand(connectionString, string.Format(backupDb, database, Path.Combine(serverPathWithBackups, string.Format(backupFileName, database))));\n\n    private static void ExecuteSqlCommand(string connectionString, string query)\n    {\n        using (var connection = new SqlConnection(connectionString))\n        {\n            using (var command = new SqlCommand(query, connection))\n            {\n                connection.Open();\n                command.CommandTimeout = 300;\n                command.ExecuteNonQuery();\n            }\n        }\n    }\n}\n\nThanks.\n","id":"https://eapyl.github.io/remote-mssql-to-local-server/","title":"Copy remote MSSQL DB to local server"},"https://eapyl.github.io/replace-physical-path-of-web-sites-in-iis7/":{"body":"param([String]$numb)\n\n[Void][Reflection.Assembly]::LoadWithPartialName(\"Microsoft.Web.Administration\")\n\n$siteName = \"graph.vrpinc.com\"\n##$serverIP = \"your ip address\"\n$newPath = \"D:\\Projects\\gmp\"+$numb+\"\\GMP.WebSite\"\n\n$serverManager = New-Object Microsoft.Web.Administration.ServerManager\n## $serverManager = [Microsoft.Web.Administration.ServerManager]::OpenRemote($serverIP)\n$site = $serverManager.Sites | where { $_.Name -eq $siteName }\n$rootApp = $site.Applications | where { $_.Path -eq \"/\" }\n$rootVdir = $rootApp.VirtualDirectories | where { $_.Path -eq \"/\" }\n$rootVdir.PhysicalPath = $newPath\n$serverManager.CommitChanges()\n\n$siteName = \"gmp3.vrpinc.com\"\n$newPath = \"D:\\Projects\\gmp\"+$numb+\"\\GMP.MvcWebSite\"\n\n$serverManager = New-Object Microsoft.Web.Administration.ServerManager\n## $serverManager = [Microsoft.Web.Administration.ServerManager]::OpenRemote($serverIP)\n$site = $serverManager.Sites | where { $_.Name -eq $siteName }\n$rootApp = $site.Applications | where { $_.Path -eq \"/\" }\n$rootVdir = $rootApp.VirtualDirectories | where { $_.Path -eq \"/\" }\n$rootVdir.PhysicalPath = $newPath\n$serverManager.CommitChanges()\n\n$siteName = \"GMPServices\"\n$newPath = \"D:\\Projects\\gmp\"+$numb+\"\\GMP.Services\"\n\n$serverManager = New-Object Microsoft.Web.Administration.ServerManager\n## $serverManager = [Microsoft.Web.Administration.ServerManager]::OpenRemote($serverIP)\n$site = $serverManager.Sites | where { $_.Name -eq $siteName }\n$rootApp = $site.Applications | where { $_.Path -eq \"/\" }\n$rootVdir = $rootApp.VirtualDirectories | where { $_.Path -eq \"/\" }\n$rootVdir.PhysicalPath = $newPath\n$serverManager.CommitChanges()\n\nBat file to call PowerShell file\n@echo off\n\nset /p delBuild=Enter the number of gmp project?\npowershell -noprofile Set-ExecutionPolicy Unrestricted\npowershell .\\setUpSite.ps1 -numb %delBuild%\n\nOne variable to set current version of projects!\nThanks!\n","id":"https://eapyl.github.io/replace-physical-path-of-web-sites-in-iis7/","title":"Replace physical path of web sites in IIS7"},"https://eapyl.github.io/response-without-root-element/":{"body":"Write WCF web-service that accepts SOAP 1.2 and SOAP 1.1 requests. Service should expose 1 operation (let it be \"GetResponse_1\") with the following structure (just an example, please combine schema for the service):\n\n&lt;GetResponse_Request_1&gt;\n    &lt;element1&gt;text1&lt;/element1&gt;&lt;!-- at least 1 \"element1\" --&gt;\n    &lt;element1&gt;text2&lt;/element1&gt;\n    &lt;element1&gt;text3&lt;/element1&gt;\n    &lt;element2&gt;textn&lt;/element2&gt;&lt;!-- at least 1 \"element2\" --&gt;\n    &lt;element2&gt;textn+1&lt;/element2&gt;\n    &lt;element2&gt;textn+2&lt;/element2&gt;     \n&lt;/GetResponse_Request_1&gt;\n\nResponse should contain \"planed\" element1 and element2 sets, just comma separated values:\n&lt;GetResponse_Response_1&gt;\n    &lt;element1_plane&gt;text1, text2, text3&lt;/element1&gt;\n    &lt;element2_plane&gt;textn, textn+1, textn+2&lt;/element2&gt;\n&lt;/GetResponse_Response_1&gt;\n","id":"https://eapyl.github.io/response-without-root-element/","title":"Response without root element"},"https://eapyl.github.io/restore-influxdb-in-docker/":{"body":"It is not easy to restore influxdb in an official container. Unfortunately it is not possible directly. You need to restore db out of a container and mount restored db to the container.\n\n# Restoring a backup requires that influxd is stopped (note that stopping the process kills the container).\ndocker stop \"$CONTAINER_ID\"\n\n# Run the restore command in an ephemeral container.\n# This affects the previously mounted volume mapped to /var/lib/influxdb.\ndocker run --rm \\\n--entrypoint /bin/bash \\\n-v \"$INFLUXDIR\":/var/lib/influxdb \\\n-v \"$BACKUPDIR\":/backups \\\ninfluxdb:1.3 \\\n-c \"influxd restore -metadir /var/lib/influxdb/meta -datadir /var/lib/influxdb/data -database foo /backups/foo.backup\"\n\n# Start the container just like before, and get the new container ID.\nCONTAINER_ID=$(docker run --rm \\\n--detach \\\n-v \"$INFLUXDIR\":/var/lib/influxdb \\\n-v \"$BACKUPDIR\":/backups \\\n-p 8086 \\\ninfluxdb:1.3\n)\n\nMore info here.\nThanks.\n","id":"https://eapyl.github.io/restore-influxdb-in-docker/","title":"Restore InfluxDB in Docker"},"https://eapyl.github.io/sd-card-raspbian/":{"body":"Steps:\n\nDownload lates version of OS from here;\nFollow instructions from here.\nTo enable ssh need to create empty /boot/ssh file;\nTo turn on WiFi need to create /boot/wpa_supplicant.conf:\n\nctrl_interface=DIR=/var/run/wpa_supplicant GROUP=netdev\nupdate_config=1\ncountry=AU\n\nnetwork={\n    ssid=\"ESSID\"\n    psk=\"Your_wifi_password\"\n}\n\n\nPut SD card to Raspberry Pi.\n\nThanks.\n","id":"https://eapyl.github.io/sd-card-raspbian/","title":"Prepare SD card for Raspbian"},"https://eapyl.github.io/show-information-about-types-in-tooltip/":{"body":"The value of a point is the sum of values of types ('one', 'two').\nLink - 26 December, 2014\nAdditional info\n\nThe code:\n$(function () {\n    $('#container').highcharts({\n        chart: {\n            type: 'column'\n        },\n \n        tooltip: {\n            formatter: function () {\n                var typeInf = '';\n                var types = this.point.Types;\n                $.each(types, function (index) {\n                    typeInf += '&lt;b&gt;' + types[index][0] + '&lt;/b&gt; ' + types[index][1] + '&lt;br/&gt;';\n                });\n \n                return 'The value for &lt;b&gt;' + this.x +\n                    '&lt;/b&gt; is &lt;b&gt;' + this.y + '&lt;/b&gt;&lt;br/&gt;' + typeInf;\n            }\n        },\n \n        xAxis: {\n            categories: ['Green', 'Pink']\n        },\n \n        series: [{\n            data: [{\n                name: 'Point 1',\n                Types: [[\"one\", 1], [\"two\", 1]],\n                color: '#00FF00',\n                y: 2\n            }, {\n                name: 'Point 2',\n                Types: [[\"one\", 2], [\"two\", 3]],\n                color: '#FF00FF',\n                y: 5\n            }]\n        }]\n    });\n});\n","id":"https://eapyl.github.io/show-information-about-types-in-tooltip/","title":"Show information about types in tooltip"},"https://eapyl.github.io/simple-question-to-check-understanding-of-multithreading/":{"body":"How to do planning of two threads so none of them can leave a circle (X is global value and default value is 0)?\nwhile (X == 0)\n{\n    X = 1 - X;\n}\n","id":"https://eapyl.github.io/simple-question-to-check-understanding-of-multithreading/","title":"Simple question to check understanding of multithreading"},"https://eapyl.github.io/simple-question-to-check-understanding-of-recursion-in-net/":{"body":"There is the next code:\npublic static void Main(string[] args) {\n    Console.WriteLine(Test());\n}\n\npublic static int Test(int index = 0) {\n    if (index &gt; 10) return 0;\n    try {\n        for (var i=0; i&lt; 10; i++) {\n            index++;\n        }\n    }\n    catch {\n        Console.Write(\"Error\");\n    }\n    for (var j = 1; j &lt; 10; j++)\n        index += Test(index);\n    return index;\n}\n\n\nIs it working? What is the output?\n","id":"https://eapyl.github.io/simple-question-to-check-understanding-of-recursion-in-net/","title":"Simple question to check understanding of recursion in .NET"},"https://eapyl.github.io/simplest-syslog-server/":{"body":"I am working on onside project where we have more than 5 docker containers. Previously we used just serilog to do our logging in all our containers. So each project had his own logging mechanism. Finally we decided to centralize our logging system ans start using docker logs. There are a lot of solutions using clouds (e.g. loggly) or quite complex systems to grab, analyze and show your logs (like kafka, kibana). But we wanted to save our logs to simple txt files without any additional complex stuff.\n\nThere are nice project which allows automatically read docker container logs and push them to one syslog server - logspout.\nWe tried to find simple syslog server without success. So there is a small syslog server written in dotnet core. I used serilog to write logs to files (Rolling File).\nSo docker-compose configuration looks like:\n  #another containers\n  logspout:\n    image: gliderlabs/logspout\n    command: syslog+tcp://logcollector:5000\n    volumes:\n      - /var/run/docker.sock:/var/run/docker.sock\n    depends_on:\n      - logcollector\n  logcollector:\n    image: eapyl/syslog-collector\n    volumes: \n      - $PWD/../logs:/log/logs\n\nAfter that logs from all our containers are in logs folder! Very simple and easy!\nPlease find docker image here.\nP.S. We started to write log message to stdout or stderr using serilog. So it was just small configuration change in all our projects to use Serilog.Literate instead of Serilog.RollingFile .\nThanks!\n","id":"https://eapyl.github.io/simplest-syslog-server/","title":"Simplest syslog server for rfc5424 (TCP)"},"https://eapyl.github.io/smo-scripter-create-script-of-db/":{"body":"It is possible to create script of MSSQL using SMO: (link)\n\nprivate static void Main(string[] args)\n{\n    var arguments = args.Select(x =&gt; x.ToLower()).ToList();\n    if (arguments.Count == 0 || arguments.Contains(\"-help\"))\n    {\n        Console.WriteLine(\"-d - Database Name\");\n        Console.WriteLine(\"-i - Output Sql File Name\");\n        Console.WriteLine(\"-s - Server Instance\");\n        Console.WriteLine(\"-u - User Name\");\n        Console.WriteLine(\"-p - Password\");\n        Console.WriteLine(\"It should be 'tables.txt' file in folder with names of tables to script; if it does not exist the application scripts all tables with prefix 'GMP_'\");\n        Console.ReadKey();\n    }\n    else if (arguments.Count &gt; 1 &amp;&amp; arguments.Contains(\"-d\") &amp;&amp; args.Contains(\"-i\"))\n    {\n        if (arguments.Count &lt;= arguments.IndexOf(\"-d\") + 1)\n        {\n            throw new ArgumentException(\"Database Name\");\n        }\n        if (arguments.Count &lt;= argumSMO Scripter. Create script of DBents.IndexOf(\"-i\") + 1)\n        {\n            throw new ArgumentException(\"Output Sql File Name\");\n        }\n        var dbName = arguments[arguments.IndexOf(\"-d\") + 1];\n        var outputFileName = arguments[arguments.IndexOf(\"-i\") + 1];\n        var srv = new Server();\n        if (arguments.Contains(\"-s\") &amp;&amp; args.Contains(\"-u\") &amp;&amp; arguments.Contains(\"-p\"))\n        {\n            if (arguments.Count &lt;= arguments.IndexOf(\"-s\") + 1)\n            {\n                throw new ArgumentException(\"Server Instance\");\n            }\n            if (arguments.Count &lt;= arguments.IndexOf(\"-u\") + 1)\n            {\n                throw new ArgumentException(\"User Name\");\n            }\n            if (arguments.Count &lt;= arguments.IndexOf(\"-p\") + 1)\n            {\n                throw new ArgumentException(\"Password\");\n            }\n            var connection = new ServerConnection(arguments[arguments.IndexOf(\"-s\") + 1], arguments[arguments.IndexOf(\"-u\") + 1], arguments[arguments.IndexOf(\"-p\") + 1]);\n            srv = new Server(connection);\n        }\n        // read names of tables\n        var tablesFromFile = new List&lt;string&gt;();\n        if (File.Exists(\"tables.txt\"))\n        {\n            using (var file = File.OpenText(\"tables.txt\"))\n            {\n                while (file.Peek() &gt; 0)\n                {\n                    tablesFromFile.Add(file.ReadLine());\n                }\n            }\n        }\n        Database db = srv.Databases[dbName];\n        var dropKeys = new Scripter(srv) {Options = {ScriptDrops = true, IncludeIfNotExists = true, DriForeignKeys = true}};\n        var listOfScripts = new List&lt;Scripter&gt;\n                            {\n                                new Scripter(srv) {Options = {ScriptDrops = true, IncludeIfNotExists =true, DriAllKeys = false}},\n                                new Scripter(srv) {Options = {ScriptDrops = false, ScriptSchema = true, WithDependencies = false, DriIndexes = true, DriClustered = true, IncludeIfNotExists = true, DriAllKeys = false}},\n                                new Scripter(srv) {Options = {ScriptDrops = false, ScriptSchema = true, DriDefaults = false, DriIndexes = false, DriPrimaryKey = false, DriClustered = false, Default = false, DriAll =false, DriForeignKeys = true, IncludeIfNotExists = true, DriAllKeys = false}},\n                                new Scripter(srv) {Options = {DriIndexes = true, Default = true, DriDefaults = true, DriClustered = false, IncludeIfNotExists = true, DriAll = true, DriAllConstraints = true, DriAllKeys = true, SchemaQualify = true, SchemaQualifyForeignKeysReferences = true, NoCollation = true}}\n                            };\n        using (var file = File.CreateText(outputFileName))\n        {\n            foreach (Table tb in db.Tables)\n            {\n                if ((tablesFromFile.Count &gt; 0 &amp;&amp; tablesFromFile.Contains(tb.Name) || (tablesFromFile.Count== 0 &amp;&amp; tb.Name.StartsWith(\"GMP_\"))))\n                {\n                    if (tb.IsSystemObject == false)\n                    {\n                        foreach (ForeignKey foreignKey in tb.ForeignKeys)\n                        {\n                            System.Collections.Specialized.StringCollection scd = dropKeys.Script(new[] {foreignKey.Urn });\n                            foreach (string st in scd)\n                            {\n                                file.WriteLine(st);\n                                file.WriteLine(\"GO\");\n                            }\n                        }\n                        file.WriteLine();\n                    }\n                }\n            }\n            foreach (var script in listOfScripts)\n            {\n                foreach (Table tb in db.Tables)\n                {\n                    if ((tablesFromFile.Count &gt; 0 &amp;&amp; tablesFromFile.Contains(tb.Name) ||(tablesFromFile.Count == 0 &amp;&amp; tb.Name.StartsWith(\"GMP_\"))))\n                    {\n                        if (tb.IsSystemObject == false)\n                        {\n                            System.Collections.Specialized.StringCollection scd = script.Script(new[] {tb.Urn });\n                            foreach (string st in scd)\n                            {\n                                file.WriteLine(st);\n                                file.WriteLine(\"GO\");\n                            }\n                            file.WriteLine();\n                        }\n                    }\n                }\n            }\n        }\n    }\n}\n","id":"https://eapyl.github.io/smo-scripter-create-script-of-db/","title":"SMO Scripter. Create script of DB"},"https://eapyl.github.io/sniffer-of-tcp-packets/":{"body":" :   ,    ,    tcp- (,    html-).  ,  tcp-      .    Sniffer,   WinPcap   .\n\n  VS2008 SharkTrace.\n!  SharpPcap     .\n  ,            . \n     SharpPcap,         WinPcap (Sharppcap).\n          ,  ,       tcp-.\n   tcp-   http://www.firewall.cx. \n///&lt;summary&gt;\n///class for connection\n///&lt;/summary&gt;\ninternal class Connection\n{\n    public long ClientAddress; // client initiating the connection\n    public int ClientPort;\n    public long HostAddress; // host receiving the connection\n    public int HostPort;\n    public long ClientSyn; // starting syn sent from client\n    public long HostSyn; // starting syn sent from host;\n    public long NextClientSeq; // this must be in SequenceNumber field of TCP packet if it is from client\n    public long NextHostSeq; // this must be in SequenceNumber field of TCP packet if it is from host\n    public bool HostClosed;\n    public bool ClientClosed;\n    public long TimeIdentifier;\n    public bool ThreeWayCompleted = false; // three way connection is completed\n \n    // Fragments , used when we get newer packets that expected.\n    // so we need to wait for expected before adding them.\n    public SortedDictionary&lt;long, TcpPacket&gt; HostFragments = new SortedDictionary&lt;long, TcpPacket&gt;();\n    public SortedDictionary&lt;long, TcpPacket&gt; ClientFragments = new SortedDictionary&lt;long, TcpPacket&gt;();\n \n    // returns client ip:client port as a string\n    public string GetClientAddressPort()\n    {\n        return string.Format(\"{0}:{1}\", new IPAddress(ClientAddress).ToString(), ClientPort);\n    }\n \n    // returns host ip:host port as a string\n    public string GetHostAddressPort()\n    {\n        return string.Format(\"{0}:{1}\", new IPAddress(HostAddress).ToString(), HostPort);\n    }\n \n    // packet is from host\n    public bool IsFromHost(TcpPacket tcp)\n    {\n        return ClientAddress == ((IpPacket)tcp.ParentPacket).DestinationAddress.Address &amp;&amp;\n        ClientPort == tcp.DestinationPort &amp;&amp;\n        HostAddress == ((IpPacket)tcp.ParentPacket).SourceAddress.Address &amp;&amp;\n        HostPort == tcp.SourcePort;\n    }\n \n    // packet is from client\n    public bool IsFromClient(TcpPacket tcp)\n    {\n        return ClientAddress == ((IpPacket)tcp.ParentPacket).SourceAddress.Address &amp;&amp;\n        ClientPort == tcp.SourcePort &amp;&amp;\n        HostAddress == ((IpPacket)tcp.ParentPacket).DestinationAddress.Address &amp;&amp;\n        HostPort == tcp.DestinationPort;\n    }\n \n    public Connection(long clientAddress, int clientPort, long hostAddress, int hostPort, long clientSyn)\n    {\n        this.ClientAddress = clientAddress;\n        this.ClientPort = clientPort;\n        this.HostAddress = hostAddress;\n        this.HostPort = hostPort;\n        this.ClientSyn = clientSyn;\n    }\n}\n\n      .        (   )            (    wikipedia.org).     ,      .  ,   \"\"    (payload data).\n  TCP  wikipedia.org.\n RunSniffer  StopSniffer -     .  AssemblePacket    tcp-,     ,  \"\"  .   - ,   -      .        \"\"   (AddHostData  AddClientData) \n/// &lt;summary&gt;\n/// Main class for sniffering\n/// &lt;/summary&gt;\n/// &lt;remarks&gt;\n/// 1. I see that there is new version of SharpPcap library with new interface (29/11/2011)\n/// So i just try to update some useful information about this class\n/// \n/// 2. I believe that SynchronizatedConnection class is just \n/// class SynchronizatedConnection : Connection\n/// {\n///     private object syncObject = new object();\n///     \n///     public Synchro {get {return syncObject;}}\n/// }\n/// \n/// 3. Coordinator is class with constants.\n/// &lt;/remarks&gt;\ninternal abstract class Sniffer \n{\n    private Timer timer;\n    private object synchronizationObjectForConnection = new object();\n    private List&lt;SynchronizatedConnection&gt; Connections = new List&lt;SynchronizatedConnection&gt;();\n    private LibPcapLiveDevice _device;\n    private readonly List&lt;System.Net.IPAddress&gt; _hosts;\n \n    // when connected\n    public abstract void Connected(Object conn);\n    // when disconnected\n    public abstract void Disconnected(Object conn);\n    public abstract void AddHostData(byte[] data, string host);\n    public abstract void AddClientData(byte[] data, string client);\n \n    private void ClearConnections(object source)\n    {\n        //sometimes purely the collection, just in case\n        lock (synchronizationObjectForConnection)\n        {\n            foreach (var key in Connections.Where(k =&gt; (DateTime.Now.ToFileTimeUtc() - k.TimeIdentifier) &gt; 600000000 * Coordinator.Config.HowLongWeSaveTransaction.TotalMinutes).ToList())\n            {\n                Connections.Remove(key);\n            }\n        }\n    }\n \n    /// &lt;summary&gt;\n    /// Create the exemplare of the class\n    /// &lt;/summary&gt;\n    public Sniffer(List&lt;System.Net.IPAddress&gt; hosts)\n    {\n        timer = new Timer(ClearConnections, null, Coordinator.Config.HowLongWeSaveTransaction, Coordinator.Config.HowLongWeSaveTransaction);\n        _hosts = hosts;\n    }\n \n    /// &lt;summary&gt;\n    /// Start the tracing\n    /// &lt;/summary&gt;\n    /// &lt;param name=\"filter\"&gt;See http://www.cs.ucr.edu/~marios/ethereal-tcpdump.pdf &lt;/param&gt;\n    public void RunSniffer(string filter)\n    {\n        var devices = LibPcapLiveDeviceList.Instance;\n        //\n        _device = devices[Coordinator.Config.ListeningInterface];\n        //Register our handler function to the 'packet arrival' event\n        _device.OnPacketArrival += new PacketArrivalEventHandler(device_OnPacketArrival);\n        //Open the device for capturing\n        int readTimeoutMilliseconds = 1000;\n        _device.Open(DeviceMode.Normal, readTimeoutMilliseconds);\n        // tcpdump filter to capture only TCP/IP packets\n        _device.Filter = filter;\n        // Start capture packets\n        _device.StartCapture();\n    }\n \n    /// &lt;summary&gt;\n    /// Stop the tracing\n    /// &lt;/summary&gt;\n    public void StopSniffer()\n    {\n        _device.StopCapture();\n        _device.Close();\n    }\n \n    /// &lt;summary&gt;\n    /// Catch the packet\n    /// &lt;/summary&gt;\n    /// &lt;param name=\"sender\"&gt;&lt;/param&gt;\n    /// &lt;param name=\"e\"&gt;&lt;/param&gt;\n    private void device_OnPacketArrival(object sender, CaptureEventArgs e)\n    {\n        try\n        {\n            // try to get TCP packet from Ip packet\n            var packet = PacketDotNet.Packet.ParsePacket(e.Packet.LinkLayerType, e.Packet.Data);\n            if (packet is PacketDotNet.EthernetPacket)\n            {\n                var eth = ((PacketDotNet.EthernetPacket)packet);\n                var ip = PacketDotNet.IpPacket.GetEncapsulated(packet);\n                if (ip != null)\n                {\n                    var tcp = PacketDotNet.TcpPacket.GetEncapsulated(packet);\n                    if (tcp != null)\n                    {\n                        AssemblePacket(tcp);\n                    }\n                }\n            }\n        }\n \n        // sometimes converting doesn't work - don't worry about it\n        catch (InvalidOperationException ex)\n        {\n        }\n    }\n \n    /// &lt;summary&gt;\n    /// Parse TCP packet\n    /// &lt;/summary&gt;\n    /// &lt;param name=\"tcp\"&gt;TCP packet&lt;/param&gt;\n    privDescription. There are modules that have the input and output parameters (type and number of parameters may be different). The goal is to select some first modules that have no input parameters, then the modules whose inputs are the output parameters of the previously selected modules and so on. Until the last module will not output parameters.\n\nThe database stores all displayed modules and displays of all parameters where the parameter mapping to the mapping of modules is many-to-one.\nInitially, we choose to do all the settings using a simple SQL query.ate void AssemblePacket(TcpPacket tcp)\n    {\n        // pass the packets that :\n        // 1. tcp.Syn &amp;&amp; tcp.PayloadData.Length == 0 - sent for synchronization\n        // 2. tcp.PayloadData.Length &gt; 0 - no useful data in packet\n        // 3. tcp.Fin || tcp.Rst - connection is finished or reseted\n        if (!(tcp.Syn &amp;&amp; tcp.PayloadData.Length == 0) &amp;&amp; (tcp.PayloadData.Length &gt; 0) &amp;&amp; !(tcp.Fin || tcp.Rst))\n        {\n            SynchronizatedConnection conn;\n            // try to find connection in collection\n            bool? res = IsTcpFromClient(tcp, out conn);\n                \n            if (res == null)\n            {\n                // connection is new\n                SynchronizatedConnection con;\n                if (_hosts.Contains(((IpPacket)tcp.ParentPacket).SourceAddress))\n                {\n                    // packet from host to client\n                    conn = new SynchronizatedConnection(((IpPacket)tcp.ParentPacket).DestinationAddress.Address,\n                    tcp.DestinationPort, ((IpPacket)tcp.ParentPacket).SourceAddress.Address, tcp.SourcePort, tcp.SequenceNumber);\n                    conn.ClientSyn = tcp.AcknowledgmentNumber;\n                    conn.HostSyn = tcp.SequenceNumber;\n                    conn.NextClientSeq = tcp.AcknowledgmentNumber;\n                    conn.NextHostSeq = tcp.SequenceNumber;\n                    res = false;\n                }\n        Description. There are modules that have the input and output parameters (type and number of parameters may be different). The goal is to select some first modules that have no input parameters, then the modules whose inputs are the output parameters of the previously selected modules and so on. Until the last module will not output parameters.\n\nThe database stores all displayed modules and displays of all parameters where the parameter mapping to the mapping of modules is many-to-one.\nInitially, we choose to do all the settings using a simple SQL query.        else\n                {\n                    // packet from host to client\n                    conn = new SynchronizatedConnection(((IpPacket)tcp.ParentPacket).SourceAddress.Address,\n                    tcp.SourcePort, ((IpPacket)tcp.ParentPacket).DestinationAddress.Address, tcp.DestinationPort, tcp.SequenceNumber);\n                    conn.ClientSyn = tcp.SequenceNumber;\n                    conn.HostSyn = tcp.AcknowledgmentNumber;\n                    conn.NextHostSeq = tcp.AcknowledgmentNumber;\n                    conn.NextClientSeq = tcp.SequenceNumber;\n                    res = true;\n                }\n                conn.TimeIdentifier = DateTime.Now.ToFileTimeUtc();\n                conn.ThreeWayCompleted = true;\n                lock (synchronizationObjectForConnection)\n                {\n                    Connections.Add(conn);\n                }\n            }\n            if (res == true)\n            {\n                // from client\n                lock (conn.Synchro)\n                {\n                    if (tcp.SequenceNumber &lt; conn.NextClientSeq)\n                    // old packet\n                    {\n                        // just drop these for now\n                        return;\n                    }\n                    if (tcp.SequenceNumber &gt; conn.NextClientSeq)\n                    // out of order data\n                    {\n                        if (!conn.ClientFragments.ContainsKey(tcp.SequenceNumber))\n                        {\n                            conn.ClientFragments.Add(tcp.SequenceNumber, tcp);\n                        }\n                        else\n                        // expect new data to be better?\n                        {\n                            conn.ClientFragments[tcp.SequenceNumber] = tcp;\n                        }\n                    }\n                    else\n                    {\n                        while (tcp.SequenceNumber == conn.NextClientSeq)\n                        {\n                            conn.ClientFragments.Remove(tcp.SequenceNumber);\n                            // remove fragment\n                            if (tcp.PayloadData.Length == 0)\n                                break;\n                            // new NextClientSeq for client packet \n                            conn.NextClientSeq = conn.NextClientSeq + tcp.PayloadData.Length;\n                            // data should be valid here.\n                            AddClientData(GetUsefulData(tcp), GetIdOfConnection(conn));\n                            if (conn.ClientFragments.ContainsKey(conn.NextClientSeq))\n                            // check if we have newer fragments which will now fit.\n                            {\n                                tcp = conn.ClientFragments[conn.NextClientSeq];\n                            }\n                            else\n                                break;\n                        }\n                    }\n                }\n            }\n            else\n            {\n                //from host\n                lock (conn.Synchro)\n                {\n                    if (tcp.SequenceNumber &lt; conn.NextHostSeq)\n                    // old packet\n                    {\n                        // just drop these for now\n                        return;\n                    }\n                    if (tcp.SequenceNumber &gt; conn.NextHostSeq)\n                    // newer out of order data\n                    {\n                        if (!conn.HostFragments.ContainsKey(tcp.SequenceNumber))\n                        {\n                            conn.HostFragments.Add(tcp.SequenceNumber, tcp);\n                        }\n                        else\n                        {\n                            conn.HostFragments[tcp.SequenceNumber] = tcp;\n                        }\n                    }\n                    else\n                    //\n                    {\n                        while (tcp.SequenceNumber == conn.NextHostSeq)\n                        // on time\n                        {\n                            conn.HostFragments.Remove(tcp.SequenceNumber);\n                            // remove fragment\n                            if (tcp.PayloadData.Length == 0)\n                                break;\n                            conn.NextHostSeq = conn.NextHostSeq + tcp.PayloadData.Length;\n                            // data should be valid here\n                            AddHostData(GetUsefulData(tcp), GetIdOfConnection(conn));\n                            if (conn.HostFragments.ContainsKey(conn.NextHostSeq))\n                            // check if we have newer fragments which will now fit.\n                            {\n                                tcp = conn.HostFragments[conn.NextHostSeq];\n                            }\n                            else\n                                break;\n                        }\n                    }\n                }\n            }\n        }\n    }\n \n    private static string GetIdOfConnection(SynchronizatedConnection conn)\n    {\n        return conn.ClientAddress.ToString() + conn.ClientPort.ToString() + conn.HostAddress.ToString()\n        + conn.HostPort.ToString();\n    }\n \n    private bool? IsTcpFromClient(TcpPacket tcp, out SynchronizatedConnection conn)\n    {\n        conn = null;\n        lock (synchronizationObjectForConnection)\n        {\n            foreach (var connection in Connections)\n            {\n                if (connection.IsFromClient(tcp))\n                {\n                    conn = connection;\n                    return true;\n                }\n                if (connection.IsFromHost(tcp))\n                {\n                    conn = connection;\n                    return false;\n                }\n            }\n        }\n        return null;\n    }\n \n    /// &lt;summary&gt;\n    /// Get Payload Data from tcp packet\n    /// &lt;/summary&gt;\n    /// &lt;param name=\"tcp\"&gt;TCP packet&lt;/param&gt;\n    /// &lt;returns&gt;bytes of useful data&lt;/returns&gt;\n    protected static byte[] GetUsefulData(TcpPacket tcp)\n    {\n        var data = new byte[tcp.Bytes.Length - tcp.DataOffset * 4];\n        for (int i = tcp.DataOffset * 4; i &lt; tcp.Bytes.Length; i++)\n        {\n            data[i - tcp.DataOffset * 4] = tcp.Bytes[i];\n        }\n        return data;\n    }\n}\n\n  /:\n\n \"\"  ,    -      ,     ;\n     ;\n  (,  TCP   IP ,    )   .    \n\n(public void RunSniffer(string filter)) \n\n           .\n","id":"https://eapyl.github.io/sniffer-of-tcp-packets/","title":"Sniffer of TCP packets"},"https://eapyl.github.io/structure-of-presentation/":{"body":"link\n\n","id":"https://eapyl.github.io/structure-of-presentation/","title":"Structure of presentation"},"https://eapyl.github.io/style-cop-i-don-t-like-sa-1201/":{"body":"StyleCop is a good application to take your source code in good state. There are a lot of rules and most of all are very useful, but...\nUnfortunately, the rule SA1201 is not so good for me. So i just want to create the similar rule, but a little else.\n\nYou can see the rule that changes the order of document's element to the next:\n&lt;element name=\"File\" order=\"0\"&gt;&lt;/element&gt;\n&lt;element name=\"Root\" order=\"1\"&gt;&lt;/element&gt;\n&lt;element name=\"ExternAliasDirective\" order=\"2\"&gt;&lt;/element&gt;\n&lt;element name=\"UsingDirective\" order=\"3\"&gt;&lt;/element&gt;\n&lt;element name=\"AssemblyAttribute\" order=\"4\"&gt;&lt;/element&gt;\n&lt;element name=\"Namespace\" order=\"5\"&gt;&lt;/element&gt;\n&lt;element name=\"Field\" order=\"6\"&gt;&lt;/element&gt;\n&lt;element name=\"Constructor\" order=\"10\"&gt;&lt;/element&gt;\n&lt;element name=\"Destructor\" order=\"11\"&gt;&lt;/element&gt;\n&lt;element name=\"Delegate\" order=\"8\"&gt;&lt;/element&gt;\n&lt;element name=\"Event\" order=\"9\"&gt;&lt;/element&gt;\n&lt;element name=\"Enum\" order=\"13\"&gt;&lt;/element&gt;\n&lt;element name=\"Interface\" order=\"14\"&gt;&lt;/element&gt;\n&lt;element name=\"Property\" order=\"7\"&gt;&lt;/element&gt;\n&lt;element name=\"Accessor\" order=\"15\"&gt;&lt;/element&gt;\n&lt;element name=\"Indexer\" order=\"16\"&gt;&lt;/element&gt;\n&lt;element name=\"Method\" order=\"12\"&gt;&lt;/element&gt;\n&lt;element name=\"Struct\" order=\"17\"&gt;&lt;/element&gt;\n&lt;element name=\"EnumItem\" order=\"18\"&gt;&lt;/element&gt;\n&lt;element name=\"ConstructorInitializer\" order=\"19\"&gt;&lt;/element&gt;\n&lt;element name=\"EmptyElement\" order=\"20\"&gt;&lt;/element&gt;\n\nIt saves in configuration file, so it is possible to change it in any time. \nFurther the source code of my rule. You can see the original source code of SA1201 using the DotPeek for example:\nusing System;\nusing System.Collections.Generic;\nusing System.Globalization;\nusing System.Configuration;\nusing System.Linq;\n \nusing StyleCop;\nusing StyleCop.CSharp;\nusing System.Xml.Serialization;\nusing System.IO;\n \n \nnamespace Wsg.Rules\n{\n    /// &lt;summary&gt;\n    /// Wsg StyleCOp custom rules\n    /// &lt;/summary&gt;\n    [SourceAnalyzer(typeof(CsParser))]\n    public class WsgStyleCopCustomRules : SourceAnalyzer\n    {\n        private Rule ws1000 = null;\n \n        public Rule Ws1000\n        {\n            get\n            {\n                if (ws1000 == null)\n                {\n                    lock (ws1000)\n                    {\n                        if (ws1000 == null)\n                        {\n                            XmlSerializer serializer = new XmlSerializer(typeof(Rule));\n \n                            TextReader tr = new StreamReader(Path.Combine(Path.GetDirectoryName(System.Reflection.Assembly.GetExecutingAssembly().Location), \"WS1000.config\"));\n                            ws1000 = (Rule)serializer.Deserialize(tr);\n                            tr.Close();\n                        }\n                    }\n                }\n \n                return ws1000;\n            }\n        }\n \n        public override void AnalyzeDocument(CodeDocument document)\n        {\n            Param.RequireNotNull((object)document, \"document\");\n            CsDocument csDocument = (CsDocument)document;\n            if (csDocument.RootElement == null)\n                return;\n            bool checkGeneratedCode = true;\n            if (document.Settings != null)\n            {\n                BooleanProperty booleanProperty = this.GetSetting(document.Settings, \"GeneratedCodeElementOrder\") as BooleanProperty;\n                if (booleanProperty != null)\n                    checkGeneratedCode = booleanProperty.Value;\n                this.ProcessElements((CsElement)csDocument.RootElement, checkGeneratedCode);\n            }\n            this.CheckUsingDirectiveOrder((CsElement)csDocument.RootElement);\n        }\n \n        public override bool DoAnalysis(CodeDocument document)\n        {\n            Param.RequireNotNull((object)document, \"document\");\n            CsDocument csDocument = (CsDocument)document;\n            if (csDocument.FileHeader != null)\n                return !csDocument.FileHeader.UnStyled;\n            else\n                return true;\n        }\n \n        private bool ProcessElements(CsElement element, bool checkGeneratedCode)\n        {\n            if (this.Cancel)\n                return false;\n            this.CheckElementOrder(element, checkGeneratedCode);\n            return true;\n        }\n \n        private void CheckElementOrder(CsElement element, bool checkGeneratedCode)\n        {\n            if (!element.Generated &amp;&amp; (element.ElementType == ElementType.Class || element.ElementType == ElementType.Field || (element.ElementType == ElementType.Enum || element.ElementType == ElementType.Struct) || (element.ElementType == ElementType.Interface || element.ElementType == ElementType.Delegate || (element.ElementType == ElementType.Event || element.ElementType == ElementType.Property)) || (element.ElementType == ElementType.Indexer || element.ElementType == ElementType.Method || (element.ElementType == ElementType.Constructor || element.ElementType == ElementType.Accessor))))\n                this.CheckDeclarationKeywordOrder(element);\n            this.CheckUsingDirectivePlacement(element);\n            this.CheckChildElementOrdering(element, checkGeneratedCode);\n        }\n \n        private void CheckChildElementOrdering(CsElement element, bool checkGeneratedCode)\n        {\n            if (element.ChildElements.Count &lt;= 0)\n                return;\n            bool flag = true;\n            CsElement[] array = new CsElement[element.ChildElements.Count];\n            element.ChildElements.CopyTo(array, 0);\n            for (int index1 = 0; index1 &lt; array.Length; ++index1)\n            {\n                CsElement csElement = array[index1];\n               \n                for (int index2 = index1 + 1; index2 &lt; array.Length; ++index2)\n                {\n                    CsElement second = array[index2];\n                    if ((checkGeneratedCode &amp;&amp; (!csElement.Generated || !second.Generated) || !checkGeneratedCode &amp;&amp; !csElement.Generated &amp;&amp; !second.Generated))\n                    {\n                        if (!this.CompareItems(csElement, second, !flag))\n                        {\n                            if (flag)\n                                csElement.AnalyzerTag = (object)false;\n                            else\n                                second.AnalyzerTag = (object)false;\n                        }\n                        else if (flag)\n                            flag = false;\n                        if (csElement.ElementType == ElementType.Accessor &amp;&amp; second.ElementType == ElementType.Accessor)\n                        {\n                            Accessor accessor1 = (Accessor)csElement;\n                            Accessor accessor2 = (Accessor)second;\n                            if (accessor1.AccessorType == AccessorType.Set &amp;&amp; accessor2.AccessorType == AccessorType.Get)\n                                this.AddViolation((ICodeElement)csElement, \"PropertyAccessorsMustFollowOrder\", new object[0]);\n                            else if (accessor1.AccessorType == AccessorType.Remove &amp;&amp; accessor2.AccessorType == AccessorType.Add)\n                                this.AddViolation((ICodeElement)csElement, \"EventAccessorsMustFollowOrder\", new object[0]);\n                        }\n                    }\n                }\n \n                this.CheckElementOrder(csElement, checkGeneratedCode);\n            }\n        }\n \n        public bool CompareElementType(ElementType first, ElementType second)\n        {\n            if (Ws1000 != null)\n            {\n                return Ws1000.Order.First(x =&gt; x.name == System.Enum.GetName(typeof(ElementType), first)).order &gt; Ws1000.Order.First(x =&gt; x.name == System.Enum.GetName(typeof(ElementType), second)).order;\n            }\n            return false;\n        }\n \n        private bool CompareItems(CsElement first, CsElement second, bool foundFirst)\n        {\n            if (first.ElementType != ElementType.EmptyElement &amp;&amp; second.ElementType != ElementType.EmptyElement &amp;&amp; (first.ElementType != ElementType.Accessor || second.ElementType != ElementType.Accessor))\n            {\n                CsElement csElement1 = second;\n                if (!foundFirst)\n                    csElement1 = first;\n                if (CompareElementType(first.ElementType, second.ElementType))\n                {\n                    this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"ElementsMustAppearInTheCorrectOrder\", (object)first.FriendlyPluralTypeText, (object)second.FriendlyPluralTypeText);\n                    return false;\n                }\n                else if (first.ElementType == second.ElementType &amp;&amp; first.Declaration != null &amp;&amp; second.Declaration != null)\n                {\n                    if (first.Declaration.AccessModifierType &lt; second.Declaration.AccessModifierType)\n                    {\n                        if (first.ElementType == ElementType.Constructor &amp;&amp; second.ElementType == ElementType.Constructor)\n                        {\n                            if (first.Declaration.ContainsModifier(new CsTokenType[1] { CsTokenType.Static}))\n                            {\n                                if (!second.Declaration.ContainsModifier(new CsTokenType[1] { CsTokenType.Static}))\n                                    goto label_31;\n                            }\n                        }\n                        if (!first.Declaration.AccessModifier &amp;&amp; first.ElementType != ElementType.Method)\n                        {\n                            if (first.Declaration.ContainsModifier(new CsTokenType[1] {CsTokenType.Partial}))\n                                goto label_14;\n                        }\n                        if (!second.Declaration.AccessModifier &amp;&amp; second.ElementType != ElementType.Method)\n                        {\n                            if (second.Declaration.ContainsModifier(new CsTokenType[1] { CsTokenType.Partial }))\n                                goto label_14;\n                        }\n                        this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"ElementsMustBeOrderedByAccess\", (object)WsgStyleCopCustomRules.AccessModifierTypeString(first.Declaration.AccessModifierType), (object)first.FriendlyPluralTypeText, (object)WsgStyleCopCustomRules.AccessModifierTypeString(second.Declaration.AccessModifierType), (object)second.FriendlyPluralTypeText);\n                        goto label_19;\n                    label_14:\n                        CsElement csElement2 = first;\n                        if (!first.Declaration.AccessModifier)\n                        {\n                            if (first.Declaration.ContainsModifier(new CsTokenType[1]{  CsTokenType.Partial}))\n                                goto label_17;\n                        }\n                        csElement2 = second;\n                    label_17:\n                        this.AddViolation((ICodeElement)csElement2, \"PartialElementsMustDeclareAccess\", new object[2]\n                                                    {\n                                                      (object) csElement2.FriendlyTypeText,\n                                                      (object) csElement2.FriendlyPluralTypeText\n                                                    });\n                    label_19:\n                        return false;\n                    }\n                    else if (first.Declaration.AccessModifierType == second.Declaration.AccessModifierType)\n                    {\n                        bool flag1 = false;\n                        bool flag2 = false;\n                        Field field1 = first as Field;\n                        Field field2 = second as Field;\n                        if (field1 != null &amp;&amp; field2 != null)\n                        {\n                            flag1 = field1.Const;\n                            flag2 = field1.Readonly;\n                            if ((field2.Const || field2.Readonly) &amp;&amp; (!field1.Const &amp;&amp; !field1.Readonly))\n                            {\n                                this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"ConstantsMustAppearBeforeFields\", (object)WsgStyleCopCustomRules.AccessModifierTypeString(first.Declaration.AccessModifierType), (object)first.FriendlyPluralTypeText, (object)WsgStyleCopCustomRules.AccessModifierTypeString(second.Declaration.AccessModifierType), (object)second.FriendlyPluralTypeText);\n                                return false;\n                            }\n                        }\n                        if (second.Declaration.ContainsModifier(new CsTokenType[1] {  CsTokenType.Static }))\n                        {\n                            if (!first.Declaration.ContainsModifier(new CsTokenType[1] { CsTokenType.Static}) &amp;&amp; !flag1 &amp;&amp; !flag2)\n                            {\n                                this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"StaticElementsMustAppearBeforeInstanceElements\", (object)WsgStyleCopCustomRules.AccessModifierTypeString(first.Declaration.AccessModifierType), (object)first.FriendlyPluralTypeText, (object)WsgStyleCopCustomRules.AccessModifierTypeString(second.Declaration.AccessModifierType), (object)second.FriendlyPluralTypeText);\n                                return false;\n                            }\n                        }\n                        if (first.Declaration.ElementType != ElementType.UsingDirective &amp;&amp; second.Declaration.ElementType != ElementType.UsingDirective)\n                        {\n                            if (string.Compare(first.Declaration.Name, second.Declaration.Name) &gt; 0)\n                            {\n                                this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"UsingNamesMustBeOrderedAlphabetically\", (object)WsgStyleCopCustomRules.AccessModifierTypeString(first.Declaration.AccessModifierType), (object)first.FriendlyPluralTypeText, (object)WsgStyleCopCustomRules.AccessModifierTypeString(second.Declaration.AccessModifierType), (object)second.FriendlyPluralTypeText);\n                                return false;\n                            }\n                        }\n                    }\n                    else if (first.ElementType == ElementType.Constructor &amp;&amp; second.ElementType == ElementType.Constructor)\n                    {\n                        if (second.Declaration.ContainsModifier(new CsTokenType[1] { CsTokenType.Static }))\n                        {\n                            if (!first.Declaration.ContainsModifier(new CsTokenType[1]{ CsTokenType.Static}))\n                            {\n                                this.AddViolation((ICodeElement)first, csElement1.LineNumber, \"StaticElementsMustAppearBeforeInstanceElements\", (object)WsgStyleCopCustomRules.AccessModifierTypeString(first.Declaration.AccessModifierType), (object)first.FriendlyPluralTypeText, (object)WsgStyleCopCustomRules.AccessModifierTypeString(second.Declaration.AccessModifierType), (object)second.FriendlyPluralTypeText);\n                                return false;\n                            }\n                        }\n                    }\n                }\n            }\n        label_31:\n            return true;\n        }\n \n        private static string AccessModifierTypeString(AccessModifierType type)\n        {\n            switch (type)\n            {\n                case AccessModifierType.Public:\n                    return \"public\";\n                case AccessModifierType.Internal:\n                    return \"internal\";\n                case AccessModifierType.ProtectedInternal:\n                    return \"protected internal\";\n                case AccessModifierType.Protected:\n                    return \"protected\";\n                case AccessModifierType.Private:\n                    return \"private\";\n                default:\n                    throw new InvalidOperationException();\n            }\n        }\n \n        private void CheckUsingDirectivePlacement(CsElement element)\n        {\n            if (element.Generated || element.ElementType != ElementType.UsingDirective)\n                return;\n            CsElement parentElement = ICodePartExtensions.FindParentElement((ICodePart)element);\n            if (parentElement == null)\n                return;\n            if (parentElement.ElementType != ElementType.Root)\n            {\n                this.AddViolation((ICodeElement)element, \"UsingDirectivesMustBePlacedWithoutNamespace\", new object[0]);\n            }\n        }\n \n        private void CheckDeclarationKeywordOrder(CsElement element)\n        {\n            int num1 = -1;\n            int num2 = -1;\n            int num3 = -1;\n            int num4 = 0;\n            foreach (CsToken csToken in (ItemList&lt;CsToken&gt;)element.Declaration.Tokens)\n            {\n                switch (csToken.CsTokenType)\n                {\n                    case CsTokenType.Private:\n                    case CsTokenType.Public:\n                    case CsTokenType.Protected:\n                    case CsTokenType.Internal:\n                        if (num1 == -1)\n                        {\n                            num1 = num4++;\n                            continue;\n                        }\n                        else\n                            continue;\n                    case CsTokenType.Static:\n                        if (num2 == -1)\n                        {\n                            num2 = num4++;\n                            continue;\n                        }\n                        else\n                            continue;\n                    case CsTokenType.WhiteSpace:\n                    case CsTokenType.EndOfLine:\n                    case CsTokenType.SingleLineComment:\n                    case CsTokenType.MultiLineComment:\n                        continue;\n                    default:\n                        if (num3 == -1)\n                        {\n                            num3 = num4++;\n                            continue;\n                        }\n                        else\n                            continue;\n                }\n            }\n            if (num1 != -1)\n            {\n                if (num2 &gt; -1 &amp;&amp; num2 &lt; num1)\n                {\n                    WsgStyleCopCustomRules orderingRules = this;\n                    CsElement csElement = element;\n                    // ISSUE: variable of a boxed type\n                    var local = \"DeclarationKeywordsMustFollowOrder\";\n                    object[] objArray1 = new object[2] {(object) \"AccessModifier\", null};\n                    objArray1[1] = (object)string.Format((IFormatProvider)CultureInfo.InvariantCulture, \"'{0}'\", new object[1] { (object) \"Static\" });\n                    object[] objArray2 = objArray1;\n                    orderingRules.AddViolation((ICodeElement)csElement, local, objArray2);\n                }\n                if (num3 &gt; -1 &amp;&amp; num3 &lt; num1)\n                {\n                    WsgStyleCopCustomRules orderingRules = this;\n                    CsElement csElement = element;\n                    // ISSUE: variable of a boxed type\n                    var local = \"DeclarationKeywordsMustFollowOrder\";\n                    object[] objArray1 = new object[2] { (object)\"AccessModifier\", null };\n                    objArray1[1] = (object)string.Format((IFormatProvider)CultureInfo.InvariantCulture, \"'{0}'\", new object[1] { (object) \"Other\" });\n                    object[] objArray2 = objArray1;\n                    orderingRules.AddViolation((ICodeElement)csElement, local, objArray2);\n                }\n            }\n            if (num2 &gt; -1 &amp;&amp; num3 &gt; -1 &amp;&amp; num3 &lt; num2)\n                this.AddViolation((ICodeElement)element, \"DeclarationKeywordsMustFollowOrder\", new object[2] {\n                      (object) string.Format((IFormatProvider) CultureInfo.InvariantCulture, \"'{0}'\", new object[1]\n                      {\n                        (object) \"Static\"\n                      }),\n                      (object) string.Format((IFormatProvider) CultureInfo.InvariantCulture, \"'{0}'\", new object[1]\n                      {\n                        (object) \"Other\"\n                      })\n                    });\n            if (element.Declaration.AccessModifierType != AccessModifierType.ProtectedInternal)\n                return;\n            bool flag = false;\n            foreach (CsToken csToken in (ItemList&lt;CsToken&gt;)element.Declaration.Tokens)\n            {\n                if (flag)\n                {\n                    if (csToken.CsTokenType == CsTokenType.Internal)\n                        break;\n                    if (csToken.CsTokenType != CsTokenType.WhiteSpace)\n                    {\n                        this.AddViolation((ICodeElement)element, \"ProtectedMustComeBeforeInternal\", new object[0]);\n                        break;\n                    }\n                }\n                else if (csToken.CsTokenType == CsTokenType.Protected)\n                    flag = true;\n                else if (csToken.CsTokenType == CsTokenType.Internal)\n                {\n                    this.AddViolation((ICodeElement)element, \"ProtectedMustComeBeforeInternal\", new object[0]);\n                    break;\n                }\n            }\n        }\n \n        private void CheckUsingDirectiveOrder(CsElement rootElement)\n        {\n            if (rootElement.Generated)\n                return;\n            this.CheckOrderOfUsingDirectivesUnderElement(rootElement);\n            foreach (CsElement rootElement1 in (IEnumerable&lt;CsElement&gt;)rootElement.ChildElements)\n            {\n                if (rootElement1.ElementType == ElementType.Namespace)\n                    this.CheckUsingDirectiveOrder(rootElement1);\n            }\n        }\n \n        private void CheckOrderOfUsingDirectivesUnderElement(CsElement element)\n        {\n            List&lt;UsingDirective&gt; usings = (List&lt;UsingDirective&gt;)null;\n            foreach (CsElement csElement in (IEnumerable&lt;CsElement&gt;)element.ChildElements)\n            {\n                if (csElement.ElementType == ElementType.UsingDirective)\n                {\n                    if (usings == null)\n                        usings = new List&lt;UsingDirective&gt;();\n                    usings.Add((UsingDirective)csElement);\n                }\n                else if (csElement.ElementType != ElementType.ExternAliasDirective)\n                    break;\n            }\n            if (usings == null)\n                return;\n            this.CheckOrderOfUsingDirectivesInList(usings);\n        }\n \n        private void CheckOrderOfUsingDirectivesInList(List&lt;UsingDirective&gt; usings)\n        {\n            for (int index1 = 0; index1 &lt; usings.Count; ++index1)\n            {\n                UsingDirective firstUsing = usings[index1];\n                for (int index2 = index1 + 1; index2 &lt; usings.Count; ++index2)\n                {\n                    UsingDirective secondUsing = usings[index2];\n                    if (!this.CompareOrderOfUsingDirectives(firstUsing, secondUsing))\n                        break;\n                }\n            }\n        }\n \n        private bool CompareOrderOfUsingDirectives(UsingDirective firstUsing, UsingDirective secondUsing)\n        {\n            if (string.IsNullOrEmpty(firstUsing.Alias))\n            {\n                if (string.IsNullOrEmpty(secondUsing.Alias))\n                {\n                    bool flag1 = firstUsing.NamespaceType.StartsWith(\"System\", StringComparison.Ordinal) || firstUsing.NamespaceType.StartsWith(\"global::System\", StringComparison.Ordinal);\n                    bool flag2 = secondUsing.NamespaceType.StartsWith(\"System\", StringComparison.Ordinal) || secondUsing.NamespaceType.StartsWith(\"global::System\", StringComparison.Ordinal);\n                    if (flag2 &amp;&amp; !flag1)\n                    {\n                        this.AddViolation((ICodeElement)secondUsing, \"SystemUsingDirectivesMustBePlacedBeforeOtherUsingDirectives\", new object[0]);\n                        return false;\n                    }\n                    else if ((flag1 &amp;&amp; flag2 || !flag1 &amp;&amp; !flag2) &amp;&amp; !WsgStyleCopCustomRules.CheckNamespaceOrdering(firstUsing.NamespaceType, secondUsing.NamespaceType))\n                    {\n                        this.AddViolation((ICodeElement)firstUsing, \"UsingDirectivesMustBeOrderedAlphabeticallyByNamespace\", new object[0]);\n                        return false;\n                    }\n                }\n            }\n            else if (string.IsNullOrEmpty(secondUsing.Alias))\n            {\n                this.AddViolation((ICodeElement)firstUsing, \"UsingAliasDirectivesMustBePlacedAfterOtherUsingDirectives\", new object[0]);\n                return false;\n            }\n            else if (string.Compare(firstUsing.Alias, secondUsing.Alias, StringComparison.OrdinalIgnoreCase) &gt; 0)\n            {\n                this.AddViolation((ICodeElement)firstUsing, \"UsingAliasDirectivesMustBeOrderedAlphabeticallyByAliasName\", new object[0]);\n                return false;\n            }\n            return true;\n        }\n \n        private static bool CheckNamespaceOrdering(string namespace1, string namespace2)\n        {\n            string[] strArray1 = namespace1.Split(new char[1] {'.'});\n            string[] strArray2 = namespace2.Split(new char[1] {'.'});\n            strArray1[0] = StringExtensions.SubstringAfter(strArray1[0], \"global::\", StringComparison.InvariantCulture);\n            strArray2[0] = StringExtensions.SubstringAfter(strArray2[0], \"global::\", StringComparison.InvariantCulture);\n            int num1 = Math.Min(strArray1.Length, strArray2.Length);\n            for (int index = 0; index &lt; num1; ++index)\n            {\n                int num2 = string.Compare(strArray1[index], strArray2[index], StringComparison.InvariantCultureIgnoreCase);\n                if (num2 &lt; 0)\n                    return true;\n                if (num2 &gt; 0)\n                    return false;\n                int num3 = string.Compare(strArray1[index], strArray2[index], StringComparison.InvariantCulture);\n                if (num3 &lt; 0)\n                    return true;\n                if (num3 &gt; 0)\n                    return false;\n            }\n            if (strArray1.Length == strArray2.Length)\n                return true;\n            else\n                return strArray1.Length &lt; strArray2.Length;\n        }\n    }\n}\n\nMethods AnalyzeDocument  DoAnalysis are the most important, so i suggest to start the learning code from them. The project in VS2010 is StyleCopOrder.Thanks.\n","id":"https://eapyl.github.io/style-cop-i-don-t-like-sa-1201/","title":"Style Cop I don't like SA 1201"},"https://eapyl.github.io/tfs-delete-team-project/":{"body":"It is not so easy to find the steps to delete project from TFS.\n\nSo, according to http://stackoverflow.com/questions/13635889/delete-team-project-from-free-team-foundation-service.\nYou can use the following command from the \"Developer Command Prompt\":\nTfsDeleteProject /collection:https://mytfs.visualstudio.com/DefaultCollection MyProject\n\nThank you\n","id":"https://eapyl.github.io/tfs-delete-team-project/","title":"TFS Delete Team Project"},"https://eapyl.github.io/tfs-exclude-binding-from-solution/":{"body":"It is not easy command to unbind solution/project of TFS.\n\nBut there is manual actions to do that:\n\nRemove all *.vssscc and etc(Source Control files near your solution and projects file);\nRemove all nodes in solution and project file with tag \n\n","id":"https://eapyl.github.io/tfs-exclude-binding-from-solution/","title":"TFS Exclude binding from solution"},"https://eapyl.github.io/understanding-docker/":{"body":"What is Docker?\nDocker is the world's leading software containerization platform\n\nNote: Docker is licensed under the open source Apache 2.0 license.\n\n\nDocker containers wrap a piece of software in a complete filesystem that contains everything needed to run: code, runtime, system tools, system libraries  anything that can be installed on a server. This guarantees that the software will always run the same, regardless of its environment.\n\n\nLightweight\n\nContainers running on a single machine share the same operating system kernel; they start instantly and use less RAM. Images are constructed from layered filesystems and share common files, making disk usage and image downloads much more efficient.\n\nOpen and supported by community\n\nDocker containers are based on open standards, enabling containers to run on all major Linux distributions and on Microsoft Windows - and on top of any infrastructure. In addition, because Docker's partnering with the other container powers, including Canonical, Google, Red Hat, and Parallels, on its key open-source component runc, it's brought standardization to containers. More info is here.\n\nSecure by default\n\nContainers isolate applications from one another and the underlying infrastructure, while providing an added layer of protection for the application.\nContainers and virtual machines\nContainers and virtual machines have similar resource isolation and allocation benefits - but a different architectural approach allows containers to be more portable and efficient. Docker is built on top of LXC. Like with any container technology, as far as the program is concerned, it has its own file system, storage, CPU, RAM, and so on. The key difference between containers and VMs is that while the hypervisor abstracts an entire device, containers just abstract the operating system kernel. It means that you are able to run only containers which are supported by host operating system, i.e. there are containers for Windows OS and containers for Linux.\n\nVirtual Machines\n\n\nVirtual machines include the application, the necessary binaries and libraries, and an entire guest operating system - all of which can amount to tens of GBs.\n\nContainers\n\n\nContainers include the application and all of its dependencies - but share the kernel with other containers, running as isolated processes in user space on the host operating system. Docker containers are not tied to any specific infrastructure: they run on any computer, on any infrastructure, and in any cloud.\nAdditional benefits\nDocker allows you to dynamically change your application - from adding new capabilities and scaling services, to quickly changing problem areas.\n\nShorter delivery time\n\nOn average, Docker users ship 7X more software after deploying Docker in their environment. More frequent software updates provide added value to customers.\n\nQuickly scale\n\nDocker containers spin up and down in seconds, making it easy to scale application services to satisfy peak customer demand, and then reduce running containers when demand ebbs. And Docker containers are easy to deploy in a cloud.\n\nEasily remediate issue\n\nDocker makes it easy to identify issues, isolate the problem container, quickly roll back to make the necessary changes, and then push the updated container into production. Isolation between containers makes these changes less disruptive than in traditional software models.\nIn summary: docker allows to deploy, use and support containers on production easier and safer than previous approaches. On the other hand, developers can use Docker to pack, ship, and run any application as a lightweight, portable, self sufficient LXC container that can run virtually anywhere.\nDocker toolset\nDocker provides tooling and a platform to manage the lifecycle of your containers:\n\nEncapsulate your applications (and supporting components) into Docker containers\nDistribute and ship those containers to your teams for further development and testing\nDeploy those applications to your production environment, whether it is in a local data center or the Cloud\n\nDocker Engine\nDocker Engine is a client-server application with these major components:\n\nA server which is a type of long-running program called a daemon process.\nA REST API which specifies interfaces that programs can use to talk to the daemon and instruct it what to do.\nA command line interface (CLI) client.\n\n\nWhat can I use Docker for?\nDocker can streamline the development lifecycle by allowing developers to work in standardized environments using local containers which provide your applications and services. You can also integrate Docker into your continuous integration and continuous deployment (CI/CD) workflow.\nDockers portability and lightweight nature also make it easy to dynamically manage workloads, scaling up or tearing down applications and services as business needs dictate, in near real time.\nDocker is lightweight and fast. It provides a viable, cost-effective alternative to hypervisor-based virtual machines, allowing you to use more of your compute capacity to achieve your business goals.\nDockers architecture\nDocker uses a client-server architecture. The Docker client and daemon communicate using a REST API, over UNIX sockets or a network interface. One client can even communicate with multiple unrelated daemons.\n\nInside Docker\n\nDocker images\n\nA Docker image is a read-only template with instructions for creating a Docker container. For example, an image might contain an Nano Server operating system with dotnet core and your web application installed. You can build or update images from scratch or download and use images created by others. A docker image is described in text file called a Dockerfile, which has a simple, well-defined syntax.\nDocker images are the build component of Docker.\n\nDocker containers\n\nA Docker container is a runnable instance of a Docker image. You can run, start, stop, move, or delete a container using Docker API or CLI commands. When you run a container, you can provide configuration metadata such as networking information or environment variables. Each container is an isolated and secure application platform, but can be given access to resources running in a different host or container, as well as persistent storage or databases.\nDocker containers are the run component of Docker.\n\nDocker registries\n\nA docker registry is a library of images. A registry can be public or private, and can be on the same server as the Docker daemon or Docker client, or on a totally separate server.\nDocker registries are the distribution component of Docker.\n\nDocker services\n\nA Docker service allows a swarm of Docker nodes to work together, running a defined number of instances of a replica task, which is itself a Docker image. You can specify the number of concurrent replica tasks to run, and the swarm manager ensures that the load is spread evenly across the worker nodes. To the consumer, the Docker service appears to be a single application.\nDocker services are the scalability component of Docker.\nDocker image work\nDocker images are read-only templates from which Docker containers are instantiated. Each image consists of a series of layers. Docker uses union file systems to combine these layers into a single image. Union file systems allow files and directories of separate file systems, known as branches, to be transparently overlaid, forming a single coherent file system.\nThese layers are one of the reasons Docker is so lightweight. When you change a Docker image, such as when you update an application to a new version, a new layer is built and replaces only the layer it updates. The other layers remain intact. To distribute the update, you only need to transfer the updated layer. Layering speeds up distribution of Docker images. Docker determines which layers need to be updated at runtime.\nAn image is defined in a Dockerfile. Every image starts from a base image, such as ubuntu (Note: Docker Hub is a public registry and stores images). The base image is defined using the FROM keyword in the dockerfile. There are a set of intructions after this world usually. Each instruction creates a new layer in the image:\n\nSpecify the base image (FROM)\nSpecify the maintainer (LABEL)\nRun a command (RUN)\nAdd a file or directory (ADD)\nCreate an environment variable (ENV)\nWhat process to run when launching a container from this image (CMD)\n\nDocker reads this Dockerfile when you request a build of an image, executes the instructions, and returns the image.\nDocker registry work\nA Docker registry stores Docker images. After you build a Docker image, you can push it to a public registry such as Docker Hub or to a private registry running behind your firewall. You can also search for existing images and pull them from the registry to a host.\nContainer work\nA container uses the host machines Linux/Windows kernel, and consists of any extra files you add when the image is created, along with metadata associated with the container at creation or when the container is started. Each container is built from an image. The image defines the containers contents, which process to run when the container is launched, and a variety of other configuration details. The Docker image is read-only. When Docker runs a container from an image, it adds a read-write layer on top of the image in which your application runs.\nWhat happens when you run a container?\nWhen you use the docker run CLI command or the equivalent API, the Docker Engine client instructs the Docker daemon to run a container. For example:\n$ docker run -i -t ubuntu /bin/bash\n\nWhen you run this command, Docker Engine does the following:\n\nPulls the ubuntu image: Docker Engine checks for the presence of the ubuntu image. If the image already exists locally, Docker Engine uses it for the new container. Otherwise, then Docker Engine pulls it from Docker Hub.\nCreates a new container: Docker uses the image to create a container.\nAllocates a filesystem and mounts a read-write layer: The container is created in the file system and a read-write layer is added to the image.\nAllocates a network / bridge interface: Creates a network interface that allows the Docker container to talk to the local host.\nSets up an IP address: Finds and attaches an available IP address from a pool.\nExecutes a process that you specify: Executes the /bin/bash executable.\nCaptures and provides application output: Connects and logs standard input, outputs and errors for you to see how your application is running, because you requested interactive mode.\n\nYou can manage and interact with it, use the services and applications it provides, and eventually stop and remove it.\nThe underlying technology\nDocker is written in Go programming language.\nNamespaces\nDocker uses a technology called namespaces to provide the isolated workspace called the container. When you run a container, Docker creates a set of namespaces for that container.\nThese namespaces provide a layer of isolation. Each aspect of a container runs in a separate namespace and its access is limited to that namespace.\nDocker Engine uses namespaces such as the following on Linux:\n\nThe pid namespace: Process isolation (PID: Process ID).\nThe net namespace: Managing network interfaces (NET: Networking).\nThe ipc namespace: Managing access to IPC resources (IPC: InterProcess Communication).\nThe mnt namespace: Managing filesystem mount points (MNT: Mount).\nThe uts namespace: Isolating kernel and version identifiers. (UTS: Unix Timesharing System).\n\nControl groups\nDocker Engine on Linux also relies on another technology called control groups (cgroups). A cgroup limits an application to a specific set of resources. Control groups allow Docker Engine to share available hardware resources to containers and optionally enforce limits and constraints. For example, you can limit the memory available to a specific container.\nUnion file systems\nUnion file systems, or UnionFS, are file systems that operate by creating layers, making them very lightweight and fast. Docker Engine uses UnionFS to provide the building blocks for containers.\nContainer format\nDocker Engine combines the namespaces, control groups, and UnionFS into a wrapper called a container format.\nResourses:\n\nWhat is Docker?\nWhat is Docker and why is it so darn popular?\n Docker\nDocker Overview\nDocker libcontainer unifies Linux container powers\nASP.NET Community Standup - January 17th, 2017 - Messing with Docker\nWorking with Windows Containers and Docker: The Basics\nUnderstanding Docker presentation\n\n","id":"https://eapyl.github.io/understanding-docker/","title":"Understanding Docker"},"https://eapyl.github.io/update-pip-application-in-ubuntu/":{"body":"To update application installed by pip, e.g. streamlink:\nsudo pip install -U streamlink\n","id":"https://eapyl.github.io/update-pip-application-in-ubuntu/","title":"Update pip application in Ubuntu"},"https://eapyl.github.io/use-logparser/":{"body":"\nDownload LogParser 2.2.\nC:&gt;tlbimp LogParser.dll /out:Interop.MSUtil.dll\nInclude Interop.MSUtil.dll in a project.\n\n\nusing LogQuery = Interop.MSUtil.LogQueryClassClass;\nusing IISW3CInputFormat = Interop.MSUtil.COMIISW3CInputContextClassClass;\nusing CsvOutputFormat = Interop.MSUtil.COMCSVOutputContextClassClass;\nusing LogRecordSet = Interop.MSUtil.ILogRecordset;\n\nLogQuery oLogQuery = new LogQuery();\n\n// Instantiate the Event Log Input Format object\nIISW3CInputFormat oW3CInputFormat = new IISW3CInputFormat();\n\nstring query = String.Format(_queryPostOverall, _pathToLog, \"200\", _date);\nvar oRecordSet = oLogQuery.Execute(query, oW3CInputFormat);\nfor (; !oRecordSet.atEnd(); oRecordSet.moveNext())\n{\n   double count = Convert.ToDouble(oRecordSet.getRecord().getValue(\"count1\"));\n   _postCountOverall.overall += count;\n}\noRecordSet.close();\n","id":"https://eapyl.github.io/use-logparser/","title":"Use LogParser"},"https://eapyl.github.io/use-websql-and-indexeddb-in-typescript/":{"body":"More information about IndexedDb or WebSQL.\n\nLet's define base interfaces for our task:\nexport interface IItem {\n    id: string;\n    value: string;\n}\n\nexport interface IStorage&lt;T extends IItem&gt; {\n    // Initial method to create storage\n    init(name: string): Observable&lt;IStorage&lt;T&gt;&gt;;\n\n    // Get the value by unique key\n    get(key: string): Observable&lt;T&gt;;\n\n    // Clear/remove all data in the storage\n    clear(): Observable&lt;T&gt;;\n\n    // Put specific value into the storage\n    put(value: T): Observable&lt;T&gt;;\n\n    // Get all values using the set of keys\n    getDenseBatch(keys: string[]): Observable&lt;T&gt;;\n\n    // Get all values from the storage\n    all(): Observable&lt;T&gt;;\n}\n\nHere I am using rxjs to handle results. IItem is an interface for items which we are saving, IStorage is an interface for a specific storage.\nIn Memory implementation\nA short example how to implement mentioned interface using in-memory array:\nexport class MemoryStorage&lt;T extends IItem&gt; implements IStorage&lt;T&gt; {\n    private storage: { [key: string]: T } = {};\n\n    init(name: string): Observable&lt;MemoryStorage&lt;T&gt;&gt; {\n        return Observable.of(this);\n    }\n\n    get(key: string): Observable&lt;T&gt; {\n        return Observable.of(this.storage[key]);\n    }\n\n    clear(): Observable&lt;T&gt; {\n        this.storage = {};\n        return Observable.empty&lt;T&gt;();\n    }\n\n    put(value: T): Observable&lt;T&gt; {\n        if (!value.id) {\n            value.id = Math.random().toString(36).substring(7);\n        }\n        this.storage[value.id] = value;\n        return Observable.of(value);\n    }\n\n    getDenseBatch(keys: string[]): Observable&lt;T&gt; {\n        return Observable.from(keys.map(x =&gt; this.storage[x]));\n    }\n\n    all(): Observable&lt;T&gt; {\n        return Observable.from(Object.keys(this.storage).map(x =&gt; this.storage[x]));\n    }\n}\n\nSimple implementation of IItem:\nclass TestKeyValue implements IItem {\n  public id: string;\n  public value: string;\n}\n\nUnit tests for MemoryStorage:\ndescribe('MemoryStorage: Class', () =&gt; {\n  let key1 = 'key1', key2 = 'key2';\n  let value1 = 'value1', value2 = 'value2';\n\n  function init(): MemoryStorage&lt;TestKeyValue&gt; {\n    let storage = new MemoryStorage&lt;TestKeyValue&gt;();\n    storage.init('test');\n    return storage;\n  }\n\n  it('should create empty storage', async(() =&gt; {\n    let storage = init();\n    storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeTruthy());\n  }));\n\n  it('should save one item', async(() =&gt; {\n    let storage = init();\n    storage.put({ id: key1, value: value1 });\n    storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeFalsy());\n  }));\n\n  it('should save/get one item', async(() =&gt; {\n    let storage = init();\n    let item = { id: key1, value: value1 };\n    storage.put(item);\n    storage.get(key1).subscribe(value =&gt; expect(value).toEqual(item));\n  }));\n\n  it('should save/get two items', async(() =&gt; {\n    let storage = init();\n    let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n    storage.put(items[0]);\n    storage.put(items[1]);\n    let i = 0;\n    storage.getDenseBatch([key1, key2]).subscribe(value =&gt; expect(value).toEqual(items[i++]));\n  }));\n\n  it('should clear saved items', async(() =&gt; {\n    let storage = init();\n    let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n    storage.put(items[0]);\n    storage.put(items[1]);\n\n    storage.clear();\n    storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeTruthy());\n  }));\n});\nWebSQL implementation\nCurrent implementation just just for objects where key (string) is unique string value, value (string) is a payload.\nexport class WebSQLStorage&lt;T extends IItem&gt; implements IStorage&lt;T&gt; {\n    private db: Database;\n    private databaseName: string = 'TripNoteDB';\n    private name: string;\n\n    constructor() {\n        this.db = window.openDatabase(this.databaseName, '1.0', `Store information`, 40 * 1024 * 1024);\n    }\n\n    init(name: string): Observable&lt;WebSQLStorage&lt;T&gt;&gt; {\n        this.name = name;\n        return Observable.create((observer: Observer&lt;WebSQLStorage&lt;T&gt;&gt;) =&gt; {\n            this.db.transaction(\n                (tx) =&gt; tx.executeSql(`CREATE TABLE IF NOT EXISTS ${name} (key unique, value string)`,\n                    [],\n                    (t, results) =&gt; {\n                        observer.next(this);\n                        observer.complete();\n                    },\n                    (t, message) =&gt; {\n                        observer.error(message.message.toString());\n                        return true;\n                    })\n            );\n        });\n    }\n\n    get(key: string): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.db.transaction((tx) =&gt; {\n                tx.executeSql(`SELECT * FROM ${this.name} WHERE key='${key}'`, [],\n                    (t, results) =&gt; {\n                        let len = results.rows.length;\n                        if (len === 0) {\n                            observer.next(undefined);\n                        } else if (len === 1) {\n                            observer.next(results.rows.item(0));\n                        } else {\n                            observer.error('There should be no more than one entry');\n                        }\n                        observer.complete();\n                    },\n                    (t, message) =&gt; {\n                        observer.error(message.message.toString());\n                        return true;\n                    });\n            });\n        });\n    }\n\n    clear() {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.db.transaction((tx) =&gt; {\n                tx.executeSql(`DELETE FROM ${this.name}`, [], (t, r) =&gt; observer.complete(), (t, e) =&gt; {\n                    observer.error(e.message.toString());\n                    return true;\n                });\n            });\n        });\n    }\n\n    all(): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.db.transaction((tx) =&gt; {\n                tx.executeSql(`SELECT * FROM ${this.name}`,\n                    [],\n                    (t, results) =&gt; {\n                        for (let i = 0; i &lt; results.rows.length; i++) {\n                            observer.next(results.rows.item(i));\n                        }\n                        observer.complete();\n                    },\n                    (t, message) =&gt; {\n                        observer.error(message.message.toString());\n                        return true;\n                    });\n            });\n        });\n    }\n\n    put(value: T): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.db.transaction((tx) =&gt; {\n                tx.executeSql(`INSERT OR REPLACE INTO ${this.name} VALUES (?, ?)`, [value.id, value.value],\n                    () =&gt; {\n                        observer.next(value);\n                        observer.complete();\n                    },\n                    (t, e) =&gt; {\n                        observer.error(e.message.toString());\n                        return true;\n                    });\n            });\n        });\n    }\n\n    getDenseBatch(keys: string[]): Observable&lt;T&gt; {\n        if (keys.length === 0) {\n            return Observable.empty&lt;T&gt;();\n        };\n\n        return Observable.create((observer: Observer&lt;T[]&gt;) =&gt; {\n            this.db.transaction((tx) =&gt; {\n                let key = keys.map(x =&gt; '\\'' + x + '\\'').join(',');\n                tx.executeSql(`SELECT * FROM ${this.name} WHERE key IN (${key})`,\n                    [],\n                    (t, results) =&gt; {\n                        for (let i = 0; i &lt; results.rows.length; i++) {\n                            observer.next(results.rows.item(i));\n                        }\n                        observer.complete();\n                    },\n                    (t, e) =&gt; {\n                        observer.error(e.message.toString());\n                        return true;\n                    });\n            });\n        });\n    }\n}\ndescribe('WebSQLStorage: Class', () =&gt; {\n  let key1 = 'key1', key2 = 'key2';\n  let value1 = 'value1', value2 = 'value2';\n\n  it('should create empty storage', async(() =&gt; {\n    let storage = new WebSQLStorage&lt;TestKeyValue&gt;();\n    storage.init('test1').subscribe(() =&gt; {\n      storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeTruthy());\n    });\n  }));\n\n  it('should save one item ', async(() =&gt; {\n    let storage = new WebSQLStorage&lt;TestKeyValue&gt;();\n    storage.init('test2').subscribe(() =&gt; {\n      storage.put({ id: key1, value: value1 }).subscribe(() =&gt; {\n        storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeFalsy());\n      });\n    });\n  }));\n\n  it('should save/get one item', async(() =&gt; {\n    let storage = new WebSQLStorage&lt;TestKeyValue&gt;();\n    storage.init('test3').subscribe(() =&gt; {\n      let item = { id: key1, value: value1 };\n      storage.put(item).subscribe(() =&gt; {\n        storage.get(key1).subscribe(value =&gt; {\n          expect(value.value).toEqual(item.value);\n        });\n\n      });\n    });\n  }));\n\n  it('should save/get two items', async(() =&gt; {\n    let storage = new WebSQLStorage&lt;TestKeyValue&gt;();\n    storage.init('test4').subscribe(() =&gt; {\n      let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n      storage.put(items[0])\n      .subscribe(() =&gt; storage.put(items[1])\n        .subscribe(() =&gt; {\n          let i = 0;\n          storage.getDenseBatch([key1, key2])\n            .subscribe(value =&gt; expect(value.value).toEqual(items[i++].value));\n        }));\n    });\n  }));\n\n  it('should clear saved items', async(() =&gt; {\n    let storage = new WebSQLStorage&lt;TestKeyValue&gt;();\n    storage.init('test5').subscribe(() =&gt; {\n      let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n      storage.put(items[0])\n        .zip(() =&gt; storage.put(items[1]))\n        .subscribe(() =&gt; storage.clear()\n        .subscribe(() =&gt; {\n          storage.all().isEmpty().subscribe(isAny =&gt; expect(isAny).toBeTruthy());\n        }));\n    });\n  }));\n});\nIndexedDB implementation\nHow to use IndexedDB is here.\nThere are very useful tricks.\nexport class IndexedDBStorage&lt;T extends IItem&gt; implements IStorage&lt;T&gt; {\n    private databaseName: string = 'TripNoteDB';\n    private name: string;\n\n    private getDb(version?: number, storeName?: string): Observable&lt;IDBDatabase&gt; {\n        return Observable.create((observer: Observer&lt;number&gt;) =&gt; {\n            let req = version &amp;&amp; version &gt; 0 ? window.indexedDB.open(this.databaseName, version)\n                : window.indexedDB.open(this.databaseName);\n            req.onsuccess = (e) =&gt; {\n                let db = (&lt;any&gt;event.target).result;\n                observer.next(db);\n                db.close();\n                observer.complete();\n            };\n            req.onupgradeneeded = (e) =&gt; {\n                let db = (&lt;any&gt;e.target).result;\n                if (storeName &amp;&amp; !db.objectStoreNames.contains(storeName)) {\n                    db.createObjectStore(storeName, { keyPath: 'id' });\n                    let transaction = (&lt;any&gt;e.target).transaction;\n                    transaction.oncomplete = (event) =&gt; {\n                        observer.next(db);\n                        db.close();\n                        observer.complete();\n                    };\n                };\n            };\n            req.onblocked = (event) =&gt; observer.error('IndexedDB is blocked');\n            req.onerror = (e) =&gt; observer.error(e.error);\n        });\n    }\n\n    private getVersionOfDb(name: string): Observable&lt;number&gt; {\n        return this.getDb().map(db =&gt; {\n            if (!db.objectStoreNames.contains(this.name)) {\n                return db.version + 1;\n            } else {\n                return db.version;\n            }\n        });\n    }\n\n    init(name: string): Observable&lt;IndexedDBStorage&lt;T&gt;&gt; {\n        this.name = name;\n        return Observable.create((observer: Observer&lt;IndexedDBStorage&lt;T&gt;&gt;) =&gt; {\n            this.getVersionOfDb(name).subscribe((version) =&gt; {\n                this.getDb(version, name).subscribe(db =&gt; {\n                    observer.next(this);\n                    observer.complete();\n                });\n            });\n        });\n    }\n\n    all(): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.getDb().subscribe(db =&gt; {\n                let req = db.transaction(this.name, 'readwrite').objectStore(this.name)\n                    .openCursor();\n                req.onsuccess = (e) =&gt; {\n                    let res = (&lt;any&gt;event.target).result;\n                    if (res) {\n                        observer.next(res.value);\n                        res.continue();\n                    }\n                    observer.complete();\n                };\n                req.onerror = (e) =&gt; observer.error(e.error);\n            });\n        });\n    }\n\n    get(key: string): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.getDb().subscribe(db =&gt; {\n                let req = db.transaction(this.name).objectStore(this.name).get(key);\n                req.onerror = (e) =&gt; observer.error(e.error);\n                req.onsuccess = (e) =&gt; {\n                    observer.next(req.result);\n                    observer.complete();\n                };\n            });\n        });\n    }\n\n    clear(): Observable&lt;IStorage&lt;T&gt;&gt; {\n        return Observable.create((observer: Observer&lt;IStorage&lt;T&gt;&gt;) =&gt; {\n            this.getDb().subscribe(db =&gt; {\n                let req = db.transaction(this.name, 'readwrite').objectStore(this.name).clear();\n                req.onerror = (e) =&gt; observer.error(e.error);\n                req.onsuccess = (e) =&gt; {\n                    observer.next(this);\n                    observer.complete();\n                };\n            });\n        });\n    }\n\n    put(value: T): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.getDb().subscribe(db =&gt; {\n                let req = db.transaction(this.name, 'readwrite').objectStore(this.name).put(value);\n                req.onerror = (e) =&gt; {\n                    observer.error(e.error);\n                };\n                req.onsuccess = (e) =&gt; {\n                    observer.next(value);\n                    observer.complete();\n                };\n            });\n        });\n    }\n\n    getDenseBatch(keys: string[]): Observable&lt;T&gt; {\n        return Observable.create((observer: Observer&lt;T&gt;) =&gt; {\n            this.getDb().subscribe(db =&gt; {\n                let set = keys.sort();\n                let i = 0;\n                let req = db.transaction(this.name).objectStore(this.name)\n                    .openCursor();\n                req.onsuccess = (e) =&gt; {\n                    let cursor = (&lt;any&gt;event.target).result;\n                    if (!cursor) { observer.complete(); return; }\n                    let key = cursor.key;\n                    while (key &gt; set[i]) {\n                        // The cursor has passed beyond this key. Check next.\n                        ++i;\n                        if (i === set.length) {\n                            // There is no next. Stop searching.\n                            observer.complete();\n                            return;\n                        }\n                    }\n                    if (key === set[i]) {\n                        // The current cursor value should be included and we should continue\n                        // a single step in case next item has the same key or possibly our\n                        // next key in set.\n                        observer.next(cursor.value);\n                        cursor.continue();\n                    } else {\n                        // cursor.key not yet at set[i]. Forward cursor to the next key to hunt for.\n                        cursor.continue(set[i]);\n                    }\n                };\n                req.onerror = (e) =&gt; observer.error(e.error);\n            });\n        });\n    }\n}\n\nUnit tests for indexedDB:\ndescribe('IndexedDBStorage: Class', () =&gt; {\n  let key1 = 'key1', key2 = 'key2';\n  let value1 = 'value1', value2 = 'value2';\n\n  it('should create empty storage', (done) =&gt; {\n    let storage = new IndexedDBStorage&lt;TestKeyValue&gt;();\n    storage.init('test1').subscribe(() =&gt; {\n      storage.all().isEmpty().subscribe(isAny =&gt; {\n        expect(isAny).toBeTruthy();\n        done();\n      });\n    });\n  });\n\n  it('should save one item ', (done) =&gt; {\n    let storage = new IndexedDBStorage&lt;TestKeyValue&gt;();\n    storage.init('test2').subscribe(() =&gt; {\n      storage.put({ id: key1, value: value1 }).subscribe(() =&gt; {\n        storage.all().isEmpty().subscribe(isAny =&gt; {\n          expect(isAny).toBeFalsy();\n          done();\n        });\n      });\n    });\n  });\n\n  it('should save/get one item', (done) =&gt; {\n    let storage = new IndexedDBStorage&lt;TestKeyValue&gt;();\n    storage.init('test3').subscribe(() =&gt; {\n      let item = { id: key1, value: value1 };\n      storage.put(item).subscribe(() =&gt; {\n        storage.get(key1).subscribe(value =&gt; {\n          expect(value).toEqual(item);\n          done();\n        });\n      });\n    });\n  });\n\n  it('should save/get two items', (done) =&gt; {\n    let storage = new IndexedDBStorage&lt;TestKeyValue&gt;();\n    storage.init('test4').subscribe(() =&gt; {\n      let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n      let item1 = storage.put(items[0])\n        .merge(storage.put(items[1])).last()\n        .subscribe(y =&gt; {\n          storage.getDenseBatch([key1, key2]).toArray().subscribe(x =&gt; {\n            expect(x[0]).toEqual(items[0]);\n            expect(x[1]).toEqual(items[1]);\n            done();\n          });\n        });\n      });\n  });\n\n  it('should clear saved items', (done) =&gt; {\n    let storage = new IndexedDBStorage&lt;TestKeyValue&gt;();\n    storage.init('test5').subscribe(() =&gt; {\n      let items = [{ id: key1, value: value1 }, { id: key2, value: value2 }];\n      storage.put(items[0])\n        .merge(storage.put(items[1])).last()\n        .subscribe(x =&gt; storage.clear()\n          .subscribe(y =&gt; storage.all().isEmpty().subscribe(isAny =&gt; {\n              expect(isAny).toBeTruthy();\n              done();\n            })));\n    });\n  });\n});\n","id":"https://eapyl.github.io/use-websql-and-indexeddb-in-typescript/","title":"Use WebSQL and IndexedDB in Typescript"},"https://eapyl.github.io/use-zadgraph/":{"body":"Library can be downloaded. License is LPGL 2.1.\nif (dates.Count &gt; 0 &amp;&amp; dates.Count == values.Count)\n{\n    double max = FindMax(values);\n    if (!Directory.Exists(_imageFolderName))\n    {\n        Directory.CreateDirectory(_imageFolderName);\n    }\n    GraphPane myPane = new GraphPane();\n\n    // Set the titles and axis labels\n    myPane.Title.Text = \"Statistic of errors\";\n    myPane.XAxis.Title.Text = \"Day\";\n    myPane.YAxis.Title.Text = \"Percent\";\n    // Make up some data points based on the Sine function\n    PointPairList list = new PointPairList();\n    for (int i = 0; i &lt; dates.Count; i++)\n    {\n        double x = dates[i].Date.ToOADate();\n        double y = values[i];\n        list.Add(x, y);\n    }\n    myPane.XAxis.CrossAuto = true;\n    myPane.XAxis.Type = AxisType.Date;\n    myPane.XAxis.Scale.MinorStep = 1;\n    myPane.XAxis.Scale.MajorStep = 1;\n    myPane.XAxis.Scale.Format = \"dd.MM.yy\";\n    myPane.XAxis.MajorTic.IsBetweenLabels = true;\n    myPane.XAxis.Scale.Min = dates[0].ToOADate();\n    myPane.XAxis.Scale.Max = dates[dates.Count - 1].ToOADate();\n    myPane.XAxis.AxisGap = 3f;\n\n    myPane.YAxis.Scale.Max = max + 4;\n    myPane.YAxis.Scale.MinorStep = myPane.YAxis.Scale.Max/10;\n    myPane.YAxis.MajorGrid.IsVisible = true;\n    myPane.YAxis.Type = AxisType.Linear;\n    LineItem myCurve2 = myPane.AddCurve(\"Overall\",\n            list, Color.Blue, SymbolType.Diamond);\n    myPane.YAxis.Scale.MajorStep = myPane.YAxis.Scale.Max / 5;\n\n    myPane.Legend.Position = ZedGraph.LegendPos.Bottom;\n    int width = 800;\n    if (27 * dates.Count &gt; width)\n        width = 27 * dates.Count;\n    myPane.GetImage(width, 600, 800f).Save(Path.Combine(_imageFolderName, _imageFileName), System.Drawing.Imaging.ImageFormat.Jpeg);\n}\n","id":"https://eapyl.github.io/use-zadgraph/","title":"Use ZadGraph"},"https://eapyl.github.io/useful-linq-extensions/":{"body":"Useful LINQ extensions\nAfter reading a lot of articles about this theme, I start to use the next extensions\npublic static class Linq\n{\n    public static IEnumerable&lt;T&gt; Except&lt;T&gt;(this IEnumerable&lt;T&gt; source, IEnumerable&lt;T&gt; target, Func&lt;T, T, bool&gt; func)\n    {\n        return source.Except(target, new LambdaComparer&lt;T&gt;(func));\n    }\n\n    public static TResult With&lt;TInput, TResult&gt;(this TInput o, Func&lt;TInput, TResult&gt; evaluator)\n        where TInput : class\n    {\n        if (o == null) return default(TResult);\n        return evaluator(o);\n    }\n\n    public static TResult Return&lt;TInput, TResult&gt;(this TInput o, Func&lt;TInput, TResult&gt; evaluator, TResult failure_value) where TInput : class\n    {\n        if (o == null) return failure_value;\n        return evaluator(o);\n    }\n\n    public static bool Check&lt;TInput&gt;(this TInput o, Func&lt;TInput, bool&gt; evaluator) where TInput : class\n    {\n        if (o == null) return false;\n        return evaluator(o);\n    }\n\n    public static TInput If&lt;TInput&gt;(this TInput o, Func&lt;TInput, bool&gt; evaluator) where TInput : class\n    {\n        if (o == null) return null;\n        return evaluator(o) ? o : null;\n    }\n\n    public static TInput Unless&lt;TInput&gt;(this TInput o, Func&lt;TInput, bool&gt; evaluator) where TInput : class\n    {\n        if (o == null) return null;\n        return evaluator(o) ? null : o;\n    }\n\n    public static TInput Do&lt;TInput&gt;(this TInput o, Action&lt;TInput&gt; action) where TInput : class\n    {\n        if (o == null) return null;\n        action(o);\n        return o;\n    }\n\n    public static List&lt;TInput&gt; Delete&lt;TInput&gt;(this List&lt;TInput&gt; o, Func&lt;TInput, bool&gt; evaluator) where TInput : class\n    {\n        var listToDelete = o.Where(evaluator).ToList();\n        foreach (var input in listToDelete)\n        {\n            o.Remove(input);\n        }\n        return o;\n    }\n}\n\n\npublic class LambdaComparer&lt;T&gt; : IEqualityComparer&lt;T&gt;\n{\n    private readonly Func&lt;T, T, bool&gt; _lambdaComparer;\n    private readonly Func&lt;T, int&gt; _lambdaHash;\n\n    public LambdaComparer(Func&lt;T, T, bool&gt; lambdaComparer) :\n        this(lambdaComparer, o =&gt; 0)\n    {\n    }\n\n    public LambdaComparer(Func&lt;T, T, bool&gt; lambdaComparer, Func&lt;T, int&gt; lambdaHash)\n    {\n        if (lambdaComparer == null)\n            throw new ArgumentNullException(\"lambdaComparer\");\n        if (lambdaHash == null)\n            throw new ArgumentNullException(\"lambdaHash\");\n\n        _lambdaComparer = lambdaComparer;\n        _lambdaHash = lambdaHash;\n    }\n\n    public bool Equals(T x, T y)\n    {\n        return _lambdaComparer(x, y);\n    }\n\n    public int GetHashCode(T obj)\n    {\n        return _lambdaHash(obj);\n    }\n}\n","id":"https://eapyl.github.io/useful-linq-extensions/","title":"Useful LINQ extensions"},"https://eapyl.github.io/vs-2010-attach-to-process-w3wp-exe/":{"body":"Need to create the macros:\nPublic Module AttachToProcess\nPublic Function AttachToProcess(ByVal ProcessName As String) As Boolean\nDim proc As EnvDTE.Process\nDim attached As Boolean\nFor Each proc In DTE.Debugger.LocalProcesses\nIf (Right(proc.Name, Len(ProcessName)) = ProcessName) Then\nproc.Attach()\nattached = True\nEnd If\nNext\n\nReturn attached\nEnd Function\n\nSub AttachToW3WP()\nIf Not AttachToProcess(\"w3wp.exe\") Then\nSystem.Windows.Forms.MessageBox.Show(\"Cannot attach to process\")\nEnd If\nEnd Sub\nEnd Module\n\nLink\n","id":"https://eapyl.github.io/vs-2010-attach-to-process-w3wp-exe/","title":"VS 2010 Attach to process w3wp.exe"},"https://eapyl.github.io/wait-for-it/":{"body":"There is a possibility to control startup order in Compose using great script - wait-for-it.\nIt allows you to wait some docker containers which have long-running initialization process like databases.\n\nAnd there is step-by-step explanation how to use it:\n\nCopy wait-for-it.sh to your project\n\n\n\nCopy it to your docker image\n\nFROM ...\n...\nCOPY wait-for-it.sh .\n...\nCMD ...\n\n\nModify docker-compose.yml to call wait-for-it script:\n\nservice:\n    image: service:latest\n    expose:\n        - \"80\"\n    depends_on:\n        - database\n    command: [\"./wait-for-it.sh\", \"database:3306\", \"--timeout=360\", \"--\", \"command\"]\n\nwhere\n- command is a command which will be called by wait-for-it script after timeout or successful ping result to database:3306\nThanks.\n","id":"https://eapyl.github.io/wait-for-it/","title":"How to use wait-for-it with docker compose"},"https://eapyl.github.io/winrt-checksum-for-large-files/":{"body":"There is a good question about this.\n\nAlso there is a code. I have used MD5 algorithm for my purposes.\npublic async Task&lt;string&gt; GetFileChecksumAsync(string fileName)\n{\n  HashAlgorithmProvider alg = Windows.Security.Cryptography.Core.HashAlgorithmProvider.OpenAlgorithm(HashAlgorithmNames.Md5);\n  IStorageFile stream = await openFile(fileName);\n  using (var inputStream = await stream.OpenReadAsync())\n  {\n    Windows.Storage.Streams.Buffer buffer = new Windows.Storage.Streams.Buffer(BUFFER_SIZE);\n    var hash = alg.CreateHash();\n\n    while (true)\n    {\n      await inputStream.ReadAsync(buffer, BUFFER_SIZE, InputStreamOptions.None);\n      if (buffer.Length &gt; 0)\n        hash.Append(buffer);\n      else\n        break;\n    }\n\n    return CryptographicBuffer.EncodeToHexString(hash.GetValueAndReset()).ToUpper();\n  }\n}\n","id":"https://eapyl.github.io/winrt-checksum-for-large-files/","title":"WinRT Checksum for large files"},"https://eapyl.github.io/xamarin-dev-days-in-warsaw/":{"body":"Hi All, it is my overview of Xamarin Dev Days - short summary. Hope it will be useful to create an  impression what you can expect from this event.\nMy stream technology is server-side .NET or ASP.NET MVC. My current project is on .NET platform, the main technology is Windows Workflow Foundation and I am not using Xamarin platform. But I had a small experience in Xamarin that I got during working on my previous project.\n\nSome time ago I had a chance to visit Xamarin Dev Days event in Warsaw. It was one day event in Warsaw Microsoft office. There were two part: the first one is generic information about Xamarin ecosystem and Azure Mobile Apps. The second one is hands on lab. So this presentation has been created to summarize and do a short recap mentioned event.\nAgenda:\n\nIntroduction to Xamarin\nXamarin.Forms\nAzure Mobile Apps\nSample application\nResources\n\n\nThe first thing that you should keep in mind when you are talking about Xamarin is that you are able to write application not using Visual Studio on Windows only, but also Xamarin Studio on Mac. As I understand, usually people are using Visual Studio to develop Android and Phone applications and Xamarin Studio on Mac to develop IOS application. But, of course, the team is using one code base. The reason of this approach, that it is much more quicker to build IOS application on MAC directly, without remote building using Visual Studio on Windows.\nThe second thing is that Xamarin is not only about developing cross-platform applications using Visual Studio or Xamarin Studio, but Xamarin also provides possibility to test you application on various number of devices using Xamarin Cloud. As you can imagine, it is very expensive to buy all set of mobile devices for testing, so this cloud allows you to run your application on thousand of real devices in the cloud, analyze detailed test reports with results, screenshots, and performance metrics. Also it allows you to measure performance of your application. Sounds very cool, but there was a question from Xamarin Dev Days presenter about if there is someone who is using this cloud and nobody answered.\nThe third thing is about building and continuous integration. Actually it is not about Xamarin but about TFS(Team Foundation Server). You are able to install it on your private server or it is possible to use Visual Studio Online service from Microsoft. It is free for small teams. It provides opportunity to work with your code (git), use agile board to organize your work, set up your continuous integration project (pure version of team city), create test cases. I heard that they added Wiki also.\nThe last one is about distributing and monitoring. I cant say a lot about distributing as I have never put any application to stores. As for monitoring, there is Xamarin Insight. It is the same approach as Visual Studio Application Insights. It is an extensible analytics service that helps you understand the performance and usage of your live mobile application. It's designed for developers, to help you continuously improve the performance and usability of your app. It allows:\n\nsee user sessions in real time\nsee which users are being affected by which errors\nsee stacktraces for each exception\nsee device stats for each exception (operating system, app version, network status, device orientation, jalbreak status, and bluetooth status)\nsee advanced reporting and filtering of aggregate exception statistics\nsetup webhooks for triggering actions on certain Insights events\nintegrate with third-party services (Campire, Github, HipChat, Jira, PivotalTracker, and Visual Studio Online)\n\nApproaches:\n\nSeparate solutions for each platform (Android, IOS, Windows)\n\nMany projects, many languages, many teams\n\n\nOne universal solution (JS + HTML + CSS) - Cordova\n\nSlow performance, limited native API\n\n\nXamarin approach (shared code + platform specific UI)\n\nGood performance, almost all native API\n\n\nReactNative and NativeScript\n\nOnly Android and IOS (UWP in future)\n\n\n\nHere I want to show the main ways to build mobile application.\n\n\nOf course, firstly it is native apps. It is clear. Swift, object-C for IOS, java is for Android, C# is  for Windows Phone. It means you should have and support many projects and many teams. It is a good option if you are planning to build complex and big mobile application. The best scenario is if this application has only mobile version.\nUniversal solution. You are able to use Cordova and build you application using JavaScript. Personally I really like this approach as you are able to build almost any type of application using Javascript now. To execute javascript on server - NodeJs. For desktop application there is Electron framework. Cordova is to create mobile applications. The problem here is performance. The resulting applications are hybrid, meaning that they are neither truly native mobile application (because all layout rendering is done via Web views instead of the platform's native UI framework) nor purely Web-based (because they are not just Web apps, but are packaged as apps for distribution and have access to native device APIs). [link]\nAnd Xamarin. It looks like win-win strategy if you already have web or desktop application written on .NET. You are able to share code, get native performance (almost, depends how you are creating application, Xamarin.Forms, for example, can create non the best implementation), access to all native API (almost). If there is a new version of OS, need to wait implementation in Xamarin up to one month.\nReactNative and NativeScript created and supported by Facebook and Telerik. ReactNative hasnt final version still, but NativeScript has version 2.0. They are the most young libraries in the list. JavaScript is the language to write a code. But unlike Cordova transform Javascript elements to native UI elements. Support Android and IOS now. Microsoft is working to add UWP here (NativeScript). Looks like the most perspective platforms. You are able to use Angular2 + Typescript + NativeScript or ReactJs + ReactNative to write mobile applications and share code also with your web version of application. Probably it is the best frameworks if your application is web first.\n\nXamarin features\n\nProduce ARM binary for Apple store\nProduce APK for Android\nPossibility to use only one IDE (Visual Studio)\nAndroid Hyper-V and IOS Remote emulators\nDesigners for IOS, Android and Windows Phone in Visual Studio\nXamarin Studio for Mac\nMVVM pattern (XAML)\n\nHere I put the main interesting features of Xamarin:\n\nXamarin allows to ship native app bundles on the App Store. Ahead-of-Time (AOT) compiler compiles Xamarin.iOS apps directly to native ARM assembly code, meaning your app is a native platform binary.\nAs for Android, Xamarin.Android uses just-in-time compilation for sophisticated runtime optimization of your apps performance, meaning your app is a native Android APK.\nAlso I talked that we are able to use only one IDE to develop applications in theory. \nMicrosoft Visual Studio 2015 includes an Android emulator that you can use as a target for debugging your Xamarin.Android app: Visual Studio Emulator for Android. This emulator uses the Hyper-V capabilities of your development computer, resulting in faster launch and execution times than the default emulator that comes with the Android SDK. Also it is possible to debug IOS in Windows using remote simulator.\nVisual Studio supports also visual designers to build UI. It works almost the same like it works for WPF.\nAlso there is Visual Studio for Mac.\nThe Model-View-ViewModel (MVVM) architectural pattern was invented with XAML in mind. The pattern enforces a separation of the XAML user interface (the View) from the underlying data (the Model) through a class that serves as an intermediary between the View and the Model (the ViewModel). The View and the ViewModel are often connected through data bindings defined in the XAML file. The BindingContext for the View is usually an instance of the ViewModel. link\n\nSharing code\n\nPortable class library\nShared projects\nUpcoming .NET Standard 2.0\n\nCurrently there are two ways to write shared code in Xamarin:\n\nShared project. Unlike most other project types, a Shared Project has no 'output' assembly. During compilation, the files are treated as part of the referencing project and compiled into that DLL. If you wish to share your code as a DLL then Portable Class Libraries are a better solution. Shared code can be branched based on the platform using compiler directives (eg. using #if _ANDROID_ , as discussed in the Building Cross Platform Applications document).\nPortable library. Only a subset of the .NET framework is available to use, determined by the profile selected (see the Introduction to PCL for more info).\nUpcoming .net standard 2.0 will support Xamarin. Basically Microsoft introduced a new .NET Standard Library. The .NET Standard Library is a formal specification of .NET APIs that are intended to be available on all .NET runtimes. The motivation behind the Standard Library is establishing greater uniformity in the .NET ecosystem.\n\nXamarin plugins (nuget)\n\nBattery\nConnectivity\nGeolocation\nMedia\nSettings\nText to speech\n...\n\nAnother one nice feature of Xamarin is Xamarin plugins that can be downloaded using nuget. These libraries allow you to use functionality that adds cross-platform functionality or abstracts platform specific functionality to a common API, like battery, geolocation, media and so on.\nYou are able to find the whole list of plugins here.\nXamarin.Forms\n\nShared UI \nPages, layouts, controls\nTwo-ways data binding\nNavigation\nAnimation\nDependency service, messaging center\nXamarin.Forms 2.0 - Performance\nThemes\nData pages\nNative embedding\n\nUse the Xamarin.Forms API provides a way to quickly build native apps for iOS, Android and Windows completely in C#. Xamarin.Forms is included with Visual Studio.\n\nXamarin allows sharing not only code between platforms, but also UI. During compilation created abstract XAML is transformed to platform specific. For example, there is the next XAML element: Entry, what is TextBox in Windows Phone. So we have an platform-specific equivalent for every control from Xamarin.Form.\nThere are three main groups in Xamarin.Form:\n\nA Xamarin.Forms.Page represents a View Controller in iOS or a Page in Windows Phone. On Android each page takes up the screen like an Activity, but Xamarin.Forms Pages are not Activities.\nThe Layout class in Xamarin.Forms is a specialized subtype of View, which acts as a container for other Layouts or Views. It typically contains logic to set the position and size of child elements in Xamarin.Forms applications.\nXamarin.Forms uses the word View to refer to visual objects such as buttons, labels or text entry boxes - which may be more commonly known as controls of widgets.\n\n\nData binding connects two objects, called the source and the target. The source object provides the data. The target object, which must be a bindable property, will consume (and often display) data from the source object.\nXamarin.Forms provides a number of different page navigation experiences, depending upon the Page type being used: Tabbed Page, Hierarchical Navigation, CarouselPage and so on.\nXamarin.Forms includes its own animation infrastructure that allows for easy creation of simple animations, while also being versatile enough to create complex animations. The Xamarin.Forms animation classes target different properties of visual elements, with a typical animation progressively changing a property from one value to another over a period of time.\nXamarin.Forms allows developers to define behavior in platform-specific projects. DependencyService then finds the right platform implementation, allowing shared code to access the native functionality.\nXamarin.Forms MessagingCenter enables view models and other components to communicate with without having to know anything about each other besides a simple Message contract.\nNative Embedding. Platform-specific controls can be directly added to a Xamarin.Forms layout. It is possible to add platform-specific controls to a Xamarin.Forms layout, and how to override the layout of custom controls in order to correct their measurement API usage.\n\nAzure Mobile Apps\n\n\nStable backend\nOffline sync\nData storage (tables, sql)\nAuthentication (Microsoft, Google, Facebook, Twitter)\nPush notifications\n\nAzure App Service is a fully managed Platform as a Service (PaaS) that brings a rich set of capabilities to web, mobile and integration scenarios.\n\nBuild offline-ready apps with data sync.\nPush Notifications allows you to engage your clients with instant push notifications on any device.\nAuthorization using different approaches\nSave data.\n\nTake a look\n\nApp Service Helpers\nContoso Moments\n\nWant to mention two nice libraries/ applications:\n\nApp Service Helpers (ASH) makes it as easy as possible to add data storage and authentication to your mobile app with Microsoft's Azure App Service Platform. ASH was built with the mobile developer in mind, and requires no previous experience with backends as a service (BaaS). This lib was developed as a supplemental library to Microsoft's Azure Client SDK. Rather than replacing this library, ASH extends it by lowering the barrier to entry for developers who wish to build cloud-connected mobile apps in C#.\nIt is a good example how to use Azure Mobile services. Contoso Moments is a photo sharing application that demonstrates the following features of Azure App Service:\n\nApp Service authentication/authorization\nContinuous Integration and deployment\nMobile app server SDK\nMobile offline sync client SDK\nMobile file sync SDK\nMobile push notifications\n\n\n\nSample application\nI have created a small sample application. The source code is available here. It is simple carousel application that shows information about morning exercises.\nReferences:\nThere are a list of references and interesting information about Xamarin. Thank you for reading. Please feel free to ask any questions, I will try to answer.\n\nGithub dev-days-labs\nXamarin Dev Days\nXamarin Warsaw Mobile Developers Group\nXamarin Training Series\nXamarin bootcamp training\nXamarin Dev page\nXamarin Dev days - presentation\n\n","id":"https://eapyl.github.io/xamarin-dev-days-in-warsaw/","title":"Xamarin Dev Days in Warsaw"}},"docInfo":{"https://eapyl.github.io/":{"body":0,"title":0},"https://eapyl.github.io/0x80004005-failed-to-execute-url/":{"body":69,"title":4},"https://eapyl.github.io/about/":{"body":8,"title":0},"https://eapyl.github.io/add-dotnet-command-to-alias-of-bash/":{"body":80,"title":5},"https://eapyl.github.io/api-facebook/":{"body":448,"title":2},"https://eapyl.github.io/asp-net-mvc-and-html-hidden/":{"body":27,"title":3},"https://eapyl.github.io/asp-net-mvc-bundle-minification/":{"body":23,"title":4},"https://eapyl.github.io/auto-deployment-for-ssrs-reports/":{"body":1050,"title":4},"https://eapyl.github.io/avoid-ambiguous-invocation-for-extension-methods/":{"body":19,"title":5},"https://eapyl.github.io/backup-influxdb-in-docker/":{"body":247,"title":3},"https://eapyl.github.io/bootstrap-datepicker-week-mode-view/":{"body":10,"title":5},"https://eapyl.github.io/bootstrap-recaptcha-css-problem/":{"body":17,"title":4},"https://eapyl.github.io/cake-net-useful-scripts-for-angularjs-dotnet-core-docker-application/":{"body":751,"title":8},"https://eapyl.github.io/create-line-chart-use-net-2-0/":{"body":8,"title":6},"https://eapyl.github.io/cron-schedule-using-fsharp/":{"body":744,"title":4},"https://eapyl.github.io/cron-service-using-fsharp-on-net-core/":{"body":72,"title":6},"https://eapyl.github.io/daemon-cron-using-fsharp/":{"body":159,"title":4},"https://eapyl.github.io/discord-belarus-chat-by/":{"body":8,"title":3},"https://eapy